INSERT INTO `tb_anime` VALUES (24, '耳をすませば', '侧耳倾听', '讲述主人公──初中女生月岛雫爱好阅读，一天他在所借的几本图书的图书卡上留意到一个总比她早借得该书阅读的人─天泽圣司。与她及后与天泽本人遇上的经历，与一次跟天泽家的胖家猫的跟踪结缘下到达天泽在半山山丘的家，从此展开了月岛与天泽的一段感情与相互鼓励的愿望，故事亦隐约说明中学生升学现实与实现心愿的权衡──“原石”虽美，但仍需雕琢才能成大器；而月岛雫与天泽家人合奏的一幕更为不少观众所着迷。\r\n\r\n故事在天泽家中还有另一个插曲，在天泽家的一头猫男爵雕塑，而猫男爵的眼睛镶嵌著两颗宝石，夕阳下折射的光芒给作客的月岛雫着迷；这尊猫男同时也见证著古董收藏家的天泽爷爷与他的情人当年的凄美故事，也带给月岛雫创作小说的灵感与心路历程；猫男爵与那头胖猫及后在2002年的吉卜力工作室另一作品《猫的报恩》中再次出现，并成为主角。', 'group1/M00/00/44/CgAABGGwe3KAUPRqAACmUZUO3nA965.jpg', 'group1/M00/00/44/CgAABGGwe3WAWwK5AAAE5VdrGvg245.jpg', 0, 1, 1, '2021-12-08 09:31:33.526654', '2021-12-08 09:31:33.906440', 1);
INSERT INTO `tb_anime` VALUES (25, '言の葉の庭', '言叶之庭', '作品以爱情来临前的孤独——“孤悲”来呈现“恋爱”的主题。梅雨时节，以成为鞋匠为目标的高中生孝雄与神秘的女性百香里，在雨中的日本庭园中相遇。以女性留给少年的一篇万叶集为契机，故事就此开展……。', 'group1/M00/00/45/CgAABGGwe7SAcqiMAAYOX2GR34M540.jpg', 'group1/M00/00/45/CgAABGGwe7WAOdYnAAAE7q3qRtc584.jpg', 0, 1, 1, '2021-12-08 09:32:37.697869', '2021-12-08 09:32:38.040784', 1);
INSERT INTO `tb_anime` VALUES (26, '時をかける少女', '穿越时空的少女', '　　17岁少女绀野真琴是一个活泼跳脱的少女。在一次普通值日工作中，真琴不小心摔倒了，自此她发现自己拥有了穿越时空的能力。她兴奋不已，掌握了穿越时空的方法后，她经常用这个方法去解决生活中许多令她困扰十分的事。\r\n　　喜欢棒球的真琴与同班的两名男生千昭与功介有着共同爱好。一天，与她本是好朋友的千昭突然向她表达爱意，手足无措了她再次穿越时空希望可以躲避这件事的发生。但没想到，千昭会跟同学友梨在一起了，而友梨也是一直喜欢千昭的。此时，暗恋功介的果穗误以为真琴是功介的女友。\r\n　　为了帮忙解决朋友的问题，真琴不断以同样的方法回到过去。她突然发现自己手臂上的数字原来是穿越时空的次数，次数变得越来越少，与此同时她也发现了千昭的秘密…… ', 'group1/M00/00/46/CgAABGGwe_uAQlOkAAGuHnzhGNg957.jpg', 'group1/M00/00/46/CgAABGGwe_2AI6HvAAAEZGajVDw005.jpg', 0, 1, 1, '2021-12-08 09:33:49.990646', '2021-12-08 09:33:50.332491', 1);
INSERT INTO `tb_anime` VALUES (27, 'スラムダンク', '灌篮高手', '　　樱木花道，湘北高校一年级生。在初中有被50个女生连续抛弃的历史。因第50个女生的一句“我喜欢的是篮球队的小田同学。”而对篮球深恶痛绝。上高中不经意被美少女赤木晴子的一句：“你喜欢篮球吗？”又燃起希望。为得到晴子的芳心，花道不顾一切的加入篮球队，并以惊人的速度进步。\r\n　　在湘北篮球队中，队长赤木刚宪是一位一直因无良好队友而无法出人头地的DUNK高手。然而在这一年初中时已是篮球高手的流川枫，大病初愈的宫城良田，曾误入歧途的初中时MVP三井寿加入湘北篮球队，使赤木队长的称霸全国不再只是梦想。在县大赛时，赤木刚宪，流川枫，宫城良田，三井寿和新手樱木花道通力合作，终于拿到全国大赛的入场券。', 'group1/M00/00/48/CgAABGGwfFiAYlG-AAB0iyhn5x4491.jpg', 'group1/M00/00/48/CgAABGGwfFqAOgu-AAAFSx-QpUg395.jpg', 0, 1, 1, '2021-12-08 09:35:22.709019', '2021-12-08 09:35:23.055497', 1);
INSERT INTO `tb_anime` VALUES (28, '君の名は。', '你的名字。', '　　在每千年回归一次的彗星造访过一个月之后的日本。\r\n　　某个深山的乡下小镇，女高中生三叶每天都过着忧郁的生活。\r\n　　而她烦恼的不光有担任镇长的父亲所举行的选举运动，还有家传神社的古老习俗。\r\n　　在这个小小的城镇，周围都只是些爱瞎操心的老人。为此三叶对于大都市充满了憧憬。\r\n　　“下辈子就让我成为东京的帅哥吧……！！！”\r\n　　然而某一天，自己做了一个变成男孩子的梦。\r\n　　这儿有着陌生的房间、陌生的朋友。而眼前出现的则是东京的街道。\r\n　　三叶虽然感到困惑，但是能够来到朝思暮想的都市生活，让她觉得神清气爽。\r\n　　“不可思议的梦……”\r\n　　另一方面在东京生活的男高中生·泷也做了个奇怪的梦。\r\n　　他在一个从未去过的深山小镇中，变成了女高中生……\r\n　　那么他们体验的梦境到底有什么秘密呢？\r\n　　原本不会相遇的两人由此相逢。\r\n　　少女和少年奇迹的故事，开始了。', 'group1/M00/00/49/CgAABGGwfHqATUz2AADyniIWyqc975.jpg', 'group1/M00/00/49/CgAABGGwfHuAAMvUAAAE3UJNqnQ680.jpg', 0, 1, 1, '2021-12-08 09:35:55.792671', '2021-12-08 09:35:56.133821', 1);
INSERT INTO `tb_anime` VALUES (29, '名探偵コナン 迷宮の十字路', '名侦探柯南 迷宫的十字路口', '小五郎应京都寺院的邀请，前往京都调查寺内八年前佛像盗窃事件。寺院早前得到佛像下落的线索，是一件有不同图案的图画，提供给小五郎，以便尽快寻回佛像。同时间，东京、大阪和京都发生杀人事件，三个城市的警方调查后，发现事件中的死者都是盗贼团“源氏萤”的成员，毎人都有一个代名，以《义经》内的传统人物命名。\r\n服部亦因此事，前往京都调查杀人事件的真相。期间遇上柯南，两人一起调查两宗事件，发现两宗事件都有共同点，有助解开八年前佛像盗窃事件。在调查期间亦发生杀人案，服部因此而受袭，和叶亦因查找施袭者线索而被人挟持。', 'group1/M00/00/4B/CgAABGGwfRaAGNDuAAP6-p5RVhQ477.jpg', 'group1/M00/00/4C/CgAABGGwfReAJixfAAAFRNmfOs4129.jpg', 0, 1, 1, '2021-12-08 09:38:32.188904', '2021-12-08 09:38:32.530961', 1);
INSERT INTO `tb_anime` VALUES (30, '名探偵コナン から紅の恋歌', '名侦探柯南 殷红的恋歌', '大阪的地标日卖电视台突发爆炸事件！\r\n那时，里面正在录制“皋月杯”百人一首和歌赛记者会，而突发事件让全场陷入恐慌！\r\n轰然倒塌的大楼里，唯有西部名侦探服部平次和他的青梅竹马远山和叶被困其中，但在千钧一发之际，柯南将两人救出。\r\n在这如同恐怖行动的事件中，众人既不知道犯人所图为何，犯人也没有主动发表声明，这让柯南与平次非常不解。\r\n混乱之中，柯南一行人遇见了自称是“平次未婚妻”的女性。她的名字是大冈红叶。她说自己是【在小时候就向平次求过婚的命中注定之人】。而且，她还是赢得百人一首和歌赛的高中生组冠军，被称作“未来的女皇”。\r\n与此同时，在京都岚山的日式住宅内，皋月杯的获胜选手惨遭杀害。而那时现场的监视器上显示出来的竟是红叶的身影。在那里，某首“歌谣”正在低沉地萦绕——', 'group1/M00/00/4D/CgAABGGwfXSAMvjcAAUMF8wVrVU068.jpg', 'group1/M00/00/4D/CgAABGGwfXWAL5BGAAAFkd76R1g533.jpg', 0, 1, 1, '2021-12-08 09:40:06.124235', '2021-12-08 09:40:06.467555', 1);
INSERT INTO `tb_anime` VALUES (31, '夜は短し歩けよ乙女', '春宵苦短，少女前进吧！', '对学妹“黑发少女”一见倾心的“前辈”，今天也是进行着名为『尽可能进入她的眼帘』的作战——简称“尽(进)她眼作战”。\r\n春之先斗町、夏之旧书市、秋之学园祭、而后是冬天的到来…。在京都这个城市中，在被卷入充满个性的同伴们所引发的一个个奇妙事件的同时，季节流转。\r\n只能埋藏于内心的“前辈”的恋心，到底会去向何方！？', 'group1/M00/00/4E/CgAABGGwfZ2AIbabAAOGXKWpqC8341.jpg', 'group1/M00/00/4E/CgAABGGwfZ6AGYYSAAAFzVDyeDY151.jpg', 0, 1, 1, '2021-12-08 09:40:46.853212', '2021-12-08 09:40:47.208820', 1);
INSERT INTO `tb_anime` VALUES (32, 'あの日見た花の名前を僕達はまだ知らない。', '我们仍未知道那天所看见的花的名字。', '从小时候起一直青梅竹马的6人，却在升上高中之后彼此有了距离。不太与人们接触的主角宿海仁太、有点被小太妹熏染的安城鸣子、进入重点高中的松雪集与鹤见知利子、放弃读高中而展开旅行的久川铁道、只有幼年死去的本间芽衣子（灵魂，只有仁太能看见）还是一如从前。有一天，芽衣子对仁太说：“帮我实现一个愿望吧”。仁太虽然有点为难，却还是答应帮助面码实现愿望。以此为契机，为了实现芽衣子的愿望，分散在各处的大家又再次地聚集在一起。', 'group1/M00/00/4F/CgAABGGwfdWAHciFAAJbPZ0rX0c028.jpg', 'group1/M00/00/4F/CgAABGGwfdeAbp2qAAAH7eRlyxo400.jpg', 0, 1, 1, '2021-12-08 09:41:43.427434', '2021-12-08 09:41:43.769971', 1);
INSERT INTO `tb_anime` VALUES (33, 'ユーリ!!! on ICE', '冰上的尤里', '　　背负着全日本的期待而挑战的大奖赛——结局是惨败，就此回到了故乡九州的花样滑冰选手胜生勇利。\r\n　　「是现役续行还是退役…二选一…」怀着这样的思绪蜗居于老家的勇利，而突然前来拜访勇利的是那位世界选手权五连霸的维克多·尼基弗洛夫…\r\n　　日本的危崖选手胜生勇利与俄罗斯的下克上选手尤利·普利谢斯基。两位YURI与王者维克多·尼基弗洛夫发起挑战的前所未闻的大奖赛，现在，拉开了序幕！', 'group1/M00/00/52/CgAABGGwfkGATJb4AAZk0QATjgw642.jpg', 'group1/M00/00/52/CgAABGGwfkKAYKoqAAAFoE3faig733.jpg', 0, 1, 1, '2021-12-08 09:43:30.789676', '2021-12-08 09:43:31.131553', 1);
INSERT INTO `tb_anime` VALUES (34, '氷菓', '冰菓', '以节能为座右铭的高中生折木奉太郎， 为一个小小的原因而加入了濒临废社的“古典文学部”。古典文学部的社员，包括他在社里认识的好奇宝宝，也就是女主角千反田爱瑠，还有他从国中就认识的伊原摩耶花和福部里志。这是他们四人以神山高中为舞台，对一桩桩事件展开推理的青春学园推理剧。“我很好奇！”奉太郎平静的灰色高中生活，因为千反田的这一句话而为之一变！', 'group1/M00/00/52/CgAABGGwfmWAPLyoAAM-BkX5djk915.jpg', 'group1/M00/00/52/CgAABGGwfmaAXKSuAAAGm0YwA_0462.jpg', 0, 1, 1, '2021-12-08 09:44:07.300070', '2021-12-08 09:44:07.643273', 1);
INSERT INTO `tb_anime` VALUES (35, 'けいおん！', '轻音少女', '春天，在新生决定社团的时候，田井中律硬拉着青梅竹马的秋山澪参观轻音部让其入部，在得知前辈们毕业后由于人数不足将面临闭部结局，秋山澪与琴吹紬成为了轻音部成员，但离4人指标还差1位名额。这时，一名弄错了部名的少女平泽唯误打误撞之下填补了最后一位空位，但这位少女却是一个连乐谱也看不懂的新人，学习成绩又差。而就是这样的4名少女，却展开了奏响青春的音乐之旅。', 'group1/M00/00/54/CgAABGGwftGAG-yoAAF0JdfW2bE893.jpg', 'group1/M00/00/54/CgAABGGwftKASOP4AAAFZb7jJu0785.jpg', 0, 1, 1, '2021-12-08 09:45:55.279002', '2021-12-08 09:45:55.620232', 1);
INSERT INTO `tb_anime` VALUES (36, 'けいおん!!', '轻音少女 第二季', '新学年开始，樱丘高中轻音部（轻音乐社）因原有部员全部毕业离校而无法达到部员最低人数（至少4人）。轻音部新成员只有秋山澪和田井中律，这下该如何是好呢？此时，平泽唯在阴差阳错的情况下把“轻音”当作“轻松的音乐”，又因小时候玩响板得到老师表扬，所以萌发申请入部的想法。另一方面，温柔可爱的千金大小姐琴吹䌷被田井中律强拉入社，于是，便有了贝司手秋山澪、吉他手平泽唯、鼓手田井中律及键盘手琴吹䌷。', 'group1/M00/00/56/CgAABGGwfyKAVc4fAAEfr8GETdw001.jpg', 'group1/M00/00/56/CgAABGGwfyOAa3EqAAAFTjKDSyg633.jpg', 0, 1, 1, '2021-12-08 09:47:15.586118', '2021-12-08 09:47:15.985891', 1);
INSERT INTO `tb_anime` VALUES (37, '映画けいおん！', '轻音少女 剧场版', '唯、澪、律、䌷四人即将高中毕业，决定进行一次毕业旅行。梓听到信息，也决定跟随学姐们一起旅行。她们各自提出自己想要去的目的地，最终通过抽签选中去伦敦的计划。几位女生在为毕业旅行做准备的同时，关于伦敦的想象也在飞驰……', 'group1/M00/00/59/CgAABGGwf6WAPtXkAAZ-yvZ0HBc920.jpg', 'group1/M00/00/59/CgAABGGwf6eAQJgpAAAE_4HeDlU925.jpg', 0, 1, 1, '2021-12-08 09:49:28.249008', '2021-12-08 09:49:28.656302', 1);
INSERT INTO `tb_anime` VALUES (38, '夏目友人帳', '夏目友人帐', '因为看得见妖怪而被人类疏远的女子夏目玲子，为了打发寂寞的日子，她向妖怪们发起挑战，并将败在自己手下的妖怪的名字写在一纸契约上，以此做为妖怪们成为自己属下的证据。 \r\n玲子的孙子夏目贵志得到了那些契约书所做成的“友人帐”，还继承了玲子的力量，能看到不会显现在人前的物体。而且也和玲子一样成为了被周围人疏远的一员。 \r\n可是，作为唯一继续了玲子血统的他却做出了一个重要的决定：将玲子夺过来的姓怪们的名字一一归还。在这样的夏目的身边，开始聚集起各种各样的妖怪们…… \r\n能看到妖怪的少年夏目贵志，与招财猫外表的妖怪喵先生一起，为大家讲述一个奇异、悲伤，怀念、令人感动的怪谈故事。', 'group1/M00/00/59/CgAABGGwf7aAMWHEAABfH1DYh2o206.jpg', 'group1/M00/00/59/CgAABGGwf7eAVpssAAAEW0LJyeQ148.jpg', 0, 1, 1, '2021-12-08 09:49:43.607909', '2021-12-08 09:49:43.966915', 1);
INSERT INTO `tb_anime` VALUES (39, '続 夏目友人帳', '续 夏目友人帐', '玲子的孙子夏目贵志从祖母的遗物中得到了那些契约书所做成的“友人帐”，同样他也能看到不会显现在人前的物体。可是，作为唯一继承了玲子血统的他却做出了一个重要的决定：将玲子夺过来的妖怪们的名字一一归还。伴随着归还名字的行动，贵志渐渐的认识了一个更真实的夏目铃子，同时也重新的认识了妖怪们——其实妖和人一样，有恶妖恶人，也有好妖好人，贵志慢慢的和铃子一样有了许多的朋友，不再感觉到孤独。', 'group1/M00/00/59/CgAABGGwf9iAFlemAAhJaubBQr8439.jpg', 'group1/M00/00/5A/CgAABGGwf9uAUKM8AAAEO66TDpo331.jpg', 0, 1, 1, '2021-12-08 09:50:19.822568', '2021-12-08 09:50:20.164259', 1);
INSERT INTO `tb_anime` VALUES (40, '夏目友人帳 参', '夏目友人帐 参', '夏目玲子的孙子夏目贵志从奶奶的遗物中得到了那些契约书所做成的“友人帐”，同样他也能看到不会显现在人前的物体。而且也和玲子一样成为了被周围人疏远的一员，被同龄人叫成“骗子”。可是，作为唯一继承了玲子血统的他却做出了一个重要的决定：将玲子夺过来的妖怪们的名字一一归还。在这样的夏目的身边，开始聚集起各种各样的妖怪们……能看到妖怪的少年夏目贵志，与招财猫外表的妖怪猫咪老师一起，为大家讲述一个奇异、悲伤、怀念、令人感动的怪诞故事。', 'group1/M00/00/5A/CgAABGGwf_SAbTE6AAYV6UNnqM4018.jpg', 'group1/M00/00/5A/CgAABGGwf_WAPZMjAAAEhJ4dguA975.jpg', 0, 1, 1, '2021-12-08 09:50:46.092004', '2021-12-08 09:50:46.434619', 1);
INSERT INTO `tb_anime` VALUES (41, '夏目友人帳 肆', '夏目友人帐 肆', 'テレビアニメ『夏目友人帳』の第4期シリーズ。', 'group1/M00/00/5A/CgAABGGwgBOAQjdjAAEboVIWGC8983.jpg', 'group1/M00/00/5A/CgAABGGwgBSATjToAAAE2lLW7WE028.jpg', 0, 1, 1, '2021-12-08 09:51:17.379664', '2021-12-08 09:51:17.727136', 1);
INSERT INTO `tb_anime` VALUES (42, '夏目友人帳 伍', '夏目友人帐 伍', '从小便能看见妖怪的少年夏目贵志。自从他从祖母玲子那里继承了与妖怪成为主从并将其名字书写在上的契约书“友人帐”以来，便与自称为保镖的妖怪猫咪老师一同，开始了将名字返还给妖怪的每一天。夏目与各种各样的妖怪与善良人们相遇，在构筑温暖的场所同时，也反复寄托着想要守护重要之物的想法。', 'group1/M00/00/5B/CgAABGGwgDCAJW7YAAFA2tHBje0677.jpg', 'group1/M00/00/5B/CgAABGGwgDGAJGYYAAAEOHW4tR0613.jpg', 0, 1, 1, '2021-12-08 09:51:46.356534', '2021-12-08 09:51:46.699245', 1);
INSERT INTO `tb_anime` VALUES (43, '夏目友人帳 陸', '夏目友人帐 陆', '', 'group1/M00/00/5C/CgAABGGwgG2AM6DqAAk1GDoSUVE317.jpg', 'group1/M00/00/5C/CgAABGGwgG-AOZ7xAAAEnlgBMKo454.jpg', 0, 1, 1, '2021-12-08 09:52:47.931210', '2021-12-08 09:52:48.272559', 1);
INSERT INTO `tb_anime` VALUES (44, '有頂天家族', '有顶天家族', '作品讲述原狸猫一族名门下鸭家的家主被人类下火锅后，不中用的下鸭四兄弟与其老母撑起家道中落的下鸭家的故事。老大矢一郎个性认真，但一到紧要关头就手足无措；老二变身为青蛙，不肯出井底；老三最爱看好戏，喜欢恶作剧；老幺胆子小，变身总是忘了藏尾巴。不靠谱的四兄弟………困境重重、霉运不断，四兄弟有机会保护母亲，重振家威吗？', 'group1/M00/00/5D/CgAABGGwgJiAPlL-AAFnaioiyz8477.jpg', 'group1/M00/00/5D/CgAABGGwgJqAWtIeAAAFheALsRY125.jpg', 0, 1, 1, '2021-12-08 09:53:31.217343', '2021-12-08 09:53:31.559467', 1);
INSERT INTO `tb_anime` VALUES (45, '有頂天家族2', '有顶天家族2', '人居市街内，狸猫匍地行，天狗翱长空。\r\n居于京都下鸭神社糺之森的下鸭一家。\r\n继承了离世的昔日狸猫界首领下鸭总一郎血脉的兄弟四人，和母亲快乐地生活着。\r\n而以继承了父亲总一郎浓厚的“傻瓜之血”的三男矢三郎为中心，引发了一夜骚乱。\r\n无论是下任的“伪右卫门”的选举、叔父夷川早云的阴谋还是“星期五俱乐部”上演的一幕，都化为一阵风消散在京都的夜空中。随着季节更迭，洛中又到了弥漫着沁人心脾的新叶之香的时节。毛球们毫不介意未消的凉意，也开始蠢蠢欲动起来。\r\n被天狗掠走而得授神通的人类美女-弁天已离开了京都。\r\n苦恋爱徒弁天并隐居已久的大天狗赤玉老师-如意岳药师坊为了消愁解忧，每日躺在破公寓里万年不晒的被褥里，喝着赤玉波特酒度日。\r\n就在这时，赤玉老师的儿子，在壮烈的父子吵架惨败后而消失的“二世子”在时隔百年之后，以英国绅士的身份重返故国。大惊失色。惊天动地。惊愕诧异。这一震动天狗界和狸猫界的大新闻瞬间就传遍了洛中洛外。\r\n以京都为舞台，人类、狸猫和天狗，各自想法复杂交错的毛球画卷第二幕，终于开幕！\r\n“趣事便是好事”。', 'group1/M00/00/5F/CgAABGGwgQWAVuSIAAFDHQA65wc016.jpg', 'group1/M00/00/5F/CgAABGGwgQaABmFUAAAFcCh3Rxo802.jpg', 0, 1, 1, '2021-12-08 09:55:19.332934', '2021-12-08 09:55:19.681607', 1);
INSERT INTO `tb_anime` VALUES (46, '劇場版 夏目友人帳 ～うつせみに結ぶ～', '剧场版 夏目友人帐～缘结空蝉～', '每天在人与妖怪之间过着忙碌日子的夏目，偶然与过去的同学・结城重逢了，以此想起了于妖怪有关的苦涩记忆。此时，夏目认识了在归还名字的妖怪记忆中出现的女性·津村容莉枝。知晓玲子的她，现在和独子椋雄一起平静地生活着。夏目通过和他们交流，心里也变得平静下来。但是这对母子所居住的城镇，似乎潜藏着神秘的妖怪。在调查此事回来的路上，寄生于猫咪老师身体上的“妖之种”，在藤原家的庭院中，一夜之间就长成树结出果实。不知为什么，吃掉了与自己形状相似果实的猫咪老师，竟然分裂成了3个？', 'group1/M00/00/60/CgAABGGwiMmAC4qTAALfX2v3B8Y782.jpg', 'group1/M00/00/60/CgAABGGwiMuARFr3AAAEaChXgLY039.jpg', 0, 1, 1, '2021-12-08 10:28:28.030483', '2021-12-08 10:28:28.282722', 1);
INSERT INTO `tb_anime` VALUES (47, '四月は君の嘘', '四月是你的谎言', '　　有马公生的母亲一心想把有马培育成举世闻名的钢琴家，而有马也不负母亲的期望，在念小学时就赢得许多钢琴比赛的大奖。11岁的秋天，有马的母亲过世，从此他再也听不见自己弹奏的钢琴声，沮丧的他也只好放弃演奏，但在14岁那年，经由儿时玩伴的介绍，有马认识了小提琴手宫园薰，并被薰的自由奔放吸引，没想到薰竟开口邀请公生在比赛时担任她的伴奏… ', 'group1/M00/00/61/CgAABGGwiP6AZvhjAAU_qpS2BGo474.jpg', 'group1/M00/00/61/CgAABGGwiP-AVUMbAAAEw04bxow262.jpg', 0, 1, 1, '2021-12-08 10:29:20.296762', '2021-12-08 10:29:20.550423', 1);
INSERT INTO `tb_anime` VALUES (48, 'ジョジョの奇妙な冒険 黄金の風', 'JOJO的奇妙冒险 黄金之风', '居住在意大利那不勒斯的青年乔鲁诺·乔巴拿，是继承了乔斯达家宿敌·DIO之血脉的儿子。\r\n幼年时遭受迫害而自暴自弃的他，由于拯救了一名黑帮男子，而学到了“相信他人”。不忘恩义、带着敬意对待自己的黑帮，让他的心变得率直。就这样，乔鲁诺开始对“黑帮明星”怀有憧憬。\r\n15岁的乔鲁诺，与统领意大利黑社会的黑帮组织“热情”一同引发事端，并成为被盯上的目标……', 'group1/M00/00/62/CgAABGGwiTiAER_WAAowqxw5THo916.jpg', 'group1/M00/00/62/CgAABGGwiTqAHlQsAAAFdUBx740931.jpg', 0, 1, 1, '2021-12-08 10:30:18.786085', '2021-12-08 10:30:19.042574', 1);
INSERT INTO `tb_anime` VALUES (49, '名探偵コナン 紺青の拳', '名侦探柯南 绀青之拳', '在19世纪末与海盗船一同沉入新加坡近海的、世界上最大的蓝宝石“绀青之拳”。在当地的富豪将其回收，于舞台上展现其真容时，在滨海湾金沙酒店附近发生了杀人案。现场留下了怪盗基德沾有血迹的预告函。而在那时，为了观看在新加坡举办的空手道锦标赛，小兰和园子到访了当地。\r\n由于没有护照所以无法出国的柯南本来应当在看家，但他被试图利用他的基德以魔术般的方法，强行带到了新加坡。若不服从对方就连回日本都做不到的柯南，眼镜、手表、衣服等全被夺走进行了变装。被没有注意到其真实身份的小兰问及名字，情急之下化名“亚瑟·平井”。\r\n基德得到了在某个宅邸的地下金库中沉睡着蓝宝石的情报。他以为很简单就可入侵成功，但无比危险的陷阱等待着基德。挡在他面前的，是400战无败绩的最强空手道家——京极真。基德的命运是……在那之后，就如预兆着什么不祥之事一般，从新加坡的象征——鱼尾狮中喷出了被染为鲜红的水！', 'group1/M00/00/62/CgAABGGwiTyAbAxGAAVe_Tlz3pQ178.jpg', 'group1/M00/00/62/CgAABGGwiT2AfrlPAAAFqWz0XUA959.jpg', 0, 1, 1, '2021-12-08 10:30:22.312512', '2021-12-08 10:30:22.565833', 1);
INSERT INTO `tb_anime` VALUES (50, '君の膵臓をたべたい', '我想吃掉你的胰脏', '她如此说了。\r\n“我想吃掉你的胰脏”\r\n\r\n春。\r\n晚开的樱花仍在绽放的4月。\r\n对他人毫无兴趣，总是独自一人读书的高中生“我”，在医院的等候室捡到了一册文库本。\r\n这本用手写的文字写着《共病文库》这一标题的书，是天真烂漫的班上人气王·山内樱良私下记录的日记本。\r\n樱良将自己身患胰脏的疾病、已经时日无多这件事，告诉了看到日记内容的“我”。\r\n对于她而言，那是对除了家人和医生以外的人隐藏病情的她，获得了唯一一位共享秘密之人的瞬间。\r\n樱良想要在临终之日到来之前，一边尽量过着一如既往的日常生活，一边去做想要做的事情，竭尽全力享受人生。\r\n在被她那奔放的行动牵着鼻子走的同时，“我”的内心也逐渐产生了变化。\r\n\r\n——那是，“我”的春日回忆。\r\n她的一生回忆。', 'group1/M00/00/62/CgAABGGwiUOAJWjgAARiRzNmhIg659.jpg', 'group1/M00/00/62/CgAABGGwiUSAcFEHAAAE0ZbTLDc136.jpg', 0, 1, 1, '2021-12-08 10:30:28.811583', '2021-12-08 10:30:29.066051', 1);
INSERT INTO `tb_anime` VALUES (51, '天気の子', '天气之子', '「想要试着去往那道光芒当中」\r\n\r\n高中一年级的夏天。从离岛离家出走，来到东京的帆高。\r\n他的生活立刻变得困窘，在度过孤独的每一天之后终于找到的工作，\r\n是为古怪的超自然杂志撰稿。\r\n\r\n如同预示着他接下来的命运一般，连日不断降下雨水。\r\n此时，在人潮熙熙攘攘的都市一角，帆高遇到了一位少女。\r\n\r\n由于某些缘故，和弟弟两个人一起坚强生活的少女·阳菜。\r\n她拥有不可思议的能力。\r\n\r\n「呐，现在开始就要放晴了哦」\r\n\r\n雨水逐渐停止，街道笼罩在美丽的光芒中。\r\n那是，仅仅在心中祈祷，就能让天空放晴的力量——', 'group1/M00/00/63/CgAABGGwiYKADSYCAAzRLHnfsLc599.jpg', 'group1/M00/00/63/CgAABGGwiYSANfQgAAAGrycuzgA157.jpg', 0, 1, 1, '2021-12-08 10:31:32.601152', '2021-12-08 10:31:32.856728', 1);
INSERT INTO `tb_anime` VALUES (52, '花とアリス 殺人事件', '花与爱丽丝杀人事件', '　　岩井俊二監督が、2004年に原作・脚本・監督を務めた「花とアリス」の前日譚を、自身初の長編アニメーション監督作「花とアリス殺人事件」として手がけていることがわかった。「花とアリス」で脚光を浴びた女優の蒼井優と鈴木杏が、それぞれアリス役と花役の声優として参加していることも発表された。 \r\n　　「花とアリス殺人事件」は、セリフを先行して収録する「プレスコ」で制作。すでに収録を終えた蒼井は「アリスだったあの日から、早10年。声も大分、野太くなっていますが、頑張りました。眩い青春時代を2度もありがとうございます」と語り、完成を心待ちにしている。一方の鈴木も、「花とアリスに再会できて、とてもとても嬉しいです。10年経って30歳近くになった（！）私たちが中学生の声になれているのか、、、ちょっと不安。でも見てくださる方が楽しんでくださればいいな、と思います」と心境を明かした。 \r\n　　今でも多くのファンに愛され続けている「花とアリス」だが、岩井監督も「作品を作り終えてもなお、あのふたりは僕の中に居座り、10年の歳月が過ぎてもなお、平然とそこに居続け、気がついたら僕にこのアニメを作らせていた」と語っており、さらには「ふたりがいつまで居座る気なのか、それはちょっと僕にもわからない」と含みのあるコメントを寄せた。 \r\n　　日常、友情、そして恋に揺れる2人の少女、花（鈴木）とアリス（蒼井）の姿を描いた前作。今回のアニメーションでは、岩井監督自ら脚本と音楽も担当し、ふたりの出会いのエピソードを展開する。2015年2月の公開に向け制作中だが、早くもポスタービジュアルが完成。花とアリスがアニメキャラとして描かれたポスターは、10月18日から劇場に掲出される。 \r\n　　石ノ森学園中学校へ転校してきた中学3年生の有栖川徹子（通称アリス）は、1年前に「ユダが、4人のユダに殺された」という、3年1組にまつわるウワサを聞かされる。さらに、アリスの隣の家が「花屋敷」と呼ばれ、近隣の中学生に怖れられていることを知る。そこに住む「ハナ」ならユダについて詳しいはずだと教えられたアリスは、花屋敷に潜入。そこで待ち構えていたのは、不登校のクラスメイト・荒井花（通称ハナ）だった。 \r\n　　そして前作と同様、今回も「キットカット」とのコラボレーションが決定。スペシャルパッケージが発売されるほか、特設サイト（http://nestle.jp/bra​nd/kit/）が設けられ、実写版のショートフィルムの公開とともにスペシャル映像の配信が予定されている。 \r\n　　「花とアリス殺人事件」は、15年2月に全国で公開。 ', 'group1/M00/00/67/CgAABGGwiqaAMV_GAAevGxJtj8A661.jpg', 'group1/M00/00/67/CgAABGGwiqqANrsFAAAEc7L0kaQ311.jpg', 0, 1, 1, '2021-12-08 10:36:26.678134', '2021-12-08 10:36:26.933991', 1);
INSERT INTO `tb_anime` VALUES (53, '秒速5センチメートル', '秒速5厘米', '时间是1990年代的日本，远野贵树与筱原明里原本是同班同学的好朋友，自从小学毕业之后，两人都没有再见一次面。分隔两地的两个人，靠着书信往来保持联络，直到贵树知道即将跟随家人搬到鹿儿岛，距离明里更远的地方，于是两人约定了再见面的时间。计划好的行程，却遇上了暴风雪……。', 'group1/M00/00/6A/CgAABGGwi4uAJLIrAANGcNBSr48360.jpg', 'group1/M00/00/6A/CgAABGGwi4yALXuNAAADvbBk7yg081.jpg', 0, 1, 1, '2021-12-08 10:40:12.809713', '2021-12-08 10:40:13.065507', 1);
INSERT INTO `tb_anime` VALUES (54, '蛍火の杜へ', '萤火之森', '某年夏天，6岁小女孩竹川萤来到爷爷家度假，她闯进了传说住满妖怪的山神森林。正当她因为迷路而焦急万分的时候，一个戴着狐狸面具的大男孩出现在她面前，并引领着萤找到回家的路。虽然萤分外感激，可是男孩却禁止她碰触自己的身体，原来这名叫银的男孩并非人类，他一旦被人类碰触就会烟消云散。在此后的日子里，萤和银成为好朋友，他们走遍了森林的每一个角落玩耍。日复一日，年复一年，每到夏天的时候萤就会如约来到森林和好朋友见面。她遵守着和银的约定，无论如何也不碰触银的身体。随着年龄的增长，萤和银对彼此的情感都悄悄发生了变化，他们共同期待相聚的日子，共同期待拥抱对方……', 'group1/M00/00/6C/CgAABGGwjFeAe9LtAAEy8QKnxvI234.jpg', 'group1/M00/00/6C/CgAABGGwjFuAFLBBAAAEh_lCHVA849.jpg', 0, 1, 1, '2021-12-08 10:43:39.599501', '2021-12-08 10:43:39.853322', 1);
