INSERT INTO `tb_places` VALUES (400, '全家便利店 圣迹樱之丘店', '日本东京都多摩市关户4丁目23', 35.64912366, 139.44648428, '全家便利店圣迹樱之丘分店，全家所出售的物品非常多元化，除了食品、饮料和日常用品之外，也出售车票、电话卡、周刊月刊、动漫等物品。', 1, 1, 0, '2021-12-08 09:31:33.979635', '2021-12-08 09:31:34.321396', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (401, '爱宕2丁目住宅区', '日本东京都多摩市爱宕2丁目2', 35.63405004, 139.43966999, '位于东京都多摩市爱宕2丁目的住宅社区，旁边有一座高高耸立的水塔。', 1, 1, 0, '2021-12-08 09:31:35.349462', '2021-12-08 09:31:35.698028', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (402, '京王百货店 圣迹樱之丘店', '日本东京都多摩市关户1丁目10-1', 35.65121774, 139.44716739, '位于圣迹樱之丘车站旁的京王百货是日本著名的连锁百货商店，于1986年开业，是附近的重要的商业中心，里面有多达140个部门，除了一般消费品外，还包括餐馆、健身房等。', 1, 1, 0, '2021-12-08 09:31:42.044278', '2021-12-08 09:31:42.390250', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (403, '圣迹樱之丘站', '日本东京都多摩市关户1丁目10-10', 35.65079, 139.44693299, '圣迹樱之丘站位于日本东京都多摩市关户，为京王电铁的铁路车站。', 1, 1, 0, '2021-12-08 09:31:44.660903', '2021-12-08 09:31:45.008093', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (404, '圣迹樱之丘站前', '日本东京都多摩市关户1丁目10', 35.65079, 139.446933, '', 1, 1, 0, '2021-12-08 09:31:49.149955', '2021-12-08 09:31:49.501345', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (405, '樱通街道', '日本东京都多摩市关户4丁目72', 35.64973663, 139.44652877, '樱通是位于圣迹樱之丘车站南边的一条大街，由于街道的两旁种满了樱花树，因此命名为樱通。', 1, 1, 0, '2021-12-08 09:31:52.554184', '2021-12-08 09:31:52.901230', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (406, '霞关桥', '日本东京都多摩市关户', 35.647476, 139.446608, '霞关桥位于圣迹樱之丘车站西南边，跨越流经多摩市的大栗川，向前行可以通往上山的山路。', 1, 1, 0, '2021-12-08 09:31:53.850291', '2021-12-08 09:31:54.191921', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (407, '伊吕波坡道', '日本东京都多摩市樱之丘1丁目', 35.646118, 139.446085, '通向山上伊吕波坡道樱之公园（いろは坂桜公園）的上坡路。', 1, 1, 0, '2021-12-08 09:31:57.097592', '2021-12-08 09:31:57.439853', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (408, '樱之丘环形路口', '日本东京都多摩市樱之丘2丁目2-6', 35.640819, 139.444488, '位于多摩市樱丘二丁目的回转路，靠近樱花公园。是东京都内唯一一个环形路口。', 1, 1, 0, '2021-12-08 09:31:59.726369', '2021-12-08 09:32:00.084372', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (409, '地球屋邮筒', '日本东京都多摩市关户1丁目', 35.65052903, 139.44684086, '以动画电影《侧耳倾听》中的地球屋为原型的邮筒，位于圣迹樱之丘车站外，能让大家投递属于自己的梦想与愿望。信箱内部也是按照影片场景所打造，制作的十分精美，但非特殊日子不对外开放。邮筒的旁边还有动画取景地的导览地图。', 1, 1, 0, '2021-12-08 09:32:06.269216', '2021-12-08 09:32:06.616933', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (410, '樱之丘四丁目弯道', '日本东京都多摩市樱之丘4丁目', 35.64411417, 139.44529413, '多摩市樱丘4丁目的一个上坡弯道，靠近天守台。', 1, 1, 0, '2021-12-08 09:32:09.875461', '2021-12-08 09:32:10.217228', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (411, '天守台阶梯', '日本东京都多摩市樱之丘1丁目53-17', 35.6442393, 139.44549549, '这是特别设计给行人使用的快捷上下山的阶梯，从关户天守台通往山下。', 1, 1, 0, '2021-12-08 09:32:11.521793', '2021-12-08 09:32:11.865195', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (412, '大栗川河堤', '日本东京都多摩市东寺方1丁目', 35.646915, 139.441782, '大栗川是流经东京都多摩市的一条河流，河堤两岸风景优美。', 1, 1, 0, '2021-12-08 09:32:15.327978', '2021-12-08 09:32:15.670428', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (413, '爱宕第二公园长椅', '日本东京都多摩市爱宕2丁目', 35.63364337, 139.43856653, '位于爱宕2丁目住宅区内爱宕第二公园的一处长椅。', 1, 1, 0, '2021-12-08 09:32:18.011673', '2021-12-08 09:32:18.353182', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (414, '金比罗宫', '日本东京都多摩市樱之丘1丁目53-1', 35.644796, 139.445335, '金比罗宫是位于东京都多摩市樱丘一丁目的神社。', 1, 1, 0, '2021-12-08 09:32:21.159042', '2021-12-08 09:32:21.501007', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (415, '樱花公园南面阶梯', '日本东京都多摩市樱之丘1丁目', 35.64529987, 139.44483015, '伊吕波坡道转弯处由北至南第一个阶梯。', 1, 1, 0, '2021-12-08 09:32:27.642976', '2021-12-08 09:32:27.993321', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (416, '耳丘', '日本东京都多摩市樱之丘4丁目', 35.64568104, 139.44262537, '圣迹樱之丘地区的一处高地，可眺望大栗川和远处城市。目前因土坡塌方等问题已禁止进入。', 1, 1, 0, '2021-12-08 09:32:28.521404', '2021-12-08 09:32:28.864485', 24, 1, '多摩市');
INSERT INTO `tb_places` VALUES (417, '新宿站', '日本东京都新宿区新宿3丁目38', 35.68940025, 139.70054448, '新宿站是日本东京新宿最主要的铁路车站，整个站区横跨东京都的新宿区与涩谷区，使用之铁路业者包括东日本旅客铁道（JR东日本）、小田急电铁、京王电铁、东京地铁及都营地铁等。其每日使用人次（以出入闸人次计算），JR路线为157万，属日本第1位；各铁路业者总和则达每日364万人次，是世界上使用人次最多的铁路车站。', 1, 1, 0, '2021-12-08 09:32:38.114257', '2021-12-08 09:32:38.455433', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (418, '甲州街道', '日本东京都新宿区新宿二丁目国道20号线', 35.68931181, 139.70608476, '原为“古甲州道”，是由江户幕府修建的五街道之一，以江户日本桥为起点经内藤新宿、八王子、甲府到信浓国的下诹访宿和中山道连通。沿途共有38个宿场。近代初期被称为“甲州海道”，1716年街道称为整改时改称“甲州道中”。现在的甲州街道是新宿站南口前天桥过山手线后，国道20号到东京都道311号环状八号线上高井户1丁目路口一段。', 1, 1, 0, '2021-12-08 09:32:45.837079', '2021-12-08 09:32:46.190309', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (419, 'DoCoMo代代木大厦', '日本东京都涉谷区千驮谷5丁目24-3', 35.68473383, 139.70292695, 'NTT DoCoMo代代木大厦是东京都第四高的摩天大楼，仅次于中城大厦、虎之门之丘与东京都厅舍。它拥有像帝国大厦等美国纽约的摩天大楼的设计外观。与一般商业大楼不同，它是NTT DoCoMo的业务用大楼，仅限公司相关人员进入。', 1, 1, 0, '2021-12-08 09:32:49.296115', '2021-12-08 09:32:49.638907', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (420, '新宿门', '东京都新宿区内藤町', 35.68829661, 139.70750272, '新宿御苑共有三个门，位于西北面的是新宿门，距离新宿站10分钟路程。', 1, 1, 0, '2021-12-08 09:32:54.042360', '2021-12-08 09:32:54.391842', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (421, '太鼓桥', '日本东京都新宿区内藤町１１', 35.68541277, 139.70588837, '太鼓桥是新宿御苑里的一座木桥，春夏在绿树红花的衬托下十分美丽。', 1, 1, 0, '2021-12-08 09:32:56.253668', '2021-12-08 09:32:56.595712', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (422, '东屋', '日本东京都新宿区内藤町11番地', 35.6848319, 139.70810421, '东屋本来是新宿御苑内一个不起眼的小亭子，在谷歌地球上也看不到它的位置（被树木遮挡住了），但因为新海诚将它作为《言叶之庭》的主要取景地而出名，所以又叫做言叶亭。', 1, 1, 0, '2021-12-08 09:32:58.563456', '2021-12-08 09:32:58.905598', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (423, '上海茶餐厅 猪八戒', '东京都涉谷区千驮谷1丁目7-11', 35.67851782, 139.71001193, '', 1, 1, 0, '2021-12-08 09:33:22.014768', '2021-12-08 09:33:22.357009', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (424, '藤棚', '日本东京都新宿区内藤町11番地', 35.6847227, 139.70842406, '旧御凉亭附近的紫藤花架，花开时非常美。', 1, 1, 0, '2021-12-08 09:33:23.953239', '2021-12-08 09:33:24.307503', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (425, '千驮谷站', '日本东京都涉谷区千驮谷1丁目', 35.68121, 139.711548, '千驮谷站是东日本旅客铁道中央本线的铁路车站，位于日本东京都涉谷区。', 1, 1, 0, '2021-12-08 09:33:28.063108', '2021-12-08 09:33:28.414568', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (426, '樱园地', '日本东京都新宿区内藤町11番地', 35.68188721, 139.7102654, '樱园地自古就是赏樱名所，其中种植着全国75种、共1500颗樱树。位置就在千驮谷门附近。', 1, 1, 0, '2021-12-08 09:33:32.267378', '2021-12-08 09:33:32.609005', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (427, '千驮谷坡道', '日本东京都涉谷区千驮谷6丁目', 35.68174474, 139.70965126, '位于涉谷区的千驮谷站东北面的一个坡道，周围有很多的住宅区。\n动画电影《言叶之庭》曾在此处取景。', 1, 1, 0, '2021-12-08 09:33:35.109783', '2021-12-08 09:33:35.453505', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (428, '草坪广场', '日本东京都新宿区内藤町11番地', 35.68296782, 139.70918715, '', 1, 1, 0, '2021-12-08 09:33:36.503413', '2021-12-08 09:33:36.845706', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (429, '蚕茧大厦', '日本东京都新宿区西新宿1丁目7-3', 35.69165316, 139.69682369, '蚕茧大厦是一座校舍建筑，世界第二高的教育大楼，203.7米的高度在东京摩天大楼中排名第18。大楼外形酷似蚕茧，采用钢架结构，以独特的造型结构吸引分解外来冲击力，从而保障自身的稳固性。蚕茧大厦的创新性外形和一流的立面设计处处体现了独特的魅力，因而赢得了Emporis年度天楼奖。 日本丹下建筑事物所2008年10月在东京西新宿设计建成了一座50层的大厦。建筑造形成长卵形，被称为“蚕茧大厦”。包含东京时尚学校、数码学校、医学护理学校3所教育机构，可供1万名学生使用，堪称垂直校园。其中设有3层中庭和多功能的走廊，以利于学生相互交流。设计围绕着核心筒旋转120度，排列3个教室区，功能流线简单而合理。', 1, 1, 0, '2021-12-08 09:33:37.841584', '2021-12-08 09:33:38.184309', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (430, '旧御凉亭', '日本东京都新宿区内藤町11', 35.68445582, 139.70877375, '旧御凉亭是台湾在住的日本人赠送给当时尚是皇子的昭和天皇的结婚礼物，中式建筑风格，1923年开始修建，1927年建成。\n位于上池附近日本庭院区域内，用于欣赏水边景色、乘凉、休息娱乐。是新宿御苑内的一处高地，远眺景观很好。', 1, 1, 0, '2021-12-08 09:33:41.223974', '2021-12-08 09:33:41.628170', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (431, '千驮谷门', '日本东京都涉谷区千驮谷6丁目1', 35.68231014, 139.70870569, '新宿御苑共有三个出入口，位于南面的是千驮谷门，距离千驮谷车站5分钟路程。', 1, 1, 0, '2021-12-08 09:33:43.218697', '2021-12-08 09:33:43.560426', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (432, '北参道路口东北', '日本东京都涉谷区千驮谷4丁目', 35.68086758, 139.70514238, '', 1, 1, 0, '2021-12-08 09:33:44.508335', '2021-12-08 09:33:44.864500', 25, 1, '东京都');
INSERT INTO `tb_places` VALUES (433, '哲学堂公园', '日本东京都中野区松之丘1-34-28', 35.72222857, 139.67404311, '哲学堂公园位于东京都中野区的公园，原是镰仓时代武将和田义盛的住所，现被指定为东京都的名胜。东洋大学创始人井上圆了最初在这里建造了纪念苏格拉底、康德、孔子、释迦摩尼的“四圣堂”。四圣堂在当时也被称为哲学堂，后来直接成为了公园的名字。', 1, 1, 0, '2021-12-08 09:33:50.416460', '2021-12-08 09:33:50.764313', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (434, '富士见坡', '日本东京都丰岛区高田1丁目40-18', 35.716429, 139.717561, '富士见坡，是一个大斜坡，其实能见到富士山的都可以叫这个名字，这个坡位于丰岛区，是电影《穿越时空的少女》的取景地。', 1, 1, 0, '2021-12-08 09:33:57.061191', '2021-12-08 09:33:57.403369', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (435, '中井商店街', '', 35.714751, 139.687184, '中井商店街很久之前就是购物街，二战后才正式成立商店街，1985年开始加强公共基础设施如路灯等，正式命名为“中井商店街”。这里虽然不是一个大商圈，但是海鲜、肉类、生鲜杂货、生活用品等货物一应俱全。', 1, 1, 0, '2021-12-08 09:33:59.026729', '2021-12-08 09:33:59.370877', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (436, '东京女子大学', '日本东京都杉并区善福寺二丁目6番1号', 35.70980144, 139.59137218, '东京女子大学位于日本东京都杉并区，创立于1918年。和许多私立女子大学一样，也是基督教学校，学校的学科也以英语、文化类为主。女子大学本身就是因以前某些大学不收女性学生而设立，所以常有人批评女子大学是新娘学校，主要学文科和家政，不然就是护工药房类，基本与理工科无缘。', 1, 1, 0, '2021-12-08 09:34:15.845859', '2021-12-08 09:34:16.187412', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (437, '东京都立国分寺高中', '日本东京都国分寺新町3丁目2-5', 35.712371, 139.447779, '', 1, 1, 0, '2021-12-08 09:34:24.430492', '2021-12-08 09:34:24.779657', 26, 1, '国分寺市');
INSERT INTO `tb_places` VALUES (438, '模范干洗店中井店', '日本东京都新宿区中井1丁目1-12', 35.715973, 139.686264, '该店是电影《穿越时空的少女》的取景地。洗衣店至今仍与片中保持一致，电影把店里蓝色牌匾上的宣传语也一字不落地还原了：洗得好，洗得对，洗得干净，使用高级磷剂的洗衣店——模范。', 1, 1, 0, '2021-12-08 09:34:37.420863', '2021-12-08 09:34:37.764062', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (439, '东京国立博物馆', '日本东京都台东区上野公园13-9', 35.71883519, 139.77652154, '东京国立博物馆创立于1872年，是日本最早的博物馆。该博物馆位于日本国东京都台东区上野恩赐公园内，共有本馆、表庆馆、东洋馆、平成馆、法隆寺宝物馆5个展览及资料馆组成‍‍。馆内藏品总数为11万件以上，其中包括日本国宝87件、重要文化财产610件（2005年7月止）。', 1, 1, 0, '2021-12-08 09:34:38.190953', '2021-12-08 09:34:38.533254', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (440, '千住新桥荒川绿地', '日本东京都足立区千住5丁目', 35.756646, 139.805117, '足立区的荒川绿地，被千住新桥和高架铁路包围在中间。7月足立的烟火大会，10月区民节，都在荒川绿地举行。荒川河是日本的著名河流，设计者巧妙利用了河川的坡度设计成了这块大型的绿化用地，建设了栽满季节性鲜花的彩虹广场，棒球场以及足球运动场，因而常用于召开大型活动。这里是电影《穿越时空的少女》的重要取景地。', 1, 1, 0, '2021-12-08 09:34:47.345972', '2021-12-08 09:34:47.686596', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (441, '林芙美子纪念馆', '日本东京都新宿区中井2丁目20-1', 35.715659, 139.684437, '林芙美子纪念馆是日本女作家的住宅，漂亮的画园是这里的一大亮点。\n林芙美子（はやし ふみこ，1903年12月31日-1951年6月28日），日本女小说家，生于下关市。尾道高等女校毕业后，当过女工、女仆。1924年起在《文艺战线》等杂志发表作品。1928年发表第一部自传体长篇小说《放浪记》，描写自己苦难的经历，因此扬名文坛。1932年曾赴欧洲旅行。二次大战期间曾数次到中国、东南亚等地采访。主要小说还有《清贫的书》、《牡蛎》、《晚菊》、《浮云》等，其作品细腻生动地描绘了庶民的哀欢，尤其是妇女的遭遇。后刊有全集23卷。', 1, 1, 0, '2021-12-08 09:34:58.239439', '2021-12-08 09:34:58.593470', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (442, '国分寺高校北路口', '日本东京都国分寺新町3丁目14', 35.714269, 139.447607, '位于东京都立国分寺高校北部、至诚看护所附近的一个T字路口。', 1, 1, 0, '2021-12-08 09:35:05.255798', '2021-12-08 09:35:05.596083', 26, 1, '国分寺市');
INSERT INTO `tb_places` VALUES (443, '南藏院附近三岔路口', '日本东京都丰岛区高田1-19-16', 35.714952, 139.715145, '丰岛区南藏院寺庙在面影桥站，停车场旁的分岔口是《穿越时空的少女》的取景地。南藏院属真言宗丰山派，在日本各地都有同名寺庙。', 1, 1, 0, '2021-12-08 09:35:06.944539', '2021-12-08 09:35:07.292191', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (444, 'GEMSTONE 荻窪店', '日本东京都杉并区天沼3丁目12-5', 35.707825, 139.615684, '潮牌服装店。', 1, 1, 0, '2021-12-08 09:35:08.265830', '2021-12-08 09:35:08.612348', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (445, '五之坡道', '日本东京都新宿区中井2丁目24-9', 35.715313, 139.683244, '五之坡道是一个静谧的小斜坡道，位于东京的新宿区，是电影《穿越时空的少女》的取景地。', 1, 1, 0, '2021-12-08 09:35:10.053176', '2021-12-08 09:35:10.398375', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (446, '涩谷站前十字路口', '', 35.659495, 139.700564, '涩谷站前十字路口（Shibuya Crossing）旁是著名的八公铜像（Hachiko Statue） ，它是目前世界上最大的十字路口，其一天通过的行人量多达50万，高峰时会有3000人同时通过马路。此十字路口是采用行人交通灯信号一齐变绿的“全向十字路口”方式——随着行人交通灯信号变绿，数以百计、千计的人一边互相闪避一便过马路，形成一个令人惊讶的场面；接着行人交通灯信号变红后，又好像什么事都没有发生过，车辆顺畅地行驶。涉谷站前交叉口行色匆匆的大量行人和变换无常的交通灯、周遭的高楼大厦等景象成了大都市东京一个最为著名的意象，也成了许多外国游客列入参观的景点之一。', 1, 1, 0, '2021-12-08 09:35:11.341524', '2021-12-08 09:35:11.682720', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (447, 'ABC超市 吉祥寺店', '日本东京都武藏野市吉祥寺本町1丁目1-13-3', 35.70512524, 139.58067067, 'ABC MART是来自日本的运动产品连锁店，成立于1990年，其在线商城主要在线销售运动鞋品，包括NIKE、阿迪达斯、彪马、新百伦等多品牌。', 1, 1, 0, '2021-12-08 09:35:12.222388', '2021-12-08 09:35:12.563932', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (448, 'Baskin-Robbins冰淇淋 吉祥寺店', '日本东京都武藏野市吉祥寺本町1丁目4-18', 35.70330474, 139.57909442, '芭斯罗缤（Baskin-Robbins），或较常被译称为31冰激凌，是发源于美国南加州的跨国连锁冰激凌专卖店，由艾文·罗缤与伯顿·芭斯于1945年创立，以随时都能提供31种冰激凌口味而著称，是世界上最早诞生的加盟连锁冰激凌店之一。今日已成为全球最大的连锁冰激凌专卖店之一，开发的冰激凌口味已超过一千种，并在48个国家拥有6.300家以上门市，其中有半数位于美国本土，日本则以590家以上的数量位居第二。在日本以“サーティワンアイスクリーム”的名称为人们所熟知。', 1, 1, 0, '2021-12-08 09:35:16.062671', '2021-12-08 09:35:16.406759', 26, 1, '东京都');
INSERT INTO `tb_places` VALUES (449, '乌帽子岩', '日本神奈川县茅崎市相模湾', 35.3021857, 139.4151306, '乌帽子岩其正式名称为姥岩，高20m、东西约600m、南北约400m。据说乌帽子岩生成于1200万年前，其周边的地层可说是茅崎最古老的地层，是由砂岩层及火山层堆栈交织，从海底所隆起的天然地貌。', 1, 1, 0, '2021-12-08 09:35:23.128217', '2021-12-08 09:35:23.468652', 27, 1, '茅崎市');
INSERT INTO `tb_places` VALUES (450, '镰仓高校前路口', '日本神奈川县镰仓市腰越一丁目', 35.30655339, 139.50210929, '134国道与镰仓高校前坡道的T字路口，因有江之电经过也是一处铁道口，可眺望大海风光。因曾在热门动画《灌篮高手》的第一片头曲中出现过，许多粉丝、游客慕名前来打卡。', 1, 1, 0, '2021-12-08 09:35:25.125872', '2021-12-08 09:35:25.475832', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (451, '东京武藏野北高中', '日本东京都武藏野市八幡町２丁目３−１０', 35.719767, 139.557318, '东京都立武藏野北高级中学是一所位于日本东京都武藏野市八幡町二丁目的男女共学公立学校。为《灌篮高手》中湘北高校的原型。', 1, 1, 0, '2021-12-08 09:35:28.618383', '2021-12-08 09:35:28.962659', 27, 1, '东京都');
INSERT INTO `tb_places` VALUES (452, '藤泽站', '日本神奈川县藤泽市', 35.3388984, 139.4874695, '藤泽站是一个位于神奈川县藤泽市藤泽及南藤泽，属于东日本旅客铁道（JR东日本）、小田急电铁、江之岛电铁（江之电）的铁路车站。', 1, 1, 0, '2021-12-08 09:35:31.676821', '2021-12-08 09:35:32.030259', 27, 1, '藤泽市');
INSERT INTO `tb_places` VALUES (453, '七里滨海滩', '日本神奈川县镰仓市七里滨', 35.305281, 139.510465, '七里滨海滩位于日本神奈川县江之岛电铁镰仓高校前站与七里滨站之间，对远处的江之岛、富士山、伊豆大岛、三浦半岛等都一览无余。七里滨是日本百渚之一，夕阳黄昏时风景尤为美丽，很多人都会选来这里观看日落。', 1, 1, 0, '2021-12-08 09:35:34.096256', '2021-12-08 09:35:34.438302', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (454, '江之岛站', '日本神奈川県藤沢市片瀬海岸一丁目4-7', 35.3111257, 139.4878806, '江之岛站是指江之岛电铁位于日本神奈川县藤泽市境内的江之岛车站。该站原名片濑站，1929年改为江之岛，车站建筑入口处可见古朴的尖顶。这里是前往著名景点江之岛的重要车站，但并不是距离该岛最近的车站。', 1, 1, 0, '2021-12-08 09:35:36.217840', '2021-12-08 09:35:36.598952', 27, 1, '藤泽市');
INSERT INTO `tb_places` VALUES (455, '镰仓高校前站', '日本神奈川县镰仓市腰越一丁目1-25', 35.3067242, 139.5005569, '镰仓高校前站是一由江之岛电铁所经营的铁路车站，位于日本神奈川县镰仓市境内，是江之岛电铁线沿线的一个无人车站。由于车站仅与七里滨的海岸线隔着国道134号相望，因此站在月台上即能眺望海边的风光。 本站在1903年初设站时，原名日坂，并在1953年时根据紧邻的神奈川县立镰仓高等学校，改名为镰仓高校前。', 1, 1, 0, '2021-12-08 09:35:37.727221', '2021-12-08 09:35:38.070134', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (456, '神奈川县立镰仓高等学校', '镰仓市，神奈川县七里2-21-1', 35.3306068, 139.5029477, '神奈川县立镰仓高级中学（日语：神奈川県立鎌倉高等学校）是日本神奈川县镰仓市的一所全日制普通科男女共学的县立高级中学。通称为“镰高”或“县镰”。为《灌篮高手》中陵南高校的原型。', 1, 1, 0, '2021-12-08 09:35:41.358892', '2021-12-08 09:35:41.701994', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (457, '134国道（镰仓海滨段）', '日本神奈川县镰仓市腰越１丁目', 35.30662499, 139.49898161, '', 1, 1, 0, '2021-12-08 09:35:44.516575', '2021-12-08 09:35:44.856129', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (458, '长谷寺', '日本神奈川县镰仓市长谷３丁目１１−2', 35.3124645, 139.5330634, '长谷寺依山而建，寺内草木四时有序，景致不同。上境见晴台处可登高望远，一览海湾风光。正殿内供奉十一面观音菩萨像，相传是一千三百年前，由神木雕刻而成，像高9.18米，是日本现存最大级别的木雕观音佛像之一。', 1, 1, 0, '2021-12-08 09:35:46.674078', '2021-12-08 09:35:47.015573', 27, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (459, '湘南海岸公园', '日本神奈川县藤泽市鹄沼海岸１丁目１７−３', 35.3137328, 139.4752786, '鹄沼海岸和片濑海岸延伸段的公园，沙滩边有草坪和树木。', 1, 1, 0, '2021-12-08 09:35:48.590823', '2021-12-08 09:35:48.935797', 27, 1, '藤泽市');
INSERT INTO `tb_places` VALUES (460, '新横滨站', '日本神奈川县横滨市港北区篠原町2937', 35.5068084, 139.6175767, '新横滨站是东海旅客铁道（JR东海）、东日本旅客铁道（JR东日本）及横滨市交通局（横滨市营地下铁）的铁路车站。站区位于神奈川县横滨市港北区篠原町及新横滨二丁目。2000年（平成12年），入选关东车站百选（第四回）。', 1, 1, 0, '2021-12-08 09:35:50.018616', '2021-12-08 09:35:50.421140', 27, 1, '横滨市');
INSERT INTO `tb_places` VALUES (461, '蜷川家具店', '日本千叶县香取市佐原3396', 35.88873915, 140.49900016, '', 1, 1, 0, '2021-12-08 09:35:56.209015', '2021-12-08 09:35:56.553414', 28, 1, '香取市');
INSERT INTO `tb_places` VALUES (462, '藤之木桥', '日本长野县下伊那郡乔木村3350', 35.51983, 137.886178, '', 1, 1, 0, '2021-12-08 09:35:57.585962', '2021-12-08 09:35:57.927699', 28, 1, '下伊那郡');
INSERT INTO `tb_places` VALUES (463, 'i便利店 石堂大平店', '日本鹿儿岛县熊毛郡中种子町野间2172-1', 30.54632984, 130.97107611, '种子岛上的一家便利店，位于县道75号线上。\n电影《秒速五厘米》曾在此取景，店内放有《秒速五厘米》巡礼的留言簿，上面记录着各地影迷来到这里的心情。', 1, 1, 0, '2021-12-08 09:36:00.422444', '2021-12-08 09:36:00.769914', 28, 1, '中种子町');
INSERT INTO `tb_places` VALUES (464, '诹访湖', '日本长野县诹访市', 36.04952404, 138.08411582, '诹访访湖是位于日本长野县境内冈谷市、诹访市、诹访郡下诹访町交界处的湖泊，为日本河川法上一级河川天龙川的发源地。该湖是湖沼水质保全特别措置法（日语：湖沼水質保全特別措置法）指定湖沼。', 1, 1, 0, '2021-12-08 09:36:02.691619', '2021-12-08 09:36:03.036030', 28, 1, '诹访市');
INSERT INTO `tb_places` VALUES (465, '新海三社神社', '日本长野县佐久市田口宫代2394', 36.195896, 138.512198, '新海三社神社是长野县佐久市田口地区的守护神社，创立年代不详。神社中三重塔、东本社、御魂代石等都是重要的文化财产。', 1, 1, 0, '2021-12-08 09:36:10.060890', '2021-12-08 09:36:10.406536', 28, 1, '佐久市');
INSERT INTO `tb_places` VALUES (466, '日枝神社', '日本岐埠县高山市城山156', 36.13321337, 137.26145906, '日枝神社是岐埠县高山市的神社，别名飞弹山王宫日枝神社。以高山祭最为出名，比如秋天举行的樱山八幡宫的例行祭典。祭神是大山咋神。', 1, 1, 0, '2021-12-08 09:36:16.193102', '2021-12-08 09:36:16.541169', 28, 1, '高山市');
INSERT INTO `tb_places` VALUES (467, '新宿站', '日本东京都新宿区新宿3丁目38', 35.68940025, 139.70054448, '新宿站是日本东京新宿最主要的铁路车站，整个站区横跨东京都的新宿区与涩谷区，使用之铁路业者包括东日本旅客铁道（JR东日本）、小田急电铁、京王电铁、东京地铁及都营地铁等。其每日使用人次（以出入闸人次计算），JR路线为157万，属日本第1位；各铁路业者总和则达每日364万人次，是世界上使用人次最多的铁路车站。', 1, 1, 0, '2021-12-08 09:36:22.970387', '2021-12-08 09:36:23.312019', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (468, 'YUNIKA VISION大厦', '日本东京都新宿区新宿3丁目23-7', 35.6934298, 139.70063761, 'YUNIKA VISION是日本大型广告代理公司。在新宿北口的YUNIKA VISION大厦外墙有一面面积达100㎡、三面可视的LED屏幕，非常壮观。', 1, 1, 0, '2021-12-08 09:36:30.553230', '2021-12-08 09:36:30.894702', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (469, '广岛基町高等学校', '日本广岛县广岛市中区西白岛町25-1', 34.40398692, 132.45987863, '', 1, 1, 0, '2021-12-08 09:36:31.915432', '2021-12-08 09:36:32.256596', 28, 1, '广岛市');
INSERT INTO `tb_places` VALUES (470, 'Cafe La Boheme 新宿店', '日本东京都新宿区新宿1丁目1-7', 35.68752984, 139.71283027, '新宿一家意大利餐厅，环境优雅菜品丰富。', 1, 1, 0, '2021-12-08 09:36:35.370374', '2021-12-08 09:36:35.714485', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (471, '新宿警察署里', '日本东京都新宿区西新宿1丁目266丁目5-3', 35.69262015, 139.69440442, '', 1, 1, 0, '2021-12-08 09:36:42.019159', '2021-12-08 09:36:42.365946', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (472, '茑屋书店 涩谷店', '日本东京都涉谷区宇田川町21-6', 35.65982955, 139.70050938, '东京代官山“茑屋书店”被评为世界最美20大书店之一。实际上，作为连锁书店的茑屋书店自上世纪80年代初成立，走过经济低谷、亚马逊冲击等种种逆势，依旧是目前日本销售量最惊人的书店。位于涉谷的茑屋书店虽然比不上代官山店的名气，依然是人气颇高，建筑风格沿袭了TSUTAYA一贯的透明玻璃外墙，内部空间打造图书、音像、生活、餐饮多位融合，也非常值得一去。', 1, 1, 0, '2021-12-08 09:36:44.428585', '2021-12-08 09:36:44.775688', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (473, '四谷站', '日本东京都新宿区四谷1丁目', 35.68615255, 139.73021892, '四谷站位于日本东京都新宿区，是东日本旅客铁道（JR东日本）与东京地下铁的铁路车站。', 1, 1, 0, '2021-12-08 09:36:46.301240', '2021-12-08 09:36:46.642461', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (474, '六本木新城 森大厦', '日本东京都港区六本木6-10-1', 35.66046397, 139.72924867, '日本六本木森大厦，大厦高238.1米，建筑面积380105平米。上海环球金融中心高度492米（两倍于森大厦）但是建筑面积381600平方米，可想而知森大厦有多么“粗”了。这是世界上最粗的大厦，也是目前东京第五高楼。\n\n2003年建成的六本木(Roppongi Hills)，是按照下个世纪理想东京风貌而建的社区，这个占地接近十二公顷的新地标，筹划了十七年、耗资近一百七十亿港元兴建的六本木，已被东京本地人视为新世纪的新都市概念建筑体，其中最瞩目的是高高在上的六本木新城森大厦。\n\n位于六本木新城森大厦五十二楼的观光台(City View)，从底层乘高速电梯直达，只需四十二秒。高十一米的巨大环形玻璃窗，可让游客三百六十度观赏东京市景色，感觉犹如空中漫步。\n\n此外，十月正式开幕的“森美术馆”(Mori Arts Center)，座落于大楼的五十四楼，是全东京最“高档”的空中美术馆，开幕展览将以 \"Happiness\" 为主题，是一个糅合古典与现代美术的作品展。', 1, 1, 0, '2021-12-08 09:36:54.517964', '2021-12-08 09:36:54.873558', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (475, '国立新美术馆', '日本东京都港区六本木7丁目22-2', 35.66528886, 139.72637365, '国立新美术馆位于日本东京都港区的美术馆，在2007年1月21日开馆。该馆由日本文化厅国立新美术馆设立准备室和行政法人国立美术馆主导兴建，地点位于东京大学生产研究所的旧址。国立新美术馆的概念是森林中的美术馆，设立的目的主要为举办展览会、展示收藏作品和普及美术教育的功能。', 1, 1, 0, '2021-12-08 09:36:57.496708', '2021-12-08 09:36:57.842819', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (476, '六本木新城 地带大厦', '日本东京都港区六本木6丁目2-2番31号', 35.66188687, 139.73020432, '六本木新城建筑空间组成之一。', 1, 1, 0, '2021-12-08 09:36:59.976647', '2021-12-08 09:37:00.317022', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (477, '信浓町步道桥', '日本东京都新宿区南元町9', 35.67951143, 139.71972286, '', 1, 1, 0, '2021-12-08 09:37:01.955868', '2021-12-08 09:37:02.302751', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (478, 'DoCoMo代代木大厦', '日本东京都涉谷区千驮谷5丁目24-3', 35.68473383, 139.70292695, 'NTT DoCoMo代代木大厦是东京都第四高的摩天大楼，仅次于中城大厦、虎之门之丘与东京都厅舍。它拥有像帝国大厦等美国纽约的摩天大楼的设计外观。与一般商业大楼不同，它是NTT DoCoMo的业务用大楼，仅限公司相关人员进入。', 1, 1, 0, '2021-12-08 09:37:08.594840', '2021-12-08 09:37:08.936705', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (479, '圣德纪念绘画馆', '〒160-0013 東京都新宿区霞ヶ丘町１−1', 35.6787278, 139.7176281, '圣德纪念绘画馆位于日本东京都新宿区，是神宫外苑的主要建筑之一，展示描绘自幕末至明治时代的明治天皇生涯的绘画。', 1, 1, 0, '2021-12-08 09:37:12.832719', '2021-12-08 09:37:13.176555', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (480, '涩谷南口步道桥', '日本东京都涉谷区樱丘町', 35.65727682, 139.70114673, '', 1, 1, 0, '2021-12-08 09:37:14.811553', '2021-12-08 09:37:15.157474', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (481, '东京站', '日本东京都千代田区丸之内1丁目9', 35.681298, 139.7662469, '东京站位于日本东京都千代田区丸之内一丁目，为东日本旅客铁道、东海旅客铁道、东京地铁的铁路车站。不但是日本多条铁道线路的起点站，也是东京主要的交通枢纽之一。', 1, 1, 0, '2021-12-08 09:37:16.221970', '2021-12-08 09:37:16.564167', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (482, '名古屋站', '日本爱知县名古屋市中村区名站1丁目1-4', 35.17091463, 136.8815394, '名古屋站是位于日本爱知县名古屋市中村区一个由东海旅客铁道（JR东海）、日本货物铁道（JR货物）、名古屋临海高速铁道、名古屋市交通局（名古屋市营地铁）等单位所共用的铁路车站。名古屋站拥有全世界最高的车站大厦“JR中央塔”，其白色双塔是名古屋站的重点特色。2000年入选中部车站百选（第二回）。', 1, 1, 0, '2021-12-08 09:37:19.324467', '2021-12-08 09:37:19.663975', 28, 1, '名古屋市');
INSERT INTO `tb_places` VALUES (483, '飞弹古川站', '日本岐埠县飞弹市古川町金森町8', 36.236664, 137.189537, '', 1, 1, 0, '2021-12-08 09:37:22.756568', '2021-12-08 09:37:23.104438', 28, 1, '飞弹市');
INSERT INTO `tb_places` VALUES (484, '气多若宮神社', '日本岐埠县飞弹市古川町上气多1297', 36.23947, 137.197827, '气多若宮神社是岐埠县飞弹市古川町的神社，历史来由不详，建立于平安时代。根据增岛城主金森可重的说法，主要敬拜的是镇守古城的产土神。', 1, 1, 0, '2021-12-08 09:37:27.970988', '2021-12-08 09:37:28.312936', 28, 1, '飞弹市');
INSERT INTO `tb_places` VALUES (485, '味处古川', '日本岐埠县飞弹市古川町番之町11-3', 36.23577211, 137.18515321, '味处古川是一家飞弹古川站附近的饮食店，提供牛排、定食、乡土料理等餐食。', 1, 1, 0, '2021-12-08 09:37:31.407548', '2021-12-08 09:37:31.759427', 28, 1, '飞弹市');
INSERT INTO `tb_places` VALUES (486, '越中西街道巴士站', '日本岐埠县飞弹市宫川町落合', 36.303441, 137.112399, '角川站附近位于国道360号上的一个巴士停靠站。', 1, 1, 0, '2021-12-08 09:37:33.829578', '2021-12-08 09:37:34.182604', 28, 1, '飞弹市');
