INSERT INTO `tb_places` VALUES (489, '前田南站', '日本秋田县秋田市五味堀堂前', 40.05072617, 140.40245674, '前田南站是秋田内陆纵贯铁道秋田内路线上的一个无人车站。', 1, 1, 0, '2021-12-08 09:37:43.336686', '2021-12-08 09:37:43.679149', 28, 1, '北秋田市');
INSERT INTO `tb_places` VALUES (490, '代代木站', '日本东京都涉谷区千驮谷5丁目24', 35.68315992, 139.70207088, '代代木站是一个位于东京都涩谷区代代木一丁目，属于东日本旅客铁道（JR东日本）、东京都交通局（都营地下铁）的铁路车站。', 1, 1, 0, '2021-12-08 09:37:45.561786', '2021-12-08 09:37:45.907846', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (491, '新宿大高架桥附近', '日本东京都新宿区新宿3丁目', 35.69381667, 139.69980476, '新宿大高架桥，指新宿和西新宿边境线上的青梅街道架道桥。下方是青梅街道、靖国通与小泷桥通组成的大高架桥交差点，是周边交通的要冲，夜晚人潮汹涌。\n\n新宿大高架桥有东西两个交叉路口，东侧是西新宿高楼林立的建筑群，西侧是新宿歌舞伎町聚集的欢乐街。', 1, 1, 0, '2021-12-08 09:37:56.299765', '2021-12-08 09:37:56.642285', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (492, '赤坂见附十字路口', '日本东京都港区元赤坂青山大道', 35.67796827, 139.73676454, '', 1, 1, 0, '2021-12-08 09:37:58.353233', '2021-12-08 09:37:58.699220', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (493, '弁庆桥', '日本东京都千田代区纪尾井町~港区元赤坂2-1丁目', 35.67885688, 139.73626914, '明治22年（1889），神田松枝町至岩本町一带的弁庆桥不再使用，移至港区赤坂。现在的弁庆桥于昭和66年（1985）11月进行过修缮，现为长44.75米，宽22米的混凝土桥。', 1, 1, 0, '2021-12-08 09:37:59.734142', '2021-12-08 09:38:00.076571', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (494, '赤坂首都高高架下步道', '日本东京都港区元赤坂1丁目', 35.67851056, 139.73435287, '', 1, 1, 0, '2021-12-08 09:38:01.131425', '2021-12-08 09:38:01.474154', 28, 1, '东京都');
