INSERT INTO `tb_places` VALUES (497, '千驮谷站', '日本东京都涉谷区千驮谷1丁目', 35.68121, 139.711548, '千驮谷站是东日本旅客铁道中央本线的铁路车站，位于日本东京都涉谷区。', 1, 1, 0, '2021-12-08 09:38:09.635437', '2021-12-08 09:38:09.979360', 28, 1, '东京都');
