INSERT INTO `tb_places` VALUES (502, '须贺神社', '日本东京都新宿区须贺町5番地', 35.68527996, 139.72256552, '须贺神社建立于1634年，是东京新宿区须贺町地区的守护神社。', 1, 1, 0, '2021-12-08 09:38:20.572937', '2021-12-08 09:38:20.913675', 28, 1, '东京都');
INSERT INTO `tb_places` VALUES (503, '大阪城天守阁', '日本大阪府大阪市中央区大阪城', 34.6873788, 135.5258614, '大阪城，位于日本大阪市中央区（古属摄津国东成郡）的大阪城公园内，为大阪名胜之一，和名古屋城、熊本城并列日本历史上的三名城，别名“金城”或“锦城”。\n在桃山时代是丰臣秀吉的居城。后来德川家康以两次大坂之役（冬之阵、夏之阵）消灭了丰臣家，此后大坂城成为德川幕府控制西日本大名的重要据点。\n城郭含城下町等周长约7.8公里，与江户城初期（内郭）相当（江户后期含城下町外郭周长约15.8ｋｍ）。\n“大阪”在明治维新前写作“大坂”，维新后忌于“坂”字可拆为“士反”，有“武士叛乱”之讳，因此于明治三年（1870年）改名为“大阪”，“大坂城”也因而更名为“大阪城”。一般讲述更名前的历史时仍会以旧写“大坂城”称之，以示时代区别。', 1, 1, 0, '2021-12-08 09:38:32.605009', '2021-12-08 09:38:32.953375', 29, 1, '大阪市');
INSERT INTO `tb_places` VALUES (504, '大阪府警察本部', '日本大阪府大阪市中央区大手前３丁目１−１１', 34.6838903, 135.5204452, '', 1, 1, 0, '2021-12-08 09:38:36.378618', '2021-12-08 09:38:36.720959', 29, 1, '大阪市');
INSERT INTO `tb_places` VALUES (505, '通天阁', '日本大阪府大阪市浪速区恵美須東１丁目１８−６', 34.6524992, 135.5063058, '通天阁是位于日本大阪府大阪市浪速区新世界商业街的一个瞭望塔。为日本的登录有形文化财产。\n通天阁这个名字的意思是“直通天空的高建筑物”，命名者是明治初期的儒学者藤泽南岳。通天阁是由建筑师内藤多仲所设计，他也是东京铁塔的设计者。现在的通天阁完成于1956年（昭和31年），是第二代通天阁。塔高100米，含避雷针的话则有103米。由350吨的铁材建成，为一大娱乐设施“新世界”的象征。利用内国劝业博览会留下的广大土地，同时也是大阪政界及财界主办的计划，铁塔的规模可谓盛大空前。塔上有电机大厂日立的广告。', 1, 1, 0, '2021-12-08 09:38:37.289480', '2021-12-08 09:38:37.630463', 29, 1, '大阪市');
INSERT INTO `tb_places` VALUES (506, '京都塔', '日本京都府京都市下京区', 34.9874767, 135.7594926, '京都塔是由隶属于京阪电气铁道集团的京都塔股份有限公司（京都タワー株式会社）维护营运，包括作为塔基的“京都塔大楼”（京都タワービル）在内，总高131米。\n京都塔的造型由建筑师山田守操刀，结构部分则是由京都大学工学部建筑学教室负责，于1964年（昭和39年）12月28日启用，施工期约1年10个月。虽然京都市本身并不临海，但京都塔却很独特地采用了灯塔的造型作为外观主题。在京都塔建成的那个时代，大部分的塔状建筑都是采钢骨桁架结构（例如巴黎的埃菲尔铁塔），但京都塔却很独特地采用了封闭式的设计，以厚度介于12至22毫米之间的特殊钢板制作成的圆筒熔接而成，本体高100米、重量约800吨的塔身之内完全没有受力结构，是日本最早的外墙承重结构（応力外被構造）建筑之一。考量到日本地处地震带上，也是台风盛行的地区，因此京都塔在设计时，使用了比一般建筑物高出一倍的安全系数，并安然度过风速高达50米/秒的台风与阪神大地震洗礼。', 1, 1, 0, '2021-12-08 09:38:38.977880', '2021-12-08 09:38:39.320422', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (507, '京都站', '日本京都府京都市下京区東塩小路釜殿町', 34.98583818, 135.75863449, '京都站位于日本京都府京都市下京区，是西日本旅客铁道、东海旅客铁道、近畿日本铁道和京都市交通局的铁路车站。京都站为日本最大的观光都市——京都市的代表车站。 京都站是多条铁路路线的总站，作为京都观光名所广泛范围的玄关口，车站有多条巴士、地下铁等公共交通机关提供前往京都市内观光名胜的交通服务。', 1, 1, 0, '2021-12-08 09:38:40.604819', '2021-12-08 09:38:40.953360', 29, 1, '京都府');
INSERT INTO `tb_places` VALUES (508, '祇园町南侧小路', '日本京都府京都市东山区祇园町南侧', 35.00271583, 135.77679178, '祇园町南侧，东大路到花见小路直接的一条道路。', 1, 1, 0, '2021-12-08 09:38:43.598298', '2021-12-08 09:38:43.938634', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (509, '五条大桥', '日本京都府京都市五条通', 34.9958288, 135.7678034, '相传义经与弁庆就是在五条桥决斗相识并结为主仆的。不过五条大桥原本架设在平安京 (原京城) 的五条坊门大街上 (现在的松原大街)，后由丰臣秀吉 (1537 至 1598 年，再次统一日本的安土桃山时代武将) 在天正年间 (1573 至 1592 年) 建造方广寺大佛殿的时候，南移了二个町到现在的位置。五条通跨越鸭川，就是现在的五条大桥，虽然不是传说本身的位置，但在桥头还立有“弁庆与牛若丸”不打不相识的雕塑。', 1, 1, 0, '2021-12-08 09:38:46.286172', '2021-12-08 09:38:46.630444', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (510, '五条天神社', '京都府京都市下京区天神前町 下京区天神前町３５１', 34.9986622, 135.754842, '五条天神社位于京都市下京区。供奉的是驱除疾病、厄运，掌管农耕、医药的神明。通称“天使宫”“天使社”。', 1, 1, 0, '2021-12-08 09:38:51.431994', '2021-12-08 09:38:51.781540', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (511, '麸屋町通', '日本京都府京都市下京区八文字町麸屋町通', 35.0030843, 135.7656075, '', 1, 1, 0, '2021-12-08 09:38:52.906579', '2021-12-08 09:38:53.249115', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (512, '弁庆石', '日本京都府京都市中京区弁庆石町 三条麩屋町東入北侧', 35.0087065, 135.7657945, '相传这是弁庆以前经常坐的一块石头，也有一说，是他从比叡山上扔下来的。', 1, 1, 0, '2021-12-08 09:38:54.044149', '2021-12-08 09:38:54.386558', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (513, '清水寺', '日本京都府京都市東山区清水１丁目２９４清水寺', 34.9948561, 135.7850463, '清水寺是一座位于日本京都府京都市东山区清水的寺院，于778年前后由延镇上人起造。清水寺的山号为音羽山，主要供奉千手观音，原本属于法相宗这一宗派但目前已独立，成为北法相宗的大本山。 清水寺与北山鹿苑寺、岚山天龙寺等同为京都境内最著名的名胜古迹，一年四季前来朝拜的香客或来访的观光客是络驿不绝。\n清水寺本殿于2017年2月开始大型修葺，预计2020年奥运会前重新开放。本殿参观和清水舞台赏景暂时关闭。', 1, 1, 0, '2021-12-08 09:38:55.582937', '2021-12-08 09:38:55.924260', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (514, '义经大日如来', '日本京都府京都市左京区粟田口山下町4', 35.0074332, 135.7908881, '义经大日如来位于京都市琵琶湖疏水的蹴上坂道旁停船岸附近的祠堂里。', 1, 1, 0, '2021-12-08 09:39:05.339617', '2021-12-08 09:39:05.680489', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (515, '蹴上倾斜铁道', '京都府京都市左京区粟田口山下町 东山区东小物座町３３９', 35.0075127, 135.7909816, '这段已经废弃的铁道两侧樱花树夹道，是非常热门的赏樱地点，当地人特别喜欢到这里漫步拍照，席地野餐。旧铁道的灰石路与粉色樱花相衬托，有着独特的美感。这段铁道当初的兴建，是因为由大津到京都沿途，琵琶湖有两段水路落差比较大，必须仰赖铁道来辅助水道运送物资，后来功用不再，反而成为现今的一道风景。', 1, 1, 0, '2021-12-08 09:39:06.911132', '2021-12-08 09:39:07.252422', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (516, '南禅寺', '日本京都府京都市左京区南禅寺福地町', 35.011311, 135.792546, '南禅寺，日本京都一所佛教寺院，为临济宗南禅寺派大本山。正应四年为龟山天皇创建，首任住持为大明国师无关普门。南禅寺是日本最早的由皇室发愿建造的禅宗寺院，因此位列京都五山之上，为日本禅宗最高寺院。\n南禅寺风光极好，也是赏樱赏枫的圣地。', 1, 1, 0, '2021-12-08 09:39:09.964948', '2021-12-08 09:39:10.311686', 29, 1, '京都府');
INSERT INTO `tb_places` VALUES (517, '二年坂', '京都府京都市东山区清水2丁目', 34.998122, 135.7808431, '二年坂筑于公元807年，从三年坂接二年坂可一路直通宁宁之道，连接清水寺与高台寺。二年坂和三年坂是京都一处非常有名的街区，周边布满了老木屋和传统的日式商店。', 1, 1, 0, '2021-12-08 09:39:13.976982', '2021-12-08 09:39:14.320073', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (518, '鞍马寺', '京都府京都市左京区鞍馬本町1074番地', 35.1179804, 135.770981, '鞍马寺是位在日本京都府京都市左京区的寺院，鞍马弘教总本山。山号“鞍马山”。本尊“尊天”、开基为鉴祯。 鞍马是牛若丸修行之地，也是大佛次郎的小说‘鞍马天狗’的舞台而有名。', 1, 1, 0, '2021-12-08 09:39:15.794002', '2021-12-08 09:39:16.134507', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (519, '僧正谷不动堂', '日本京都府京都市左京区鞍馬本町', 35.12000448, 135.76731673, '相传源义经(牛若丸)，小时候在鞍马修行，在僧正ヶ谷遇见武力高强的大天狗，便开始向天狗学习武艺。 僧正ヶ谷不动堂正是牛若丸遇见天狗的地方。', 1, 1, 0, '2021-12-08 09:39:23.914714', '2021-12-08 09:39:24.270165', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (520, '鞍马站', '日本京都府京都市左京区鞍马本町１９１', 35.1129567, 135.7725188, '鞍马站是京都市左京区鞍马本町内叡山电铁鞍马线的车站，是该线路的终点站。', 1, 1, 0, '2021-12-08 09:39:26.632407', '2021-12-08 09:39:26.990446', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (521, '鸭川', '日本京都府京都市', 35.01014903, 135.771799, '鸭川是代表京都一条长31公里的一级河川。这条河流的水十分清澈，流穿过京都中央。从古代起居民已经住在河流的两旁. 特别是西岸及南岸。虽然京都已不是首都但仍然有很多外国及本地游客到来游览。 祗园在鸭川的中央，四周有许多商店提供良好鸭川的景致，尤其在晚上。河流两旁有步行径及单车径，在主要的名胜景点均可以找到单车出租店。', 1, 1, 0, '2021-12-08 09:39:30.685349', '2021-12-08 09:39:31.026640', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (522, '先斗町', '日本京都府京都市中京区', 35.00498557, 135.77119066, '三条河原在幕末时期是长州藩的地盘，先斗町（ぽんとちょう）位于三条通到四条通、鸭川和木屋町通之间，是队士们常出没的花街。在司马辽太郎的小说《幕末》猿路口的血斗章节中，有说到会津藩的大庭恭平潜入攘夷志士团队后，和田中新兵卫去先斗町花街，在吉野屋门口遇到姊小路的护卫吉村右京的场景。\n先斗町原本是鸭川的沙洲，江户时代初期，因护岸工事埋立，称作新河原町通。之后发展成茶屋、旅笼等林立的繁华街，公许艺妓营业后，成为有名的花街。除了花街特有的商业形态以外，尚有一般饮食店，东侧的店面对鸭川，设有纳凉床的饮食店很多。\n微雨过后潮湿的石叠小路，两边町家建筑的居酒屋林立，木门前暖黄的纸灯笼，仿佛穿越千年，幕末时的先斗町是否也如此时般宁静，也许只是小巷中多了那些对未来怀抱梦想的武士吧。', 1, 1, 0, '2021-12-08 09:39:34.354935', '2021-12-08 09:39:34.702839', 29, 1, '京都府');
INSERT INTO `tb_places` VALUES (523, '梅小路公园', '日本京都府京都市下京区观喜寺町', 34.9866391, 135.7453352, '梅小路公园是一座位于京都府京都市下京区的公园。公园南部有平清盛的邸宅西八条第。梅小路蒸汽火车博物馆和京都水族馆位于梅小路公园内。', 1, 1, 0, '2021-12-08 09:39:37.478383', '2021-12-08 09:39:37.825039', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (524, '京都府警察本部', '日本京都府京都市上京区藪之内町 下 立売 通 釜座 東入 藪ノ内町85-3・85-4合地', 35.0204412, 135.7562382, '', 1, 1, 0, '2021-12-08 09:39:43.422304', '2021-12-08 09:39:43.778332', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (525, '六角堂', '京都府京都市中京区六角通东洞院西入堂之前町', 35.007653, 135.7602521, '六角堂本名顶法寺，是位在日本京都府京都市中京区的天台宗系单立寺院。山号“紫云山”。本尊如意轮观音（秘佛）。本堂为平面六角形，因此通称“六角堂”。以华道・池坊之发祥地而出名。京都市的正中心即在此寺内，有一处特别划分的区域，被称为“京都的肚脐眼”。', 1, 1, 0, '2021-12-08 09:39:44.729320', '2021-12-08 09:39:45.072702', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (526, '四条乌丸路口', '日本京都府京都市下京区水銀屋町四条大街与乌丸大街路口', 35.00368546, 135.75992319, '', 1, 1, 0, '2021-12-08 09:39:50.653476', '2021-12-08 09:39:50.998882', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (527, '四条河原町', '日本京都府京都市中京区米屋町四条河原町', 35.0044866, 135.769182, '四条河原町是指位于日本京都府京都市下京区及中京区的一个十字路口，亦泛指位于这个十字路口附近的繁华街区。', 1, 1, 0, '2021-12-08 09:39:52.769543', '2021-12-08 09:39:53.110640', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (528, '佛光寺', '日本京都府京都市下京区新开町３９７', 35.0009484, 135.7622777, '佛光寺是位在日本京都府京都市下京区的寺院，真宗佛光寺派本山。山号“渋谷（汁谷）山”。本尊阿弥陀如来、开基（创立者）为亲鸾。净土真宗的五门迹之一。', 1, 1, 0, '2021-12-08 09:39:54.478227', '2021-12-08 09:39:54.820858', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (529, '一条归桥', '日本京都府京都市上京区堀川下之町', 35.0262653, 135.7519446, '位于京都西部的一座石桥，据说有将近1100的历史。', 1, 1, 0, '2021-12-08 09:39:58.375713', '2021-12-08 09:39:58.719364', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (530, '鞍马山', '日本京都府京都市左京区', 35.1236178, 135.7714334, '鞍马山是位在京都府京都市左京区的山。标高584米。东边有鞍马川、西边有贵船川，是两川的分水岭。\n虽然距离京都市中心仅有半个小时的车程，但是鞍马山区内拥有朴实的农家风情，可以体验到非常原生态的京都，还有罕见的地标景观“木之根道”。山上的鞍马寺和贵船神社也是著名的参拜之地。', 1, 1, 0, '2021-12-08 09:40:00.512558', '2021-12-08 09:40:00.856492', 29, 1, '京都市');
INSERT INTO `tb_places` VALUES (531, '东寺', '日本京都府京都市南区九条町１', 34.9811177, 135.7475964, '东寺是一位于京都市南区九条町的寺院。又名教王护国寺。为东寺真言宗的总本山。山号八幡山、本尊药师如来。寺纹是云形纹（东寺云）。创建于794年，是桓武天皇迁都平安京后所兴建的国立寺院，是目前唯一平安京所遗留的建设，1994年以“古都京都的文化财”的一部分而列入世界遗产名单之中。而境内的五重塔为日本最高的五重塔。', 1, 1, 0, '2021-12-08 09:40:06.545970', '2021-12-08 09:40:06.927264', 30, 1, '京都市');
INSERT INTO `tb_places` VALUES (532, '嵯峨野竹林小径', '日本京都府京都市右京区嵯峨野岚山', 35.01702888, 135.67186611, '嵯峨野竹林位于日本京都的国家指定古迹——岚山。竹林小径长约500米，穿过野宫神社往大河内山庄步行即可到达岚山竹林。日本文化厅将岚山誉为“风光秀美”之地，也是得益于这条日本国内最著名的竹林的优美景致。\n岚山的竹林小道是李安拍摄《卧虎藏龙》的地方 ，除此之外，小道内的天龙寺更是日本五大神社之一。驻足在竹林中，你可以听到风吹过竹叶发出的天籁之音，这一声音也被评为日本100种最值得保留的声音之一。', 1, 1, 0, '2021-12-08 09:40:08.648384', '2021-12-08 09:40:08.994767', 30, 1, '京都府');
INSERT INTO `tb_places` VALUES (533, '读卖电视台本社大楼', '日本大阪府大阪市中央区城見２丁目２−３３', 34.6943675, 135.5341148, '读卖电视台是以近畿地区为放送对象的电视台，本社位于大阪市内。', 1, 1, 0, '2021-12-08 09:40:10.109082', '2021-12-08 09:40:10.451730', 30, 1, '大阪市');
INSERT INTO `tb_places` VALUES (534, '大阪府警察本部', '日本大阪府大阪市中央区大手前３丁目１−１１', 34.6838903, 135.5204452, '', 1, 1, 0, '2021-12-08 09:40:19.257436', '2021-12-08 09:40:19.605364', 30, 1, '大阪市');
INSERT INTO `tb_places` VALUES (535, '大阪警察医院', '日本大阪府大阪市天王寺区北山町１０−３１', 34.6587627, 135.5212195, '', 1, 1, 0, '2021-12-08 09:40:20.676541', '2021-12-08 09:40:21.023751', 30, 1, '大阪市');
INSERT INTO `tb_places` VALUES (536, '大阪新大谷饭店', '日本大阪府大阪市中央区大阪城２−１', 34.69086, 135.5335, '大阪新大谷饭店位于大阪城北面，是大阪市内一家高级酒店。', 1, 1, 0, '2021-12-08 09:40:23.883838', '2021-12-08 09:40:24.308721', 30, 1, '大阪市');
INSERT INTO `tb_places` VALUES (537, '大阪城天守阁', '日本大阪府大阪市中央区大阪城', 34.6873788, 135.5258614, '大阪城，位于日本大阪市中央区（古属摄津国东成郡）的大阪城公园内，为大阪名胜之一，和名古屋城、熊本城并列日本历史上的三名城，别名“金城”或“锦城”。\n在桃山时代是丰臣秀吉的居城。后来德川家康以两次大坂之役（冬之阵、夏之阵）消灭了丰臣家，此后大坂城成为德川幕府控制西日本大名的重要据点。\n城郭含城下町等周长约7.8公里，与江户城初期（内郭）相当（江户后期含城下町外郭周长约15.8ｋｍ）。\n“大阪”在明治维新前写作“大坂”，维新后忌于“坂”字可拆为“士反”，有“武士叛乱”之讳，因此于明治三年（1870年）改名为“大阪”，“大坂城”也因而更名为“大阪城”。一般讲述更名前的历史时仍会以旧写“大坂城”称之，以示时代区别。', 1, 1, 0, '2021-12-08 09:40:28.605145', '2021-12-08 09:40:28.949434', 30, 1, '大阪市');
INSERT INTO `tb_places` VALUES (538, '渡月桥', '日本京都府京都市嵯峨野', 35.01309965, 135.67777434, '渡月桥是一座位于日本京都府京都市，跨越桂川上的车行与人行桥梁。桥北侧的嵯峨野地区属右京区的范围，而南侧的岚山则是西京区的一部分。从北面渡过渡月桥的话，经过中之岛（嵯峨中之岛町）就会到达岚山的山脚。渡月桥周边的岚山地区是京都西郊观赏樱花和红叶的胜地，因此经常会在旅游旺季期间发生严重的交通阻塞。', 1, 1, 0, '2021-12-08 09:40:31.144570', '2021-12-08 09:40:31.490688', 30, 1, '京都市');
INSERT INTO `tb_places` VALUES (539, '天龙寺', '日本京都府京都市右京区', 35.0158275, 135.673771, '天龙寺是世界文化遗产，建于1339年，为临济宗派天龙寺院派的总院，是足利尊氏将军为供养醍醐天皇而建的。在室町时代是京都五山的第一大山。但由于屡次遭遇火灾而未能保留创建当初的宏伟景象。现在各大堂为明治时期重建。寺内安放有藤原時代的释迦如來坐像。庭园借龟山和岚山之景，将贵族文化的优雅和禅宗的玄妙融为一体，是日本特别的历史遗迹，四季景色极美。', 1, 1, 0, '2021-12-08 09:40:33.094568', '2021-12-08 09:40:33.437365', 30, 1, '京都市');
INSERT INTO `tb_places` VALUES (540, '时雨殿', '日本京都府京都市右京区', 35.013712, 135.673808, '时雨殿位于京都小苍山麓，岚山渡月桥附近附近，是展示小仓百人一首为主题的歌牌相关展馆。\n内有体验展示等活动。2017年3月21日开始修缮关闭，再次开放日期暂时未定。', 1, 1, 0, '2021-12-08 09:40:36.651521', '2021-12-08 09:40:36.992578', 30, 1, '京都市');
INSERT INTO `tb_places` VALUES (541, '三德山三佛寺', '日本鸟取县东伯郡三朝町三徳１０１０', 35.399265, 133.955784, '三佛寺是一座天台宗佛教寺庙，该寺位于日本鸟取县东伯郡三朝町，建于庆云3年（706年），在嘉祥2年（849年），由慈觉大师圆仁放置释迦如来、阿弥陀如来及大日如来三座佛像进入寺庙里面，所以“三佛寺”故名。山号由三德山而得名。\n该寺位于鸟取县海拔900米高的三德山中部，是一栋山神庙。三佛寺内的投入堂建在悬崖边的建筑，是日本国宝级建筑。三德山在昭和9年（1934年）7月7日被定为国家名胜古迹。', 1, 1, 0, '2021-12-08 09:40:39.993127', '2021-12-08 09:40:40.340344', 30, 1, '东伯郡');
INSERT INTO `tb_places` VALUES (542, '东华菜馆', '日本京都府京都市下京区斋藤町１４０−２', 35.0035825, 135.7710189, '京都四条大桥西段木屋町附近的一家高级北京料理店。', 1, 1, 0, '2021-12-08 09:40:47.281563', '2021-12-08 09:40:47.668795', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (543, '木屋町', '日本京都府京都市中京区木屋町', 35.0149388, 135.7652823, '木屋町是先斗町和河源町之间的一条小巷，很窄小但却有许多餐厅、居酒屋与俱乐部，大多都是晚餐时间才开始营业。这里也是京都春季赏樱的好去处。', 1, 1, 0, '2021-12-08 09:40:50.632872', '2021-12-08 09:40:50.988571', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (544, 'moon walk 酒吧 四条木屋町店', '日本京都府京都市下京区真町', 35.004361, 135.770281, 'Bar moon walk在日本国内有20多家连锁店铺。\n京都四条木屋町的这一家因作为《春宵苦短，少女前进吧！》小说及动画电影中“月面步行酒吧”的原型而具有极高人气。该酒吧和作品中描述的一样，全部饮品200日元（不含税），并提供作品中出现的“名酒”——“伪电气白兰”。下单伪电气白兰的客人能得到动画主题卡片的小赠品。', 1, 1, 0, '2021-12-08 09:40:54.151675', '2021-12-08 09:40:54.493546', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (545, '所多东山餐厅', '日本京都府京都市东山区南町４０９', 34.999145, 135.778834, '高台寺附近的一间餐厅，门面不太起眼但进入十分是惊艳，餐厅主体是一间大格局的传统京都古建筑。主打京都本土的新鲜食材烹饪的意大利菜，可提供婚宴、酒席等服务。', 1, 1, 0, '2021-12-08 09:40:58.864036', '2021-12-08 09:40:59.206079', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (546, '京阪锦鲤中心', '日本大阪府枚方市杉２丁目２０−１', 34.810952, 135.7225852, '枚方市内一处鲤鱼养殖中心。', 1, 1, 0, '2021-12-08 09:41:02.519799', '2021-12-08 09:41:02.862985', 31, 1, '枚方市');
INSERT INTO `tb_places` VALUES (547, '先斗町', '日本京都府京都市中京区', 35.00498557, 135.77119066, '三条河原在幕末时期是长州藩的地盘，先斗町（ぽんとちょう）位于三条通到四条通、鸭川和木屋町通之间，是队士们常出没的花街。在司马辽太郎的小说《幕末》猿路口的血斗章节中，有说到会津藩的大庭恭平潜入攘夷志士团队后，和田中新兵卫去先斗町花街，在吉野屋门口遇到姊小路的护卫吉村右京的场景。\n先斗町原本是鸭川的沙洲，江户时代初期，因护岸工事埋立，称作新河原町通。之后发展成茶屋、旅笼等林立的繁华街，公许艺妓营业后，成为有名的花街。除了花街特有的商业形态以外，尚有一般饮食店，东侧的店面对鸭川，设有纳凉床的饮食店很多。\n微雨过后潮湿的石叠小路，两边町家建筑的居酒屋林立，木门前暖黄的纸灯笼，仿佛穿越千年，幕末时的先斗町是否也如此时般宁静，也许只是小巷中多了那些对未来怀抱梦想的武士吧。', 1, 1, 0, '2021-12-08 09:41:06.958305', '2021-12-08 09:41:07.307183', 31, 1, '京都府');
INSERT INTO `tb_places` VALUES (548, '京料理 鹤清', '京都府京都市下京区木屋町五条上ル下材木町451', 34.9967572, 135.7678434, '先斗町鸭川畔的一家高级怀石料理。夏季设有纳凉床。', 1, 1, 0, '2021-12-08 09:41:10.877730', '2021-12-08 09:41:11.220234', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (549, '鸭川', '日本京都府京都市', 35.01014903, 135.771799, '鸭川是代表京都一条长31公里的一级河川。这条河流的水十分清澈，流穿过京都中央。从古代起居民已经住在河流的两旁. 特别是西岸及南岸。虽然京都已不是首都但仍然有很多外国及本地游客到来游览。 祗园在鸭川的中央，四周有许多商店提供良好鸭川的景致，尤其在晚上。河流两旁有步行径及单车径，在主要的名胜景点均可以找到单车出租店。', 1, 1, 0, '2021-12-08 09:41:15.577577', '2021-12-08 09:41:15.921080', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (550, '纠之森', '日本京都府京都市左京区下鸭泉川町５９', 35.0357572, 135.7720764, '纠之森是一片占地三万六千坪的森林，位于下鸭神社内，是登记在册的世界遗产。纠之森曾经发掘出土过绳文时代的土器、弥生时代的住宅痕迹，平安时代和江户时代的各类文物，与各类古籍文献相互佐证，一同将下鸭神社所在的这片土地上有人类生活的时间向前推进了两千年。', 1, 1, 0, '2021-12-08 09:41:19.226806', '2021-12-08 09:41:19.569171', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (551, '御荫桥', '日本京都府京都市左京区御荫通', 35.0343017, 135.7745991, '横跨高野川、通往下鸭神社的一座石桥。', 1, 1, 0, '2021-12-08 09:41:22.775684', '2021-12-08 09:41:23.118313', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (552, '阿阇梨饼本铺', '日本京都府京都市左京区田中大堰町１３９', 35.0300913, 135.7780658, '京都特色的甜品糕点店，有多家分店。', 1, 1, 0, '2021-12-08 09:41:24.646421', '2021-12-08 09:41:24.993658', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (553, '京都大学', '日本京都府京都市左京区吉田本町', 35.0262444, 135.7808218, '京都大学（英语：Kyoto University，日语平假名：きょうとだいがく），简称京大（きょうだい），是一所本部位于日本京都市左京区的世界级顶尖研究型大学，在日本仅次于东京大学的学科齐全、规模宏大的国立综合大学，日本继东京大学之后设立的第二所旧制帝国大学。作为日本国内的最高学府之一，京都大学在全球都享有很高的声望，其培育出的人才和学术成果享誉世界，被誉为“科学家的摇篮”。', 1, 1, 0, '2021-12-08 09:41:26.386799', '2021-12-08 09:41:26.729863', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (554, '出町柳站', '日本京都府京都市左京区田中上柳町', 35.0305106, 135.7732965, '出町柳站是位于日本京都府京都市左京区叡山电铁、京阪电气铁道的车站。 现在一般都将鸭川左岸的本站周边地名固定称为“出町柳”，但此站名原为结合两个旧地名出町和柳而创造出来的。出町是鸭川右岸的河原町今出川附近的旧地名，柳是鸭川左岸的本站周边的旧地名。', 1, 1, 0, '2021-12-08 09:41:31.032314', '2021-12-08 09:41:31.377323', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (555, '半木町屋旧书店', '日本京都府京都市上京区凤瑞町', 35.023542, 135.737444, '这间古书店建筑年龄已经超过100年，经营传承3代，店内各种旧书类目繁多。', 1, 1, 0, '2021-12-08 09:41:33.837973', '2021-12-08 09:41:34.181627', 31, 1, '京都市');
INSERT INTO `tb_places` VALUES (556, '进进堂 京大北门店', '日本京都府京都市左京区北白川追分町', 35.0287633, 135.7820006, '京大北门附近一间颇受学生们欢迎的咖啡厅。', 1, 1, 0, '2021-12-08 09:41:36.771475', '2021-12-08 09:41:37.113528', 31, 1, '京都市');
