INSERT INTO `tb_places` VALUES (594, '唐津站', '日本佐贺县唐津市新兴町', 33.445938, 129.968507, '唐津站是一位于日本佐贺县唐津市新兴町、隶属于九州旅客铁道的铁路车站。唐津站是干线铁路筑肥线与支线唐津线的交会车站，也是唐津市的主车站。在过去该站只是唐津线末端的一个小车站而已，但1983年时原本由博多直通伊万里的筑肥线进行大规模的改道工程绕行唐津，使得唐津成为两条铁路路线的转运站，重要性大增。', 1, 1, 0, '2021-12-08 09:43:31.204599', '2021-12-08 09:43:31.547748', 33, 1, '唐津市');
INSERT INTO `tb_places` VALUES (595, '国立代代木竞技场', '日本东京都涩谷谷区神南２丁目１−1', 35.6672534, 139.6999365, '国立代代木竞技场由日本名建筑师丹下健三所设计，建造时间为1961年至1964年，为了作为1964年东京奥运游泳与跳水的场馆。全部可容纳10,500人，现在主要作为冰上曲棍球与篮球的比赛场所，也有多组艺人曾经在此举行演唱会。', 1, 1, 0, '2021-12-08 09:43:34.555564', '2021-12-08 09:43:34.950336', 33, 1, '东京都');
