INSERT INTO `tb_places` VALUES (600, '唐津城', '日本佐贺县唐津市东城内８−８−1', 33.4535433, 129.9781934, '唐津城是位在佐贺县唐津市的一座平山城。别名舞鹤城。江户时代是唐津藩之藩厅。', 1, 1, 0, '2021-12-08 09:43:46.401327', '2021-12-08 09:43:46.742096', 33, 1, '唐津市');
