INSERT INTO `tb_places` VALUES (606, '福冈机场', '日本福冈县福冈市博多区下臼井', 33.59160739, 130.44694488, '福冈机场是一个位于日本福冈县福冈市博多区的国际与国内机场。因该机场曾为美国空军所驻扎之板付基地，所以又曾称为板付机场。', 1, 1, 0, '2021-12-08 09:43:57.824462', '2021-12-08 09:43:58.166887', 33, 1, '福冈市');
INSERT INTO `tb_places` VALUES (607, '中洲大排档', '〒810-0801 福岡県福岡市博多区中洲１丁目８', 33.59013732, 130.40865827, '中洲大排档是日本福冈知名的餐饮夜市，号称全日本有40%的大排档在此做生意，每当夜幕降临，传统车档便会沿河排开，贩售拉面、烧烤、酒肆等各类经典日式美食，食客们络绎不绝，现场热闹非凡。', 1, 1, 0, '2021-12-08 09:44:00.957877', '2021-12-08 09:44:01.301547', 33, 1, '福冈市');
