INSERT INTO `tb_places` VALUES (612, '惠比寿招财猫', '日本岐埠县高山市本町２丁目', 36.1424687, 137.2577921, '本町大街上的招财吉祥物，冬天是招财猫造型，夏天是人物造型。', 1, 1, 0, '2021-12-08 09:44:13.071109', '2021-12-08 09:44:13.417565', 34, 1, '高山市');
INSERT INTO `tb_places` VALUES (613, '宫川朝市', '日本岐埠县高山市下三之町', 36.1433655, 137.2581739, '飞驒在江户时期是德川政府的直辖地，因此在这里设立行政事务的机构，称为「阵屋」。这样的机构，全日本仅剩高山这座仍留存着，因此成为日本指定史迹。现在还存有仓库、玄关、长屋等建物。\n在这“高山阵屋”前的朝市，可追溯至大正时期，原本在高山别院的市集转移至现在的高山阵屋前，原本是早晨、晚上都有市集，但因为战后灯火管制，夜晚市集便停止，早晨的市集则持续至今。朝市是每天早上7点开始 (11月~3月是8点开始)，阵屋前朝市大多贩卖着当地的蔬菜水果，还有烫好的玉米等，方便游客现买现吃。', 1, 1, 0, '2021-12-08 09:44:14.284866', '2021-12-08 09:44:14.628554', 34, 1, '高山市');
