INSERT INTO `tb_places` VALUES (644, '日枝神社', '日本岐埠县高山市城山156', 36.13321337, 137.26145906, '日枝神社是岐埠县高山市的神社，别名飞弹山王宫日枝神社。以高山祭最为出名，比如秋天举行的樱山八幡宫的例行祭典。祭神是大山咋神。', 1, 1, 0, '2021-12-08 09:45:21.316241', '2021-12-08 09:45:21.663089', 34, 1, '高山市');
