INSERT INTO `tb_places` VALUES (652, '京都造形艺术大学', '日本京都府京都市左京区北白川瓜生山2-116', 35.0373057, 135.7922393, '京都艺术与设计大学是日本京都京都Sakyo-ku的私立大学。该学校的前身成立于1934年。它于1977年被特许为大专学院，并于1991年成为一所四年制大学。 该大学保留了许多杰出的视觉和表演艺术家作为常规教师和客座讲师。自2004年以来，该大学的国际艺术研究中心迎来了来自美洲，欧洲和日本的嘉宾艺术家。', 1, 1, 0, '2021-12-08 09:45:55.699463', '2021-12-08 09:45:56.044180', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (653, '南禅寺', '日本京都府京都市左京区南禅寺福地町', 35.011311, 135.792546, '南禅寺，日本京都一所佛教寺院，为临济宗南禅寺派大本山。正应四年为龟山天皇创建，首任住持为大明国师无关普门。南禅寺是日本最早的由皇室发愿建造的禅宗寺院，因此位列京都五山之上，为日本禅宗最高寺院。\n南禅寺风光极好，也是赏樱赏枫的圣地。', 1, 1, 0, '2021-12-08 09:45:57.565748', '2021-12-08 09:45:57.909708', 35, 1, '京都府');
INSERT INTO `tb_places` VALUES (654, '鸭川三角洲', '日本京都府京都市上京区出柳町', 35.0298717, 135.7717437, '鸭川三角洲并非地理学意义上的三角洲，而是来自贺茂川及高野川的河水自京都北方顺流而下，汇聚于出町柳形成的一处河流交汇口。这里景色优美，有可以渡河的飞石。', 1, 1, 0, '2021-12-08 09:46:00.980189', '2021-12-08 09:46:01.321666', 35, 1, '京都市');
