INSERT INTO `tb_places` VALUES (665, '京都大学', '日本京都府京都市左京区吉田本町', 35.0262444, 135.7808218, '京都大学（英语：Kyoto University，日语平假名：きょうとだいがく），简称京大（きょうだい），是一所本部位于日本京都市左京区的世界级顶尖研究型大学，在日本仅次于东京大学的学科齐全、规模宏大的国立综合大学，日本继东京大学之后设立的第二所旧制帝国大学。作为日本国内的最高学府之一，京都大学在全球都享有很高的声望，其培育出的人才和学术成果享誉世界，被誉为“科学家的摇篮”。', 1, 1, 0, '2021-12-08 09:46:28.813286', '2021-12-08 09:46:29.155599', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (666, '新京极商店街', '日本京都府京都市中京区中之町（新京極通）５４８−３', 35.005787, 135.767249, '新京极商店街紧邻着阪急京都线的－四条河原町站，包含新京极、京极、四条通商店街、锦市场、还有好几间百货都在这里，所以也统称－四条河原商圈，是京都的商业中央，京都地铁、阪急电车、京阪电车都在这附近有车站。', 1, 1, 0, '2021-12-08 09:46:30.969070', '2021-12-08 09:46:31.310159', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (667, 'JEUGIA三条本店', '日本京都府京都市中京区石橋町（三条通） 三条通寺町東入石橋町11JEUGIA三条本店5・6f', 35.0086472, 135.7676968, '关西地区连锁的乐器、乐谱、CD及相关物品经营商店。', 1, 1, 0, '2021-12-08 09:46:35.574673', '2021-12-08 09:46:35.953382', 35, 1, '京都市');
