INSERT INTO `tb_places` VALUES (669, '莲井乘花园', '日本京都府京都市左京区山端壱町田町８−６', 35.0501073, 135.7911745, '京都修学院站附近的花店。', 1, 1, 0, '2021-12-08 09:46:42.484042', '2021-12-08 09:46:42.828168', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (670, '哲学之道', '日本京都府京都市左京区鹿ケ谷法然院西町', 35.0190191, 135.7915468, '哲学之道是日本城市京都左京区一条2公里长的小道，路旁是琵琶湖疏水，沿途种植樱花树。这条路的名称来源于京都大学哲学教授西田几多郎每日在此冥想。1972年正式命名。哲学之道经过好几座寺庙和神社，例如慈照寺、法然院、永観堂禅林寺、南禅寺、熊野若王子神社。', 1, 1, 0, '2021-12-08 09:46:44.926723', '2021-12-08 09:46:45.287792', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (671, '修学院拱廊', '日本京都府京都市左京区山端壱町田町８−５９', 35.0504009, 135.7916393, '修学院站附近的拱廊商店街。', 1, 1, 0, '2021-12-08 09:46:47.198901', '2021-12-08 09:46:47.543856', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (672, '今宫神社', '日本京都府京都市北区紫野今宮町２１', 35.0460017, 135.7420278, '今宫神社是平安时代(794-1185)为了消除都内流行疫病而创建的。镰仓时代(1185-1333)后慢慢地被废弃,在应仁之乱中被烧毁。在那之后，豊臣秀吉为了使其复兴还捐赠了神舆。\n\n真正意义上的复兴是在江户时代(1603-)以后。出生在京都西阵的蔬菜店的叫小玉的女性，虽然身份低微，但被德川3代将军家光看中，成为侧室。她作为5代将军綱吉的生母——桂昌院凭借手中的权力进行了今宫神社的再建工作。因为今宫神社是小玉一手复兴起来的,所以又叫\"玉之舆神社\"。它作为祈求良缘和开运的神社被广为熟知。\n\n另外该神社的\"休息节\"是京都三大奇节之一。在樱花纷飞之际，据说花精灵会驱散疫病。在这一天，小鬼、红鬼、和黑鬼会绕着花做的斗笠和着笛子和太鼓跳着舞,走街串巷，祈祷着疫病退散和健康长寿。据说进到花制斗笠下面的话能祛除厄运，好多游客都会钻到斗笠下面。该节于每年4月第二个周日举办。', 1, 1, 0, '2021-12-08 09:46:49.729915', '2021-12-08 09:46:50.072756', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (673, '宝池公园', '日本京都府京都市左京区上高野流田町', 35.05809122, 135.77891289, '宝池公园是位在日本京都府京都市左京区的公园。公园范围以宝池为中心，和国立京都国际会馆、京都格兰王子大饭店邻接', 1, 1, 0, '2021-12-08 09:46:52.103791', '2021-12-08 09:46:52.448064', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (674, '京都MOJO', '日本京都府京都市下京区四条新町月鉾町３９−１', 35.003976, 135.756867, '京都市内的LiveHouse。', 1, 1, 0, '2021-12-08 09:46:56.874927', '2021-12-08 09:46:57.219187', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (675, 'SARASA西阵', '日本京都府京都市北区紫野东藤ノ森町１１−１', 35.0375711, 135.7468606, 'SARASA咖啡在京都共有七家风格各异的主题餐厅，其中人气最高的是SARASA西阵。SARASA西阵原建筑是20世纪30年代建造的钱汤(即公共澡堂)，1998年停业，2000年SARASA接手后改造成极具特色的一间咖啡馆。\n从外观上看仿佛《千与千寻》里汤婆婆的油屋，内部也尽可能保留了钱汤的面貌，咖啡、茶点元素的加入也非常和谐，带着岁月感又充满魔幻意味。', 1, 1, 0, '2021-12-08 09:46:59.807084', '2021-12-08 09:47:00.151161', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (676, '岩仓南大鹭町民居', '日本京都府京都市左京区岩倉南大鷺町６０', 35.061773, 135.786626, '', 1, 1, 0, '2021-12-08 09:47:03.506736', '2021-12-08 09:47:03.849516', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (677, '松崎东山东侧路口', '日本京都府京都市左京区松ケ崎樋ノ上町', 35.05295, 135.787006, '', 1, 1, 0, '2021-12-08 09:47:04.309031', '2021-12-08 09:47:04.651047', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (678, '出町柳站', '日本京都府京都市左京区田中上柳町', 35.0305106, 135.7732965, '出町柳站是位于日本京都府京都市左京区叡山电铁、京阪电气铁道的车站。 现在一般都将鸭川左岸的本站周边地名固定称为“出町柳”，但此站名原为结合两个旧地名出町和柳而创造出来的。出町是鸭川右岸的河原町今出川附近的旧地名，柳是鸭川左岸的本站周边的旧地名。', 1, 1, 0, '2021-12-08 09:47:05.878445', '2021-12-08 09:47:06.221653', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (679, '木屋町', '日本京都府京都市中京区木屋町', 35.0149388, 135.7652823, '木屋町是先斗町和河源町之间的一条小巷，很窄小但却有许多餐厅、居酒屋与俱乐部，大多都是晚餐时间才开始营业。这里也是京都春季赏樱的好去处。', 1, 1, 0, '2021-12-08 09:47:07.661552', '2021-12-08 09:47:08.004951', 35, 1, '京都市');
INSERT INTO `tb_places` VALUES (680, '船冈山公园', '日本京都府京都市北区紫野北舟冈町', 35.0393612, 135.7422067, '', 1, 1, 0, '2021-12-08 09:47:09.819669', '2021-12-08 09:47:10.162224', 35, 1, '京都市');
