INSERT INTO `tb_places` VALUES (684, '修学院站', '日本京都府京都市左京区山端壱町田町', 35.0501946, 135.7904469, '修学院站是位于日本京都市左京区山端壹町田町的叡山电铁叡山本线的车站。', 1, 1, 0, '2021-12-08 09:47:19.671630', '2021-12-08 09:47:20.018896', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (685, '咖拉姆咖喱屋', '日本京都府京都市左京区一乗寺樋ノ口町8-4', 35.0396948, 135.7919494, '日本国内连锁的咖喱餐厅。', 1, 1, 0, '2021-12-08 09:47:20.452097', '2021-12-08 09:47:20.835399', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (686, '家居中心角 六地蔵店', '日本京都府京都市伏見区桃山町山ノ下19-6', 34.9398222, 135.7966065, '京都的家居装潢器材店', 1, 1, 0, '2021-12-08 09:47:21.313149', '2021-12-08 09:47:21.653486', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (687, '京都站', '日本京都府京都市下京区東塩小路釜殿町', 34.98583818, 135.75863449, '京都站位于日本京都府京都市下京区，是西日本旅客铁道、东海旅客铁道、近畿日本铁道和京都市交通局的铁路车站。京都站为日本最大的观光都市——京都市的代表车站。 京都站是多条铁路路线的总站，作为京都观光名所广泛范围的玄关口，车站有多条巴士、地下铁等公共交通机关提供前往京都市内观光名胜的交通服务。', 1, 1, 0, '2021-12-08 09:47:25.199923', '2021-12-08 09:47:25.540026', 36, 1, '京都府');
INSERT INTO `tb_places` VALUES (688, '金阁寺', '日本京都府京都市北区金閣寺町1', 35.03937, 135.7292431, '金阁寺建于1397年，正式名称是鹿苑寺。原为足利义满(あしかが よしみつ)将军的山庄，后改为禅寺。“金阁寺”一名源于足利义满修禅的舍利殿，因其外以金箔装饰，民众遂以金阁殿称之，寺院也因此被唤作金阁寺。1950年，金阁寺被蓄意纵火烧毁，现在看到的金色建筑是修复的。对这段历史感兴趣的朋友可以阅读三岛由纪夫的小说《金阁寺》。 \n金阁寺是3层的楼阁，第一层为法水院；第二层为潮音洞，供奉着观音；第三层是正方形的佛堂，供奉着三尊弥陀佛。金阁寺的建筑与园林构造相融合，一旁的镜湖池池水清洌，身影华丽的金阁倒映在镜湖池中的景观是京都的代表性景观。 \n金阁寺的独特之处：游客拿到的不是参观入场门票而是写有祝福话语的朱印。另外，院中的不动堂旁边有中文和韩文的神签可供占卜，金阁寺内出售的抹茶冰激凌口碑也很不错。', 1, 1, 0, '2021-12-08 09:47:28.729858', '2021-12-08 09:47:29.071701', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (689, '北野天满宫', '日本京都府京都市上京区馬喰町', 35.0314012, 135.7351215, '北野天满宫是位于日本京都府京都市上京区的神社。为二十二社、旧社格为官币中社。和太宰府天满宫同为日本全国天满宫之总本社、天神信仰的中心。主祭神是学问之神菅原道真。京都市民以爱称“てんじんさん”称之。 北野天满宫与太宰府天满宫、防府天满宫并称为日本三大天神。\n在京都众多的神社之中，学生一族最爱的就是这座北野天满宫了，许多应届考生都会来到北野天满宫求一个保佑学业成就的御守，希望学问之神能保佑自己考上理想的学校。另外，北野天满宫里栽种了一千多株菅原道真最爱的梅花，2月底到3月中开放，是有别于樱花的一道风景。', 1, 1, 0, '2021-12-08 09:47:33.110517', '2021-12-08 09:47:33.454118', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (690, '花园会馆', '日本京都府京都市右京区花園木辻北町 花園木辻北町１−５', 35.021323, 135.722075, '京都岚山景区的酒店。', 1, 1, 0, '2021-12-08 09:47:38.076870', '2021-12-08 09:47:38.419359', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (691, '岚山商店街', '日本京都府京都市右京区嵯峨天龍寺芒ノ馬場町3-25', 35.01411498, 135.67770628, '岚电岚山站附近、渡月桥北面的商店街，有众多特色商铺。', 1, 1, 0, '2021-12-08 09:47:41.796758', '2021-12-08 09:47:42.143887', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (692, '渡月桥', '日本京都府京都市嵯峨野', 35.01309965, 135.67777434, '渡月桥是一座位于日本京都府京都市，跨越桂川上的车行与人行桥梁。桥北侧的嵯峨野地区属右京区的范围，而南侧的岚山则是西京区的一部分。从北面渡过渡月桥的话，经过中之岛（嵯峨中之岛町）就会到达岚山的山脚。渡月桥周边的岚山地区是京都西郊观赏樱花和红叶的胜地，因此经常会在旅游旺季期间发生严重的交通阻塞。', 1, 1, 0, '2021-12-08 09:47:46.135879', '2021-12-08 09:47:46.478920', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (693, '岚山猕猴公园', '日本京都府京都市西京区中尾下町61', 35.0113346, 135.6766869, '公园位于渡月桥南侧岚山，展望台可以眺望整个京都市。公园内栖息着170多只日本猕猴，动物是野生的，但可以喂食在现场购买的食物。', 1, 1, 0, '2021-12-08 09:47:48.666609', '2021-12-08 09:47:49.010514', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (694, '绘梦咖啡', '日本京都府京都市右京区嵯峨中ノ島町1', 35.0115879, 135.6781674, '', 1, 1, 0, '2021-12-08 09:47:54.107931', '2021-12-08 09:47:54.450452', 36, 1, '京都市');
