INSERT INTO `tb_places` VALUES (699, 'Platz 座布团专门店', '日本京都府京都市右京区嵯峨天龍寺造路町５', 35.01616, 135.679403, '座布团专门店“Platz”创业于西元1887年（明治20年），当初起业于京都西阵区，后来随着工厂转移迁至岚山，在1990年开设了以“Platz”为名的品牌店面。以“生活杂货”为品牌主题，但其实“Platz”最自豪的是手工制作，拥有百年历史的座布团。', 1, 1, 0, '2021-12-08 09:48:06.615329', '2021-12-08 09:48:06.959252', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (700, '高岛诊疗所前', '日本京都府京都市右京区嵯峨天龍寺今堀町２−３４', 35.017282, 135.681872, '', 1, 1, 0, '2021-12-08 09:48:08.388975', '2021-12-08 09:48:08.732205', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (701, '运动乐园 北白川', '日本京都府京都市左京区一乗寺塚本町 左京区一乗寺塚本町 111（旧址）', 35.03820172, 135.79117715, '原坐落于京都造型艺术大学对面，是北白川地区有名的游戏中心，是一代人的青春纪念。曾为京阿尼大热动画《轻音》第二季的取景地。已于2011年闭店，或许对于熟悉的人来说它就在动画中被继续记住。', 1, 1, 0, '2021-12-08 09:48:09.147493', '2021-12-08 09:48:09.491070', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (702, '北川大道路口', '日本京都府京都市左京区松ケ崎小脇町１', 35.051876, 135.787305, '', 1, 1, 0, '2021-12-08 09:48:10.816613', '2021-12-08 09:48:11.158758', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (703, '札幌羊丘瞭望台', '日本北海道札幌市豊平区羊ケ丘', 42.9990691, 141.3945084, '札幌羊丘瞭望台是北海道札幌市丰平区羊丘的一个著名观光景点，在此可自东南方向一览札幌市区。瞭望台的威廉·史密斯·克拉克雕像非常著名，是北海道最著名的象征之一。战前的札幌羊丘瞭望台是“农林省月寒种羊场”，自当时就是札幌的观光胜地。1959年后正式改为瞭望台。', 1, 1, 0, '2021-12-08 09:48:14.093073', '2021-12-08 09:48:14.434951', 36, 1, '札幌市');
INSERT INTO `tb_places` VALUES (704, '宝池公园', '日本京都府京都市左京区上高野流田町', 35.05809122, 135.77891289, '宝池公园是位在日本京都府京都市左京区的公园。公园范围以宝池为中心，和国立京都国际会馆、京都格兰王子大饭店邻接', 1, 1, 0, '2021-12-08 09:48:16.030681', '2021-12-08 09:48:16.372313', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (705, '圆圈K便利店 京都一乘寺店', '日本京都府京都市左京区一乗寺花ノ木町1', 35.0435799, 135.7921439, 'circle K 曾为京阿尼人气动画《轻音》第二季取景地，已经停业，现在此地是全家便利店，建筑外观相似，仍有很多粉丝前去打卡。', 1, 1, 0, '2021-12-08 09:48:21.467149', '2021-12-08 09:48:21.809710', 36, 1, '京都市');
