INSERT INTO `tb_places` VALUES (723, '京都府立图书馆', '日本京都府京都市左京区岡崎成勝寺町9', 35.01297, 135.78197, '京都府立图书馆是位于日本京都府京都市左京区冈崎成胜寺町9的一座图书馆，其前身是日本首座公里公开图书阅览设施京都集书院。现在的图书馆开业于1909年。图书馆有地上4层地下2层，面积7,478平方米，馆藏数超过120万册。', 1, 1, 0, '2021-12-08 09:49:18.848009', '2021-12-08 09:49:19.239943', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (724, '京都市役所', '日本京都府京都市中京区寺町通御池上る上本能寺前町488 番地', 35.011619, 135.768167, '京都市役所是日本京都市的市政厅。京都市役所竣工于1927年，是政令指定都市的市役所中历史最古老的。现在京都市役所有改建扩张的计划。', 1, 1, 0, '2021-12-08 09:49:20.965331', '2021-12-08 09:49:21.306708', 36, 1, '京都市');
INSERT INTO `tb_places` VALUES (725, '修学院站', '日本京都府京都市左京区山端壱町田町', 35.0501946, 135.7904469, '修学院站是位于日本京都市左京区山端壹町田町的叡山电铁叡山本线的车站。', 1, 1, 0, '2021-12-08 09:49:28.753339', '2021-12-08 09:49:29.120161', 37, 1, '京都市');
