INSERT INTO `tb_places` VALUES (727, '出町柳站', '日本京都府京都市左京区田中上柳町', 35.0305106, 135.7732965, '出町柳站是位于日本京都府京都市左京区叡山电铁、京阪电气铁道的车站。 现在一般都将鸭川左岸的本站周边地名固定称为“出町柳”，但此站名原为结合两个旧地名出町和柳而创造出来的。出町是鸭川右岸的河原町今出川附近的旧地名，柳是鸭川左岸的本站周边的旧地名。', 1, 1, 0, '2021-12-08 09:49:34.678028', '2021-12-08 09:49:35.023068', 37, 1, '京都市');
