INSERT INTO `tb_places` VALUES (734, '市房山神宫', '日本熊本县球磨郡水上村汤山', 32.316105, 131.076652, '市房山是人吉球磨地区最高的山峰，此神社象征着对市房山的信仰。据说从历代的相良氏到民众都经常去市房山神宫参拜，并将此称为“参拜老山”。本神社建在市房山的山腰，藏在森林中很容易被忽略，是动画《夏目友人帐》中多次出现的地点。', 1, 1, 0, '2021-12-08 09:49:51.222513', '2021-12-08 09:49:51.564664', 38, 1, '球磨郡');
