INSERT INTO `tb_places` VALUES (754, '人吉站', '日本熊本县人吉市中青井町', 32.21612, 130.753719, '人吉站是一位于日本熊本县人吉市中青井町326番地1号、由九州旅客铁道与球磨川铁道汤前线共用的铁路车站。其中球磨川铁道汤前线的车站自2009年4月1日起更名为人吉温泉车站。 人吉站是九州的地方支线肥萨线与第三部门铁路业者球磨川铁道所属的汤前线之交会车站。', 1, 1, 0, '2021-12-08 09:50:34.409741', '2021-12-08 09:50:34.764314', 39, 1, '人吉市');
