INSERT INTO `tb_places` VALUES (761, '上色见熊野座神社', '日本熊本县阿苏郡高森町上色町', 32.85638982, 131.15845788, '上色见熊野座神社的历史非常久远，创立时间不明，据说是由纪州熊野迁移而来，为祭祀南乡总镇守而建。天正年间战火烧毁了这座神社，现在保留下来的建筑是于1722年重建的。\n上色见熊野座神社位于海拔670米的月形山山路上，100基的石灯笼排列在参拜道两侧，似乎永远持续向远方的台阶，飘荡着的不像世间所能拥有的气氛，被翡翠色渲染成朦胧一片的苔藓和古木……既庄严又神秘，有着被称为“将人引向异世界”的超自然般的景色。', 1, 1, 0, '2021-12-08 09:50:55.848402', '2021-12-08 09:50:56.189711', 40, 1, '阿苏郡');
