INSERT INTO `tb_places` VALUES (793, '熊本站', '日本熊本县熊本市西区春日３丁目１５', 32.790383, 130.6885128, '熊本站是九州旅客铁道、日本货物铁道和熊本市交通局的铁路车站，位于熊本县熊本市西区春日三丁目。 本站是熊本县厅所在地熊本市的中心车站，所有列车均停靠本站。2011年3月12日九州新干线鹿儿岛线全线开通后，主要检车段亦转移至此站。而车站原本的“东口”和“西口”亦于当日改称为“白川口”和“新干线口”', 1, 1, 0, '2021-12-08 09:52:04.139707', '2021-12-08 09:52:04.507634', 42, 1, '熊本市');
