INSERT INTO `tb_places` VALUES (803, '旧前田侯爵邸洋館', '日本东京都目黑区4丁目3-55', 35.662104, 139.680097, '位于驹场公园内，此公园在明治时期为驹场农校，后并入东京大学农学部，迁往本乡校区。此地于1967年整备为公园，旧前田侯爵邸洋館现也是东京近代文学博物馆。', 1, 1, 0, '2021-12-08 09:52:20.847237', '2021-12-08 09:52:21.191825', 42, 1, '东京都');
INSERT INTO `tb_places` VALUES (804, '仁风阁', '日本鸟取县鸟取市东町２丁目121', 35.5071402, 134.2374688, '仁风阁位于日本鸟取县，是明治时代仿西式建筑，重要文化财。1907年皇太子嘉仁亲王在当地游览的行宫，也是鸟取藩主池田仲博侯爵别宫，现在做为游览古迹。 开放时间早上九点至下午五点。', 1, 1, 0, '2021-12-08 09:52:23.042245', '2021-12-08 09:52:23.385845', 42, 1, '鸟取市');
INSERT INTO `tb_places` VALUES (805, '八原祠', '日本熊本县球磨郡水上村汤山', 32.31825633, 131.07266178, '祓川桥附近一处森林里的小祠堂。', 1, 1, 0, '2021-12-08 09:52:24.200535', '2021-12-08 09:52:24.543286', 42, 1, '球磨郡');
