INSERT INTO `tb_places` VALUES (818, '天狗桥', '日本熊本县中神町１−2', 32.226031, 130.71431, '人吉市一处红漆钢架桥，是热门动画 《夏目友人帐》中常常出现的场景之一。', 1, 1, 0, '2021-12-08 09:52:52.465194', '2021-12-08 09:52:52.807754', 43, 1, '人吉市');
