INSERT INTO `tb_places` VALUES (820, '市房山神宫', '日本熊本县球磨郡水上村汤山', 32.316105, 131.076652, '市房山是人吉球磨地区最高的山峰，此神社象征着对市房山的信仰。据说从历代的相良氏到民众都经常去市房山神宫参拜，并将此称为“参拜老山”。本神社建在市房山的山腰，藏在森林中很容易被忽略，是动画《夏目友人帐》中多次出现的地点。', 1, 1, 0, '2021-12-08 09:52:58.664650', '2021-12-08 09:52:59.005613', 43, 1, '球磨郡');
INSERT INTO `tb_places` VALUES (821, '枞木吊桥', '日本熊本县八代市泉町枞木', 32.4994291, 130.9687046, '熊本县八代市枞木地区的山间吊桥，是赏枫的好去处。', 1, 1, 0, '2021-12-08 09:53:00.587035', '2021-12-08 09:53:00.929472', 43, 1, '八代市');
INSERT INTO `tb_places` VALUES (822, '八代站', '日本熊本县八代市萩原町１丁目１', 32.5038199, 130.6215554, '', 1, 1, 0, '2021-12-08 09:53:03.215057', '2021-12-08 09:53:03.556464', 43, 1, '八代市');
INSERT INTO `tb_places` VALUES (823, '人吉站', '日本熊本县人吉市中青井町', 32.21612, 130.753719, '人吉站是一位于日本熊本县人吉市中青井町326番地1号、由九州旅客铁道与球磨川铁道汤前线共用的铁路车站。其中球磨川铁道汤前线的车站自2009年4月1日起更名为人吉温泉车站。 人吉站是九州的地方支线肥萨线与第三部门铁路业者球磨川铁道所属的汤前线之交会车站。', 1, 1, 0, '2021-12-08 09:53:05.266704', '2021-12-08 09:53:05.620076', 43, 1, '人吉市');
INSERT INTO `tb_places` VALUES (824, '人吉城迹', '日本熊本县人吉市麓町', 32.2110735, 130.766535, '人吉城是位在熊本县人吉市的一座平山城。别名织月城、三日月城。镰仓时代以来是相良氏35代670年的居城，江户时代是人吉藩之藩厅。国之史迹。日本100名城之一。', 1, 1, 0, '2021-12-08 09:53:07.787752', '2021-12-08 09:53:08.128158', 43, 1, '人吉市');
INSERT INTO `tb_places` VALUES (825, '电气馆大楼', '日本熊本县熊本市中央区新市街８−２', 32.7988373, 130.7060535, '整幢大楼是熊本市中央区一处商业中心。其中电气馆（Denkikan）是日本第一家专门的电影院，发源于浅草，在全国各地有多家分店。', 1, 1, 0, '2021-12-08 09:53:10.291907', '2021-12-08 09:53:10.657668', 43, 1, '熊本市');
INSERT INTO `tb_places` VALUES (826, '旧古河庭园', '日本东京都北区西ケ原１丁目２７−３９', 35.7431021, 139.7466984, '旧古河庭园是位于日本东京都北区的一座都立庭园。该庭园始建于1919年，最初是古河虎之助男爵的邸宅，包含有洋馆、西洋庭园、日本庭园，现在是国有财产并对公众开放，被政府指定为名胜。旧古河庭园是东京观赏玫瑰的胜地。', 1, 1, 0, '2021-12-08 09:53:11.135030', '2021-12-08 09:53:11.476119', 43, 1, '东京都');
INSERT INTO `tb_places` VALUES (827, '太阳路新市街', '日本熊本县熊本市中央区新市街8-1', 32.7990548, 130.7061516, '新市街的一条商业街。', 1, 1, 0, '2021-12-08 09:53:12.840683', '2021-12-08 09:53:13.180864', 43, 1, '熊本市');
INSERT INTO `tb_places` VALUES (828, '意大利番茄咖啡 熊本下通店', '日本熊本县熊本市中央区下通１丁目１２−１', 32.800089, 130.708219, '', 1, 1, 0, '2021-12-08 09:53:15.036073', '2021-12-08 09:53:15.388153', 43, 1, '熊本市');
INSERT INTO `tb_places` VALUES (829, '韩韩坂路口', '日本熊本县熊本市西区上熊本３丁目１３', 32.824283, 130.702231, '韩韩坂车站附近的一片街区，是一处安静的住宅区，街道朴素雅致，很适合散步。', 1, 1, 0, '2021-12-08 09:53:16.655391', '2021-12-08 09:53:16.996530', 43, 1, '熊本市');
INSERT INTO `tb_places` VALUES (830, '市房水坝', '日本熊本县球磨郡水上村', 32.3201844, 131.013, '熊本县球磨郡水上村球磨川上的水坝，和周围的湖泊一起成为著名的赏樱圣地。', 1, 1, 0, '2021-12-08 09:53:18.705656', '2021-12-08 09:53:19.046414', 43, 1, '球磨郡');
INSERT INTO `tb_places` VALUES (831, '球磨川第一桥梁', '日本熊本县八代市坂本町', 32.389176, 130.656109, '球磨川上的铁路桥，肥萨线从这里经过。', 1, 1, 0, '2021-12-08 09:53:21.172480', '2021-12-08 09:53:21.515215', 43, 1, '八代市');
INSERT INTO `tb_places` VALUES (832, '白川沿岸步道', '日本熊本县熊本市中央区川端町', 32.792777, 130.695261, '', 1, 1, 0, '2021-12-08 09:53:22.913753', '2021-12-08 09:53:23.256264', 43, 1, '熊本市');
INSERT INTO `tb_places` VALUES (833, '朝日啤酒大山崎山庄美术馆', '日本京都府乙训郡大山崎町大山崎钱原５−３', 34.8955495, 135.6796338, '大山崎山庄是一幢约有百年历史的著名建筑，位于天王山，周围景色极佳，馆内展出不少日本民艺运动的作品以及莫奈的作品。', 1, 1, 0, '2021-12-08 09:53:25.621113', '2021-12-08 09:53:25.966771', 43, 1, '乙训郡');
INSERT INTO `tb_places` VALUES (834, '京都塔', '日本京都府京都市下京区', 34.9874767, 135.7594926, '京都塔是由隶属于京阪电气铁道集团的京都塔股份有限公司（京都タワー株式会社）维护营运，包括作为塔基的“京都塔大楼”（京都タワービル）在内，总高131米。\n京都塔的造型由建筑师山田守操刀，结构部分则是由京都大学工学部建筑学教室负责，于1964年（昭和39年）12月28日启用，施工期约1年10个月。虽然京都市本身并不临海，但京都塔却很独特地采用了灯塔的造型作为外观主题。在京都塔建成的那个时代，大部分的塔状建筑都是采钢骨桁架结构（例如巴黎的埃菲尔铁塔），但京都塔却很独特地采用了封闭式的设计，以厚度介于12至22毫米之间的特殊钢板制作成的圆筒熔接而成，本体高100米、重量约800吨的塔身之内完全没有受力结构，是日本最早的外墙承重结构（応力外被構造）建筑之一。考量到日本地处地震带上，也是台风盛行的地区，因此京都塔在设计时，使用了比一般建筑物高出一倍的安全系数，并安然度过风速高达50米/秒的台风与阪神大地震洗礼。', 1, 1, 0, '2021-12-08 09:53:31.631675', '2021-12-08 09:53:31.974885', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (835, '出町桥', '日本京都府京都市左京区下鸭宮河町', 35.0304557, 135.7711254, '鸭川公园西侧的一座桥。', 1, 1, 0, '2021-12-08 09:53:33.316703', '2021-12-08 09:53:33.658739', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (836, '出町柳站', '日本京都府京都市左京区田中上柳町', 35.0305106, 135.7732965, '出町柳站是位于日本京都府京都市左京区叡山电铁、京阪电气铁道的车站。 现在一般都将鸭川左岸的本站周边地名固定称为“出町柳”，但此站名原为结合两个旧地名出町和柳而创造出来的。出町是鸭川右岸的河原町今出川附近的旧地名，柳是鸭川左岸的本站周边的旧地名。', 1, 1, 0, '2021-12-08 09:53:34.607464', '2021-12-08 09:53:34.949177', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (837, '鸭川', '日本京都府京都市', 35.01014903, 135.771799, '鸭川是代表京都一条长31公里的一级河川。这条河流的水十分清澈，流穿过京都中央。从古代起居民已经住在河流的两旁. 特别是西岸及南岸。虽然京都已不是首都但仍然有很多外国及本地游客到来游览。 祗园在鸭川的中央，四周有许多商店提供良好鸭川的景致，尤其在晚上。河流两旁有步行径及单车径，在主要的名胜景点均可以找到单车出租店。', 1, 1, 0, '2021-12-08 09:53:36.477430', '2021-12-08 09:53:36.821913', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (838, '四条大桥', '日本京都府京都市东山区川端町', 35.0038257, 135.7715335, '', 1, 1, 0, '2021-12-08 09:53:38.716036', '2021-12-08 09:53:39.059343', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (839, '京都站', '日本京都府京都市下京区東塩小路釜殿町', 34.98583818, 135.75863449, '京都站位于日本京都府京都市下京区，是西日本旅客铁道、东海旅客铁道、近畿日本铁道和京都市交通局的铁路车站。京都站为日本最大的观光都市——京都市的代表车站。 京都站是多条铁路路线的总站，作为京都观光名所广泛范围的玄关口，车站有多条巴士、地下铁等公共交通机关提供前往京都市内观光名胜的交通服务。', 1, 1, 0, '2021-12-08 09:53:40.851753', '2021-12-08 09:53:41.199692', 44, 1, '京都府');
INSERT INTO `tb_places` VALUES (840, '贺茂大桥', '日本京都府京都市上京区梶井町', 35.0289983, 135.7715984, '横跨鸭川三角洲的大桥。', 1, 1, 0, '2021-12-08 09:53:43.400644', '2021-12-08 09:53:43.742831', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (841, '花见小路', '日本京都府京都市东山区祇园町南侧', 35.0036265, 135.7750364, '祇园花见小路，位于京都繁华区的祇园，大家都是冲着有舞妓或艺妓舞艺的「花街」而来。', 1, 1, 0, '2021-12-08 09:53:46.103300', '2021-12-08 09:53:46.444393', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (842, '六道珍皇寺', '日本京都府京都市東山区小松町大和大路通四条下町四丁目小松町595', 34.9983955, 135.7754641, '六道珍皇寺是位在日本京都府京都市东山区的临济宗建仁寺派寺院。山号“大椿山”。本尊药师如来、传说开基（创立者）为山代淡海。以8月7-10日的六道诣、传说小野篁通往冥界的水井（一般非公开）而广为人知。通称・六道さん、珍皇寺等。传说附近是现世和冥界的接点“六道之辻”。', 1, 1, 0, '2021-12-08 09:53:48.079070', '2021-12-08 09:53:48.424153', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (843, '先斗町', '日本京都府京都市中京区', 35.00498557, 135.77119066, '三条河原在幕末时期是长州藩的地盘，先斗町（ぽんとちょう）位于三条通到四条通、鸭川和木屋町通之间，是队士们常出没的花街。在司马辽太郎的小说《幕末》猿路口的血斗章节中，有说到会津藩的大庭恭平潜入攘夷志士团队后，和田中新兵卫去先斗町花街，在吉野屋门口遇到姊小路的护卫吉村右京的场景。\n先斗町原本是鸭川的沙洲，江户时代初期，因护岸工事埋立，称作新河原町通。之后发展成茶屋、旅笼等林立的繁华街，公许艺妓营业后，成为有名的花街。除了花街特有的商业形态以外，尚有一般饮食店，东侧的店面对鸭川，设有纳凉床的饮食店很多。\n微雨过后潮湿的石叠小路，两边町家建筑的居酒屋林立，木门前暖黄的纸灯笼，仿佛穿越千年，幕末时的先斗町是否也如此时般宁静，也许只是小巷中多了那些对未来怀抱梦想的武士吧。', 1, 1, 0, '2021-12-08 09:53:49.808763', '2021-12-08 09:53:50.149902', 44, 1, '京都府');
INSERT INTO `tb_places` VALUES (844, '下鸭神社', '日本京都府京都市左京区下鸭泉川町59', 35.0391839, 135.7730066, '贺茂御祖神社为一座位于京都市左京区的神社，被通称下鸭神社。为二十二社之一、式内社（名神大社）、山城国一宫、旧社格为官币大社（现神社本厅的别表神社）。主祭神为玉依姬命与贺茂建角身命。例祭日设在5月15日（贺茂祭、葵祭）。现任宫司为新木直人。\n贺茂御祖神社是联合国科教文组织所登记的世界文化遗产之一，是遗产项目古都京都的文化财的其中一部分。', 1, 1, 0, '2021-12-08 09:53:52.178276', '2021-12-08 09:53:52.527270', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (845, '出町枡形商店街', '日本京都府京都市上京区青龙町229', 35.0302802, 135.7688117, '出町桝形商店街是位于京都市上京区出町柳的一条商店街。开设有众多食品店、餐饮店等，是一条服务于地区的商店街。在动画《有顶天家族》中频繁出现，也是《玉子市场》中兔子山商店街的原型。', 1, 1, 0, '2021-12-08 09:53:54.826381', '2021-12-08 09:53:55.166475', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (846, '上京区蔬果店', '日本京都府京都市上京区三荣町59', 35.0305569, 135.7684234, '', 1, 1, 0, '2021-12-08 09:53:57.255238', '2021-12-08 09:53:57.596500', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (847, '山富', '日本京都府京都市中京区先斗町四条上锅屋町226', 35.0051823, 135.7711948, '京都先斗町一家以锅物炸串为主题的特色料理，夏季会搭出纳凉床临与鸭川之上。', 1, 1, 0, '2021-12-08 09:54:01.047641', '2021-12-08 09:54:01.389183', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (848, '怀旧酒吧', '日本京都府京都市中京区下丸屋町格林波特兰大厦B1F', 35.0099939, 135.7688016, '', 1, 1, 0, '2021-12-08 09:54:04.457921', '2021-12-08 09:54:04.811563', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (849, '京都南座', '日本京都市东山区四条通大和大路西入中之町198', 35.003486, 135.772336, '南座是京都重要的一处歌舞伎剧场，与江户时代1615-1623年间建立在四条地区。现在的南座建筑建于1929年，有1086个座位。', 1, 1, 0, '2021-12-08 09:54:07.013243', '2021-12-08 09:54:07.353449', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (850, '梵梵咖啡', '日本京都府京都市上京区梶井町今出川通河原町东入447', 35.0292274, 135.7705692, '京都中北部地区人气颇高的咖啡轻食餐厅。', 1, 1, 0, '2021-12-08 09:54:09.541554', '2021-12-08 09:54:09.883577', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (851, '夷川发电厂', '日本京都府京都市左京区圣护院莲华蔵町３６', 35.0157922, 135.7750436, '关西电力公司的发电厂，也是京都市内一处赏樱名所。', 1, 1, 0, '2021-12-08 09:54:11.709507', '2021-12-08 09:54:12.051262', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (852, '八坂神社', '日本京都府京都市东山区祇园町北侧625', 35.0036559, 135.7785534, '八坂神社，日本全国约有3,000多间，其位于京都的是八坂神社之总本社，因位于祇园，于是又名祇园神社（祇園さん）。总本社位于日本京都府京都市东山区的神社。为二十二社，旧社格为官币大社（现神社本厅的别表神社）。\n总本社祇园祭为日本最大的祭典之一，也是在京都香火最旺的神社之一。\n总本社建于公元656年，祇园神社祭祀日本神话中的素戋呜尊、奇稻田姫命、八柱神子神，其能剧舞台上展演素戋呜尊砍大蛇的戏码。', 1, 1, 0, '2021-12-08 09:54:14.500508', '2021-12-08 09:54:14.850908', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (853, '道具复古杂货店', '日本京都府京都市东山区进之町', 35.0080278, 135.777815, '', 1, 1, 0, '2021-12-08 09:54:16.187489', '2021-12-08 09:54:16.533130', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (854, '东大路通桥', '日本京都府京都市左京区冈崎德成町', 35.015613, 135.778375, '', 1, 1, 0, '2021-12-08 09:54:17.469485', '2021-12-08 09:54:17.811541', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (855, '秋月桥', '日本京都府京都市左京区圣护院莲华蔵町５１番地１', 35.015592, 135.774256, '', 1, 1, 0, '2021-12-08 09:54:18.276836', '2021-12-08 09:54:18.622593', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (856, '鸭川三角洲', '日本京都府京都市上京区出柳町', 35.0298717, 135.7717437, '鸭川三角洲并非地理学意义上的三角洲，而是来自贺茂川及高野川的河水自京都北方顺流而下，汇聚于出町柳形成的一处河流交汇口。这里景色优美，有可以渡河的飞石。', 1, 1, 0, '2021-12-08 09:54:20.704720', '2021-12-08 09:54:21.045223', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (857, '白竹堂', '日本京都府京都市中京区白壁町六角上白壁町448', 35.007632, 135.765548, '创业于1718年，有着悠久历史的扇子专营店。', 1, 1, 0, '2021-12-08 09:54:22.727360', '2021-12-08 09:54:23.069500', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (858, '四条乌丸路口', '日本京都府京都市下京区水銀屋町四条大街与乌丸大街路口', 35.00368546, 135.75992319, '', 1, 1, 0, '2021-12-08 09:54:25.767501', '2021-12-08 09:54:26.124174', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (859, '如意岳', '日本京都府京都市左京区鹿谷菖蒲谷町', 35.016667, 135.816667, '如意岳（如意ヶ嶽，にょいがたけ）是位于日本京都东山的一座山峰。标高472米。山顶是京都市左京区粟田口如意岳町。也有如意峰（如意ヶ峰，にょいがみね）、如意山（にょいやま）等其他称呼。如意岳也是京都市左京区和滋贺县大津市的交界点。自鹿谷经池之谷地藏和园城寺的山道被称为“如意越”（にょいごえ），是连接京都和近江近道。山中在过去有大规模的山岳寺院如意寺（にょいじ）。\n支峰（西峰）标高465.4米，也称大文字山（だいもんじやま），是每年在8月16日举行的京都传统行事之一五山送火中的大文字。在大文字山的山上科眺望京都市内，也是颇具人气的郊游景点。', 1, 1, 0, '2021-12-08 09:54:28.079253', '2021-12-08 09:54:28.425278', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (860, '爱宕神社', '日本京都府京都市右京区嵯峨爱宕町', 35.059896, 135.634444, '爱宕神社（あたごじんじゃ）是位在日本京都府京都市右京区爱宕山山顶的神社。旧社格为府社（现神社本厅的别表神社）。是日本全国约900座爱宕神社之总本社，旧称是阿多古神社、通称是愛宕さん。\n古来知名的火伏・防火之神社，“火廼要慎”（ひのようじん）的火伏札相当有名。', 1, 1, 0, '2021-12-08 09:54:30.426515', '2021-12-08 09:54:30.771470', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (861, '福寿稻荷神社', '日本京都府福知山市厚东町', 35.6649134, 139.7484332, '', 1, 1, 0, '2021-12-08 09:54:33.285457', '2021-12-08 09:54:33.627176', 44, 1, '福知山市');
INSERT INTO `tb_places` VALUES (862, '红叶咖啡', '日本京都府京都市中京区先斗町四条上锅屋232', 35.004806, 135.771146, '', 1, 1, 0, '2021-12-08 09:54:35.188403', '2021-12-08 09:54:35.533886', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (863, '大丸京都店', '日本京都府京都市下京区西鱼屋町高仓西入立买西町79番地', 35.0044751, 135.7617874, '大丸是J.Front Retailing集团的百货店屋号。2010年2月28日以前由株式会社大丸营运。 作为发源自近畿的老牌百货店，大阪、京都、神户、东京、札幌为主力店铺，此6分店占据其营收的91%。上述主力店现在由株式会社大丸松坂屋百货店营运。', 1, 1, 0, '2021-12-08 09:54:36.752362', '2021-12-08 09:54:37.094292', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (864, '藤井大丸前寺町通', '日本京都府京都市下京区貞安前之町', 35.00343, 135.766885, '', 1, 1, 0, '2021-12-08 09:54:40.129948', '2021-12-08 09:54:40.479330', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (865, '糖果屋古玩小铺', '日本京都府京都市下京区恵美须之町532', 35.000924, 135.766976, '古玩杂货商店。', 1, 1, 0, '2021-12-08 09:54:41.025228', '2021-12-08 09:54:41.370260', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (866, '三岛亭', '日本京都府京都市中京区樱之町', 35.00841, 135.767055, '百年历史的和式寿喜锅餐厅。', 1, 1, 0, '2021-12-08 09:54:42.422948', '2021-12-08 09:54:42.803025', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (867, '渡月桥', '日本京都府京都市嵯峨野', 35.01309965, 135.67777434, '渡月桥是一座位于日本京都府京都市，跨越桂川上的车行与人行桥梁。桥北侧的嵯峨野地区属右京区的范围，而南侧的岚山则是西京区的一部分。从北面渡过渡月桥的话，经过中之岛（嵯峨中之岛町）就会到达岚山的山脚。渡月桥周边的岚山地区是京都西郊观赏樱花和红叶的胜地，因此经常会在旅游旺季期间发生严重的交通阻塞。', 1, 1, 0, '2021-12-08 09:54:44.105004', '2021-12-08 09:54:44.448077', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (868, '鞍马汤（西阵）', '日本京都府京都市北区新御灵口町２８５−２９', 35.037768, 135.762811, '连锁公共浴室。', 1, 1, 0, '2021-12-08 09:54:46.676570', '2021-12-08 09:54:47.026967', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (869, '四条河原町', '日本京都府京都市中京区米屋町四条河原町', 35.0044866, 135.769182, '四条河原町是指位于日本京都府京都市下京区及中京区的一个十字路口，亦泛指位于这个十字路口附近的繁华街区。', 1, 1, 0, '2021-12-08 09:54:48.333851', '2021-12-08 09:54:48.677816', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (870, '天宁寺', '日本京都府京都市北区寺町通鞍马口下行', 35.037452, 135.763459, '', 1, 1, 0, '2021-12-08 09:54:50.053948', '2021-12-08 09:54:50.395341', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (871, '六角堂', '京都府京都市中京区六角通东洞院西入堂之前町', 35.007653, 135.7602521, '六角堂本名顶法寺，是位在日本京都府京都市中京区的天台宗系单立寺院。山号“紫云山”。本尊如意轮观音（秘佛）。本堂为平面六角形，因此通称“六角堂”。以华道・池坊之发祥地而出名。京都市的正中心即在此寺内，有一处特别划分的区域，被称为“京都的肚脐眼”。', 1, 1, 0, '2021-12-08 09:54:50.935458', '2021-12-08 09:54:51.276864', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (872, '京都大学', '日本京都府京都市左京区吉田本町', 35.0262444, 135.7808218, '京都大学（英语：Kyoto University，日语平假名：きょうとだいがく），简称京大（きょうだい），是一所本部位于日本京都市左京区的世界级顶尖研究型大学，在日本仅次于东京大学的学科齐全、规模宏大的国立综合大学，日本继东京大学之后设立的第二所旧制帝国大学。作为日本国内的最高学府之一，京都大学在全球都享有很高的声望，其培育出的人才和学术成果享誉世界，被誉为“科学家的摇篮”。', 1, 1, 0, '2021-12-08 09:54:54.773599', '2021-12-08 09:54:55.116201', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (873, '茑家咖啡', '日本京都府京都市中京区滕屋町东洞院通六角下御射山町260', 35.0072637, 135.7611534, '', 1, 1, 0, '2021-12-08 09:54:56.993996', '2021-12-08 09:54:57.337936', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (874, '伍迪镇咖啡厅', '日本京都府京都市左京区下鸭松ノ木町49-2', 35.039461, 135.770759, '', 1, 1, 0, '2021-12-08 09:54:58.583079', '2021-12-08 09:54:58.924853', 44, 1, '京都市');
