INSERT INTO `tb_places` VALUES (877, '寺町专门店会商店街', '日本京都府京都市中京区下本能寺前町', 35.0088537, 135.7671758, '寺町通三条到御池间段的商店街，是中京区东部都心部的商业区域。', 1, 1, 0, '2021-12-08 09:55:05.308356', '2021-12-08 09:55:05.651208', 44, 1, '京都市');
