INSERT INTO `tb_places` VALUES (880, '御幸町通路口', '日本京都府京都市下京区寺町 西入奈良物町', 35.003698, 135.766347, '', 1, 1, 0, '2021-12-08 09:55:12.816213', '2021-12-08 09:55:13.164999', 44, 1, '京都市');
INSERT INTO `tb_places` VALUES (881, '琵琶湖', '日本滋贺县东部', 35.3456394, 136.1709012, '琵琶湖位于日本滋贺县，为日本最大的湖泊；日本湖沼水质保全特别措置法指定湖泊，也列入湿地公约国际重要湿地名录中。\n琵琶湖占有滋贺县六分之一的面积，总面积670.33平方公里，湖岸长241公里，最深103.58米，平均水深41.2米 。', 1, 1, 0, '2021-12-08 09:55:13.726056', '2021-12-08 09:55:14.068829', 44, 1, '滋贺县');
INSERT INTO `tb_places` VALUES (882, '狸谷不动院', '日本京都府京都市左京区一乗寺松原町6', 35.0410376, 135.802656, '狸谷山不动院建于1718年，是京都市左京区一乘寺中真言宗修验道大本山的佛教寺院。', 1, 1, 0, '2021-12-08 09:55:19.760768', '2021-12-08 09:55:20.101517', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (883, '贺茂大桥', '日本京都府京都市上京区梶井町', 35.0289983, 135.7715984, '横跨鸭川三角洲的大桥。', 1, 1, 0, '2021-12-08 09:55:26.754310', '2021-12-08 09:55:27.097200', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (884, '下鸭神社', '日本京都府京都市左京区下鸭泉川町59', 35.0391839, 135.7730066, '贺茂御祖神社为一座位于京都市左京区的神社，被通称下鸭神社。为二十二社之一、式内社（名神大社）、山城国一宫、旧社格为官币大社（现神社本厅的别表神社）。主祭神为玉依姬命与贺茂建角身命。例祭日设在5月15日（贺茂祭、葵祭）。现任宫司为新木直人。\n贺茂御祖神社是联合国科教文组织所登记的世界文化遗产之一，是遗产项目古都京都的文化财的其中一部分。', 1, 1, 0, '2021-12-08 09:55:28.884316', '2021-12-08 09:55:29.277179', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (885, '六道珍皇寺', '日本京都府京都市東山区小松町大和大路通四条下町四丁目小松町595', 34.9983955, 135.7754641, '六道珍皇寺是位在日本京都府京都市东山区的临济宗建仁寺派寺院。山号“大椿山”。本尊药师如来、传说开基（创立者）为山代淡海。以8月7-10日的六道诣、传说小野篁通往冥界的水井（一般非公开）而广为人知。通称・六道さん、珍皇寺等。传说附近是现世和冥界的接点“六道之辻”。', 1, 1, 0, '2021-12-08 09:55:32.382818', '2021-12-08 09:55:32.726726', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (886, '如意岳', '日本京都府京都市左京区鹿谷菖蒲谷町', 35.016667, 135.816667, '如意岳（如意ヶ嶽，にょいがたけ）是位于日本京都东山的一座山峰。标高472米。山顶是京都市左京区粟田口如意岳町。也有如意峰（如意ヶ峰，にょいがみね）、如意山（にょいやま）等其他称呼。如意岳也是京都市左京区和滋贺县大津市的交界点。自鹿谷经池之谷地藏和园城寺的山道被称为“如意越”（にょいごえ），是连接京都和近江近道。山中在过去有大规模的山岳寺院如意寺（にょいじ）。\n支峰（西峰）标高465.4米，也称大文字山（だいもんじやま），是每年在8月16日举行的京都传统行事之一五山送火中的大文字。在大文字山的山上科眺望京都市内，也是颇具人气的郊游景点。', 1, 1, 0, '2021-12-08 09:55:34.688243', '2021-12-08 09:55:35.040237', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (887, '京都大仓酒店', '日本京都府京都市中京区一之船入町河原町御池', 35.0118867, 135.7693933, '中京区的连锁五星级酒店。', 1, 1, 0, '2021-12-08 09:55:37.295068', '2021-12-08 09:55:37.636354', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (888, '东华菜馆', '日本京都府京都市下京区斋藤町１４０−２', 35.0035825, 135.7710189, '京都四条大桥西段木屋町附近的一家高级北京料理店。', 1, 1, 0, '2021-12-08 09:55:38.988339', '2021-12-08 09:55:39.331231', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (889, '四条大桥', '日本京都府京都市东山区川端町', 35.0038257, 135.7715335, '', 1, 1, 0, '2021-12-08 09:55:41.393864', '2021-12-08 09:55:41.736112', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (890, '菊水餐厅', '日本京都府京都市东山区四条大桥东诘祇园', 35.004011, 135.772293, '京都老牌法式洋食餐厅。', 1, 1, 0, '2021-12-08 09:55:43.677246', '2021-12-08 09:55:44.050683', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (891, '京都南座', '日本京都市东山区四条通大和大路西入中之町198', 35.003486, 135.772336, '南座是京都重要的一处歌舞伎剧场，与江户时代1615-1623年间建立在四条地区。现在的南座建筑建于1929年，有1086个座位。', 1, 1, 0, '2021-12-08 09:55:46.381943', '2021-12-08 09:55:46.725182', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (892, '大和桥', '日本京都府京都市东山区常盤町１６４', 35.005281, 135.772926, '', 1, 1, 0, '2021-12-08 09:55:48.593489', '2021-12-08 09:55:48.935227', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (893, '美之竹咖啡', '日本京都府京都市东山区富永町130', 35.0043519, 135.7743335, '', 1, 1, 0, '2021-12-08 09:55:50.256438', '2021-12-08 09:55:50.601309', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (894, '先斗町', '日本京都府京都市中京区', 35.00498557, 135.77119066, '三条河原在幕末时期是长州藩的地盘，先斗町（ぽんとちょう）位于三条通到四条通、鸭川和木屋町通之间，是队士们常出没的花街。在司马辽太郎的小说《幕末》猿路口的血斗章节中，有说到会津藩的大庭恭平潜入攘夷志士团队后，和田中新兵卫去先斗町花街，在吉野屋门口遇到姊小路的护卫吉村右京的场景。\n先斗町原本是鸭川的沙洲，江户时代初期，因护岸工事埋立，称作新河原町通。之后发展成茶屋、旅笼等林立的繁华街，公许艺妓营业后，成为有名的花街。除了花街特有的商业形态以外，尚有一般饮食店，东侧的店面对鸭川，设有纳凉床的饮食店很多。\n微雨过后潮湿的石叠小路，两边町家建筑的居酒屋林立，木门前暖黄的纸灯笼，仿佛穿越千年，幕末时的先斗町是否也如此时般宁静，也许只是小巷中多了那些对未来怀抱梦想的武士吧。', 1, 1, 0, '2021-12-08 09:55:51.021885', '2021-12-08 09:55:51.364360', 45, 1, '京都府');
INSERT INTO `tb_places` VALUES (895, '鸭川', '日本京都府京都市', 35.01014903, 135.771799, '鸭川是代表京都一条长31公里的一级河川。这条河流的水十分清澈，流穿过京都中央。从古代起居民已经住在河流的两旁. 特别是西岸及南岸。虽然京都已不是首都但仍然有很多外国及本地游客到来游览。 祗园在鸭川的中央，四周有许多商店提供良好鸭川的景致，尤其在晚上。河流两旁有步行径及单车径，在主要的名胜景点均可以找到单车出租店。', 1, 1, 0, '2021-12-08 09:55:53.427031', '2021-12-08 09:55:53.834811', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (896, '夷川发电厂', '日本京都府京都市左京区圣护院莲华蔵町３６', 35.0157922, 135.7750436, '关西电力公司的发电厂，也是京都市内一处赏樱名所。', 1, 1, 0, '2021-12-08 09:55:55.125353', '2021-12-08 09:55:55.470270', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (897, '花见小路', '日本京都府京都市东山区祇园町南侧', 35.0036265, 135.7750364, '祇园花见小路，位于京都繁华区的祇园，大家都是冲着有舞妓或艺妓舞艺的「花街」而来。', 1, 1, 0, '2021-12-08 09:55:57.765234', '2021-12-08 09:55:58.108493', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (898, '三岛亭', '日本京都府京都市中京区樱之町', 35.00841, 135.767055, '百年历史的和式寿喜锅餐厅。', 1, 1, 0, '2021-12-08 09:55:59.859625', '2021-12-08 09:56:00.203433', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (899, '四条河原町', '日本京都府京都市中京区米屋町四条河原町', 35.0044866, 135.769182, '四条河原町是指位于日本京都府京都市下京区及中京区的一个十字路口，亦泛指位于这个十字路口附近的繁华街区。', 1, 1, 0, '2021-12-08 09:56:01.162508', '2021-12-08 09:56:01.504941', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (900, '四条乌丸路口', '日本京都府京都市下京区水銀屋町四条大街与乌丸大街路口', 35.00368546, 135.75992319, '', 1, 1, 0, '2021-12-08 09:56:02.624778', '2021-12-08 09:56:02.967459', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (901, '京都塔', '日本京都府京都市下京区', 34.9874767, 135.7594926, '京都塔是由隶属于京阪电气铁道集团的京都塔股份有限公司（京都タワー株式会社）维护营运，包括作为塔基的“京都塔大楼”（京都タワービル）在内，总高131米。\n京都塔的造型由建筑师山田守操刀，结构部分则是由京都大学工学部建筑学教室负责，于1964年（昭和39年）12月28日启用，施工期约1年10个月。虽然京都市本身并不临海，但京都塔却很独特地采用了灯塔的造型作为外观主题。在京都塔建成的那个时代，大部分的塔状建筑都是采钢骨桁架结构（例如巴黎的埃菲尔铁塔），但京都塔却很独特地采用了封闭式的设计，以厚度介于12至22毫米之间的特殊钢板制作成的圆筒熔接而成，本体高100米、重量约800吨的塔身之内完全没有受力结构，是日本最早的外墙承重结构（応力外被構造）建筑之一。考量到日本地处地震带上，也是台风盛行的地区，因此京都塔在设计时，使用了比一般建筑物高出一倍的安全系数，并安然度过风速高达50米/秒的台风与阪神大地震洗礼。', 1, 1, 0, '2021-12-08 09:56:04.417135', '2021-12-08 09:56:04.759582', 45, 1, '京都市');
INSERT INTO `tb_places` VALUES (902, '糖果屋古玩小铺', '日本京都府京都市下京区恵美须之町532', 35.000924, 135.766976, '古玩杂货商店。', 1, 1, 0, '2021-12-08 09:56:06.105726', '2021-12-08 09:56:06.447760', 45, 1, '京都市');
