INSERT INTO `tb_places` VALUES (905, '京都市动物园', '日本京都府京都市左京区岡崎法勝寺町', 35.0126853, 135.7861113, '京都市动物园是一座位于京都府京都市京都市左京区冈崎的市立动物园。附近有平安神宫、南禅寺、京都会馆、京都市美术馆等文化设施。京都市动物园在动物繁殖上颇为用心，多次创下日本首次繁殖的成功记录。现在京都市动物园计划改建，目标在2016年完成。', 1, 1, 0, '2021-12-08 09:56:11.542114', '2021-12-08 09:56:11.885346', 45, 1, '京都市');
