INSERT INTO `tb_places` VALUES (949, '稻村崎海岸', '日本神奈川县镰仓市稻村崎２丁目', 35.302702, 139.523156, '‍‍自古以产铁闻名的稻村崎砂是近乎黑的灰，被浪潮打湿后在阳光下闪闪发亮。据说这里的地名是因为这块地方看起来像是层层叠叠的稻穗，这里出产铁砂，在更早的奈良时代，这里则被称作「见越之崎（见越しの崎）」或是「御舆之崎（御舆の崎）」、「神舆之崎（神舆の崎）」。‍‍', 1, 1, 0, '2021-12-08 10:29:54.593255', '2021-12-08 10:29:54.846348', 47, 1, '镰仓市');
