INSERT INTO `tb_places` VALUES (956, '东京国际机场', '', 35.5493932, 139.7798386, '东京国际机场是位于日本东京都大田区的机场，因座落于羽田地区而通称为羽田机场，与成田国际机场并列为东京两座联外机场。启用于1931年8月25日，以营运国内航线为主、兼营中短程与深夜长程的国际航线。根据日本《空港整备法》，该机场被分为第一种机场。', 1, 1, 0, '2021-12-08 10:30:22.623815', '2021-12-08 10:30:22.877380', 49, 1, '东京都');
INSERT INTO `tb_places` VALUES (957, '高冈市民医院', '〒933-8550 富山県高岡市宝町４−番１号', 36.7561006, 137.0286257, '高冈市民医院是位于日本富山县高冈市的核心医院，创办于1951年。', 1, 1, 0, '2021-12-08 10:30:29.121868', '2021-12-08 10:30:29.374577', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (958, '足羽川樱花路', '〒918-8008 福井県福井市有楽町１０−20', 36.063116, 136.2051379, '足羽川樱花路即足羽川观光步道，是指位于流经日本福井县福井市足羽川两岸的林荫道，号称“日本第一樱花路”，全长约2.2公里，种满樱花树，每到花季，绵延数里粉嫩唯美。', 1, 1, 0, '2021-12-08 10:30:36.161107', '2021-12-08 10:30:36.415045', 50, 1, '福井市');
INSERT INTO `tb_places` VALUES (959, '幸桥', '〒910-0003 福井県福井市松本４丁目１９−10 サーパス松本フェニックス通り', 36.06062326, 136.21632162, '幸桥是日本福井县福井市的一座桥梁，与著名的足羽川樱花路相邻，每年樱花季，这里也是最佳观赏点之一。', 1, 1, 0, '2021-12-08 10:30:40.409864', '2021-12-08 10:30:40.663146', 50, 1, '福井市');
INSERT INTO `tb_places` VALUES (960, '高冈站前', '〒933-0021 富山県高岡市下関町', 36.74288672, 137.01604602, '高冈站前是位于日本富山县高冈市车站前的路口区域。', 1, 1, 0, '2021-12-08 10:30:43.728725', '2021-12-08 10:30:43.991015', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (961, '雨晴海岸海水浴场', '〒933-0133 富山県高岡市松田江長浜', 36.814949, 137.0418846, '雨晴海岸海水浴场位于日本富山县高冈市北部，所属的雨晴海岸是日本百佳海滨之一。', 1, 1, 0, '2021-12-08 10:30:45.689481', '2021-12-08 10:30:45.950881', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (962, '松太枝滨海水浴场', '〒933-0133 富山県高岡市太田675', 36.8243168, 137.024126, '松太枝滨海水浴场位于日本拥有百佳海滨美誉的雨晴海岸，长达约100米左右。', 1, 1, 0, '2021-12-08 10:30:50.933610', '2021-12-08 10:30:51.189675', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (963, '博多站', '日本福冈县福冈市博多区博多站中央街１−１', 33.5900449, 130.4206105, '博多站是九州旅客铁道、西日本旅客铁道及福冈市交通局的一座铁路车站，位于福冈县福冈市博多区博多站中央街。', 1, 1, 0, '2021-12-08 10:30:54.256704', '2021-12-08 10:30:54.516335', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (964, '福冈塔', '〒814-0001 福岡県福岡市早良区百道浜２丁目３−26', 33.59336503, 130.35152609, '福冈塔是日本最高的海滨塔，也是仅次于东京天空树东京塔的第三高塔，兴建于1989年，为亚洲太平洋博览会的纪念建筑。', 1, 1, 0, '2021-12-08 10:30:56.228729', '2021-12-08 10:30:56.480384', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (965, '优衣库博多运河城店', '〒812-0038 福岡県福岡市博多区祇園町９−2', 33.59031161, 130.41204823, '优衣库博多运河城店是该品牌在日本九州最大的分店之一，提供部分限定商品。', 1, 1, 0, '2021-12-08 10:30:58.802569', '2021-12-08 10:30:59.072144', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (966, '太宰府天满宫', '〒818-0117 福岡県太宰府市宰府４丁目７−1', 33.5208706, 130.5345671, '太宰府天满宫是位于日本福冈的一座神社，始建于延喜19年（919年），距今已有千年历史，祭祀平安时代的学问家菅原道真，在日本誉为「学问之神」与「书法之神」。社格为官币中社。和北野天满宫同为日本全国天满宫之总本社、天神信仰的中心。', 1, 1, 0, '2021-12-08 10:31:01.541153', '2021-12-08 10:31:01.799036', 50, 1, '太宰府市');
INSERT INTO `tb_places` VALUES (967, '新天町商业街', '〒810-0001 福岡県福岡市中央区天神２丁目９', 33.5902187, 130.3978682, '新天町是日本福冈“天神”的第一繁华商业街，创办于1946年，老字号、时尚潮牌一应俱全，是当地的人气景点之一。', 1, 1, 0, '2021-12-08 10:31:03.825019', '2021-12-08 10:31:04.098309', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (968, '中洲大排档', '〒810-0801 福岡県福岡市博多区中洲１丁目８', 33.59013732, 130.40865827, '中洲大排档是日本福冈知名的餐饮夜市，号称全日本有40%的大排档在此做生意，每当夜幕降临，传统车档便会沿河排开，贩售拉面、烧烤、酒肆等各类经典日式美食，食客们络绎不绝，现场热闹非凡。', 1, 1, 0, '2021-12-08 10:31:06.099430', '2021-12-08 10:31:06.352000', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (969, '红月牛肠锅大名店', '〒810-0041 福岡県福岡市中央区大名１丁目９−14 シティマンション別館 1階', 33.587115, 130.392455, '红月牛肠锅是日本福冈著名的餐厅，大名店是其两家分店之一，以当地特色的牛肠锅（内脏锅）而著称。', 1, 1, 0, '2021-12-08 10:31:07.204351', '2021-12-08 10:31:07.466923', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (970, '福冈海鹰希尔顿酒店', '〒810-8650 福岡県福岡市中央区地行浜２丁目２−3', 33.5949506, 130.35964314, '福冈海鹰希尔顿酒店位于日本福冈市，毗邻福冈巨蛋体育馆，1995年开业。', 1, 1, 0, '2021-12-08 10:31:10.358231', '2021-12-08 10:31:10.615877', 50, 1, '福冈市');
INSERT INTO `tb_places` VALUES (971, '能町站', '〒933-0003 富山県高岡市能町', 36.7688088, 137.04017456, '能町站位于日本富山县高冈市，是JR西日本及JR货物线路车站。', 1, 1, 0, '2021-12-08 10:31:17.689645', '2021-12-08 10:31:17.949707', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (972, '越中守山城遗迹', '〒933-0987 富山県高岡市東海老坂', 36.787183, 137.0093941, '越中守山城遗迹位于日本富山县高冈市，又叫二上城、海老坂城，是一处古城遗迹。', 1, 1, 0, '2021-12-08 10:31:21.446908', '2021-12-08 10:31:21.698077', 50, 1, '高冈市');
INSERT INTO `tb_places` VALUES (973, 'JR东京综合医院', '〒151-8528 東京都渋谷区代々木２丁目１−3', 35.68545663, 139.70003359, 'JR东京综合医院位于东京色骨气，由东日本铁路公司（JR East）经营，1927年作为铁路医院开设，以骨科及外科著称。', 1, 1, 0, '2021-12-08 10:31:32.912359', '2021-12-08 10:31:33.172335', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (974, '7-11代代木站北口店', '〒151-0053 東京都渋谷区代々木１丁目３６−1', 35.68430431, 139.70126118, '靠近代代木站北口的7-11便利店。', 1, 1, 0, '2021-12-08 10:31:39.745330', '2021-12-08 10:31:40.004524', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (975, '代代木会馆', '〒151-0053 東京都渋谷区代々木１丁目３５−1 代々木会館', 35.68344834, 139.70182038, '代代木会馆建于1969年，有东京代代木的“九龙城寨”之称，是一幢商用建筑，入驻了居酒屋、中国书店和常备寿司店等。2019年因年久失修开始拆卸工程，于2020年1月被完全拆除。1974年播出的电视剧《天使与划痕》曾以此为背景，亦是2019年上映的新海诚动画《天气之子》重要取景地。', 1, 1, 0, '2021-12-08 10:31:40.597909', '2021-12-08 10:31:40.852638', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (976, '彩虹大桥', '', 35.636533, 139.763159, '彩虹大桥是日本首都东京一条横越东京湾北部，连接港区芝浦及台场的吊桥，正式名称为东京港联络桥，于1993年落成。两座支撑大桥的桥塔使用白色设计，令彩虹大桥与附近的景色和谐共融。在悬索桥面的缆上置有红、白、绿3色灯泡，采用日间收集得来的太阳能作能源，在晚上点缀彩虹桥。走在彩虹大桥上的游歩道，则能够远眺漂浮在蓝色海洋上的客船和临海副都心的夜景，是情侣们晚上约会的好去处。许多日本影视剧如《恋爱世纪》、《大搜查2》都在此取景拍摄。', 1, 1, 0, '2021-12-08 10:31:58.924376', '2021-12-08 10:31:59.176185', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (977, '竹芝码头', '〒105-0022 東京都港区海岸１丁目１２', 35.65456065, 139.76289472, '竹芝码头是东京港区旅客码头之一，1934年启用，是东京-神津岛航线停靠站。', 1, 1, 0, '2021-12-08 10:32:01.857121', '2021-12-08 10:32:02.116367', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (978, '歌舞伎町一番街', '〒160-0021 東京都新宿区歌舞伎町１丁目', 35.69438008, 139.70120747, '歌舞伎町一番街有着“日本第一欢乐街”之称，集中了大小无数的餐馆、酒吧、俱乐部、歌厅、影院、剧院以及风俗营业场所，是日本知名观光景点。', 1, 1, 0, '2021-12-08 10:32:08.528361', '2021-12-08 10:32:08.783855', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (979, '漫博新宿靖国道路店', '〒160-0022 東京都新宿区新宿3-20-5 ニューサンパークビルB1F', 35.69302018, 139.70269861, '日本连锁网咖，位于新宿的这家分店因新海诚作品《天气之子》声名大噪，提供阅读漫画、杂志、观看动画等，也提供便宜的过夜住宿服务。', 1, 1, 0, '2021-12-08 10:32:13.888154', '2021-12-08 10:32:14.145989', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (980, '新宿Alta', '〒160-0022 東京都新宿区新宿３丁目２４−3', 35.6926761, 139.70118917, '新宿Alta是日本东京潮流地标之一，亦因7楼的剧场成为追星胜地，大楼建于1980年，地上8层，地下3层。', 1, 1, 0, '2021-12-08 10:32:19.316268', '2021-12-08 10:32:19.570462', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (981, '新宿站', '日本东京都新宿区新宿3丁目38', 35.68940025, 139.70054448, '新宿站是日本东京新宿最主要的铁路车站，整个站区横跨东京都的新宿区与涩谷区，使用之铁路业者包括东日本旅客铁道（JR东日本）、小田急电铁、京王电铁、东京地铁及都营地铁等。其每日使用人次（以出入闸人次计算），JR路线为157万，属日本第1位；各铁路业者总和则达每日364万人次，是世界上使用人次最多的铁路车站。', 1, 1, 0, '2021-12-08 10:32:20.793218', '2021-12-08 10:32:21.053100', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (982, '天下一品歌舞伎町店', '〒160-0021 東京都新宿区１４ 歌舞伎町１丁目１４−３ 第１０３東京ビル １・２Ｆ', 35.69441342, 139.7018849, '日本知名连锁拉面店，歌舞伎町店是分店之一。', 1, 1, 0, '2021-12-08 10:32:25.226458', '2021-12-08 10:32:25.478538', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (983, '阿塔米大厦', '日本东京都新宿区歌舞伎町2-27-8', 35.69597424, 139.70307469, '位于日本东京新宿歌舞伎町的商务大楼，楼内多为贷款、风月场所、酒吧等。', 1, 1, 0, '2021-12-08 10:32:27.410350', '2021-12-08 10:32:27.661292', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (984, '麦当劳西武新宿站前店', '〒160-0021 東京都新宿区歌舞伎町１丁目２４−1', 35.69420709, 139.70062571, '位于日本东京西五新宿站附近，因是新海诚动画《天气之子》的主要取景地之一，成为知名圣地巡礼打卡地。', 1, 1, 0, '2021-12-08 10:32:39.238910', '2021-12-08 10:32:39.491316', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (985, '新宿一丁目北（东行）公交站', '〒160-0022 東京都新宿区新宿５丁目３', 35.69157167, 139.71110663, '这里是新宿一丁目东行方向的公交站。', 1, 1, 0, '2021-12-08 10:32:48.314226', '2021-12-08 10:32:48.571015', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (986, '曙桥东行公交站', '〒162-0065 東京都新宿区住吉町６ 曙橋（バス）', 35.6925118, 139.72189917, '这里是位于日本东京都新宿区的一个公交站，途径线路为白61。', 1, 1, 0, '2021-12-08 10:32:49.300650', '2021-12-08 10:32:49.553317', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (987, '赤城坂', '〒162-0817 東京都新宿区赤城元町', 35.70459851, 139.7356484, '位于东京新宿区赤城神社附近的街道。', 1, 1, 0, '2021-12-08 10:32:50.899911', '2021-12-08 10:32:51.154041', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (988, '阿美横丁', '', 35.70867193, 139.77477965, '东京著名露天集市之一，位于日本东京台东区山手线上野至御徒町间高架路段的下方及西侧道路，长400米，也叫阿美横站前高架下商店街，不仅售卖糖果、海产、干货等食物，也贩售衣饰、钟表、化妆品、日本土产等，除了本地居民光顾之外，也成为外国观光客造访的景点。', 1, 1, 0, '2021-12-08 10:32:54.388942', '2021-12-08 10:32:54.648633', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (989, '八官神社', '〒104-0061 東京都中央区銀座８丁目４−5', 35.66924162, 139.76025963, '位于日本东京银座，是一座非常小的神社。', 1, 1, 0, '2021-12-08 10:32:57.653259', '2021-12-08 10:32:57.910203', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (990, '涩谷保育园', '〒150-0001 東京都渋谷区神宮前３丁目１８−33', 35.670899, 139.70919705, '涩谷保育园是日本东京涩谷区的区立托儿所，1949年成立。', 1, 1, 0, '2021-12-08 10:32:58.890566', '2021-12-08 10:32:59.432804', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (991, '越中岛公园', '〒135-0044 東京都江東区越中島１丁目３−1', 35.66910576, 139.78918961, '越中岛公园是位于东京中央区的河滨公园，环境优美，尤以夜景著称，亦受跑步爱好者欢迎。', 1, 1, 0, '2021-12-08 10:33:00.671433', '2021-12-08 10:33:00.934509', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (992, '国立竞技场', '〒160-0013 東京都新宿区霞ヶ丘町１０−1', 35.67786905, 139.71456826, '新国立竞技场也叫国立竞技场，是位于日本东京霞丘的体育场，坐落于明治神宫外苑的西北侧，系由国立霞丘陆上竞技场重建而来，2016年12月11日动工，2019年11月30日完工启用。该体育场是东京都心最大的综合型运动场地，预定为2020年夏季奥林匹克运动会及2020年夏季残疾人奥林匹克运动会的主场馆，将在此举办开闭幕式、以及数个比赛项目。', 1, 1, 0, '2021-12-08 10:33:02.141451', '2021-12-08 10:33:02.400393', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (993, '花道街', '〒160-0021 東京都新宿区歌舞伎町１丁目', 35.69610494, 139.70141332, '日本东京歌舞伎町著名街道之一。', 1, 1, 0, '2021-12-08 10:33:04.753110', '2021-12-08 10:33:05.018686', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (994, 'Ecolo歌舞伎町20号停车场', '〒160-0021 東京都新宿区歌舞伎町２丁目９−１７', 35.69545344, 139.70546568, '由Ecolo株式会社管理，位于日本东京歌舞伎町的收费停车场。', 1, 1, 0, '2021-12-08 10:33:11.746989', '2021-12-08 10:33:12.001512', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (995, '塞利奥酒店', '〒160-0021 東京都新宿区歌舞伎町２丁目１５−13', 35.69712007, 139.70576674, '位于日本东京歌舞伎町的酒店，因曾在新海诚作品《天气之子》里出镜而走红。', 1, 1, 0, '2021-12-08 10:33:13.104187', '2021-12-08 10:33:13.371304', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (996, '银座三越', '〒104-8212 東京都中央区銀座４丁目６−16', 35.67131491, 139.76573582, '银座三越于1930年开业，是日本东京知名百货商店。', 1, 1, 0, '2021-12-08 10:33:20.626049', '2021-12-08 10:33:20.877940', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (997, '田端站南口小径', '〒114-0013 東京都北区東田端１丁目１７', 35.7366602, 139.76210937, '这里是位于日本东京田端站南口的一条山坡小径，因成为动画《天气之子》取景素材而声名大噪，也被粉丝称作“阳菜家前山坡”。', 1, 1, 0, '2021-12-08 10:33:26.908499', '2021-12-08 10:33:27.162309', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (998, '御台场海滨公园', '日本东京都港区台场１丁目４', 35.6307921, 139.7760889, '御台场海滨公园（お台場海浜公園）是位于东京都港区台场，由旧防波堤与台场公园所围绕的海滨公园。近邻潮风公园、台场公园。\n过去为贮木场，昭和40年代开始进行公园整备，平成8年（1996年）开园。由东京都港湾局管辖，现在交由指定管理者委托管理。\n设施包括人工沙滩、展望台、船艇设施，设有淋浴间与更衣室的水上活动中心，是靠近都心的休憩场所。矶滨区开放钓鱼。海滨区为免费开放，可采集贝壳，禁止游泳与钓鱼。\n此地可见彩虹大桥、东京都心的夜景，包括《大搜查线系列》与《下北SUNDAYS》等电视剧都曾在此拍摄。', 1, 1, 0, '2021-12-08 10:33:44.438358', '2021-12-08 10:33:44.695420', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (999, '涩谷站前十字路口', '', 35.659495, 139.700564, '涩谷站前十字路口（Shibuya Crossing）旁是著名的八公铜像（Hachiko Statue） ，它是目前世界上最大的十字路口，其一天通过的行人量多达50万，高峰时会有3000人同时通过马路。此十字路口是采用行人交通灯信号一齐变绿的“全向十字路口”方式——随着行人交通灯信号变绿，数以百计、千计的人一边互相闪避一便过马路，形成一个令人惊讶的场面；接着行人交通灯信号变红后，又好像什么事都没有发生过，车辆顺畅地行驶。涉谷站前交叉口行色匆匆的大量行人和变换无常的交通灯、周遭的高楼大厦等景象成了大都市东京一个最为著名的意象，也成了许多外国游客列入参观的景点之一。', 1, 1, 0, '2021-12-08 10:33:50.676317', '2021-12-08 10:33:50.941609', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1000, '象征长廊公园', '〒135-0064 東京都江東区青海１丁目３', 35.6255761, 139.77859813, '1996年开园，位于日本东京都港区台场，是一个狭长的都市公园，总长4公里。', 1, 1, 0, '2021-12-08 10:33:51.579028', '2021-12-08 10:33:51.831180', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1001, '东京台场摩天轮', '日本东京都江东区青海１丁目３−10', 35.6263508, 139.7822325, '调色板城大摩天轮是位于东京都江东区台场的一座摩天轮，高115米，直径100米，16分钟一圈，夜间灯光有超过100种色彩。1999年开始营业时曾是世界上最高的摩天轮，现在则是日本第三高摩天轮，仅次于钻石与花大摩天轮和红马摩天轮。', 1, 1, 0, '2021-12-08 10:33:54.755459', '2021-12-08 10:33:55.008686', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1002, '永代桥', '〒135-0034 東京都都江東区中央区永代１丁目新川1', 35.67632039, 139.78751874, '永代桥位于日本东京隅田川，建于1923年，每当日落，桥体开启蓝白灯光，成为一道靓丽风景。', 1, 1, 0, '2021-12-08 10:33:57.002317', '2021-12-08 10:33:57.255783', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1003, '江户时代的永代桥西端', '〒103-0015 東京都中央区日本橋箱崎町１９', 35.6775993, 139.7871325, '江户时代的永代桥西端是位于日本东京的一处遗址，位于现在的永代桥北侧，为其前身在江户时代所建位置，现为休闲公园。', 1, 1, 0, '2021-12-08 10:33:59.018141', '2021-12-08 10:33:59.270298', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1004, '东京竞马场', '〒183-0024 東京都府中市日吉町１−1', 35.664676, 139.48461753, '东京竞马场也叫府中竞马场，位于日本东京都府中市，是日本中央竞马会辖下中央竞马场之一。当没有赛事举行的日子，竞马博物馆会开放公众参观。马场设有13,750个座位，可容纳223,000名观众。', 1, 1, 0, '2021-12-08 10:34:01.039611', '2021-12-08 10:34:01.292858', 51, 1, '府中市');
INSERT INTO `tb_places` VALUES (1005, '都厅街', '〒160-0023 東京都新宿区西新宿２丁目都庁通り', 35.68841867, 139.69261327, '日本东京都新宿区主干道之一，是东京都厅所在地。', 1, 1, 0, '2021-12-08 10:34:03.155623', '2021-12-08 10:34:03.409103', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1006, '偷窥坂', '〒171-0033 東京都豊島区高田２丁目１２−21', 35.71763466, 139.71389405, '偷窥坂是位于日本东京都丰岛区的一条斜坡道路，最大坡度达到13度（23%），是东京能通行车辆的道路中最陡之一。', 1, 1, 0, '2021-12-08 10:34:04.582728', '2021-12-08 10:34:04.834086', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1007, '东京临海广域防灾公园', '〒135-0063 東京都江東区有明３丁目８−35', 35.63497138, 139.79629112, '东京临海广域防灾公园是日本东京一座以防灾救灾为主要功设计的公园，平日里对公众开放，供学习防灾知识、演戏等，如遇灾害时期，可变成指挥部使用。', 1, 1, 0, '2021-12-08 10:34:06.165079', '2021-12-08 10:34:06.418362', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1008, '雷门', '〒111-0032 東京都台東区浅草２丁目３−1', 35.71113081, 139.79636903, '雷门是日本东京地标景点，浅草寺表参道的入口，切妻造八脚门，左面的是风神像，右面的是雷神像，正式名称为“风雷神门”，庆应元年（1865年）被烧毁、1960年（昭和35年）、约1世纪之后以钢筋混凝土再重建。门内置有实业家松下幸之助于浅草观音祈愿之后病愈，作为报答而寄赠的大灯笼。', 1, 1, 0, '2021-12-08 10:34:08.421933', '2021-12-08 10:34:08.673956', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1009, '神宫外苑银杏大道', '日本东京都港区北青山２丁目１ 都道414号线', 35.674403, 139.719732, '由青山通至圣德纪念绘画馆之间长300米的大道，种植了并列的银杏树。每年的11月中旬树叶开始变色，于11月下旬至12月初时，整片银杏树转为金黄色，为东京著名秋景之一。这些银杏于外苑完成时种植，营建负责人为藤井真透。', 1, 1, 0, '2021-12-08 10:34:09.787012', '2021-12-08 10:34:10.042105', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1010, '秩父宫橄榄球场', '〒107-0061 東京都港区北青山２丁目８−35', 35.67263637, 139.7183375, '上记国立霞丘竞技场的设施之一。从国际赛事到青少年竞赛，广泛地举办各阶级的橄榄球赛。', 1, 1, 0, '2021-12-08 10:34:12.271120', '2021-12-08 10:34:12.575681', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1011, '六本木新城 森大厦', '日本东京都港区六本木6-10-1', 35.66046397, 139.72924867, '日本六本木森大厦，大厦高238.1米，建筑面积380105平米。上海环球金融中心高度492米（两倍于森大厦）但是建筑面积381600平方米，可想而知森大厦有多么“粗”了。这是世界上最粗的大厦，也是目前东京第五高楼。\n\n2003年建成的六本木(Roppongi Hills)，是按照下个世纪理想东京风貌而建的社区，这个占地接近十二公顷的新地标，筹划了十七年、耗资近一百七十亿港元兴建的六本木，已被东京本地人视为新世纪的新都市概念建筑体，其中最瞩目的是高高在上的六本木新城森大厦。\n\n位于六本木新城森大厦五十二楼的观光台(City View)，从底层乘高速电梯直达，只需四十二秒。高十一米的巨大环形玻璃窗，可让游客三百六十度观赏东京市景色，感觉犹如空中漫步。\n\n此外，十月正式开幕的“森美术馆”(Mori Arts Center)，座落于大楼的五十四楼，是全东京最“高档”的空中美术馆，开幕展览将以 \"Happiness\" 为主题，是一个糅合古典与现代美术的作品展。', 1, 1, 0, '2021-12-08 10:34:13.941648', '2021-12-08 10:34:14.195270', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1012, '神宫第二球场', '〒160-0013 東京都新宿区霞ヶ丘町３−２号', 35.67597039, 139.71623575, '建于1961年，用于全国高等学校棒球大赛东京地区预选赛或高尔夫球练习场等。', 1, 1, 0, '2021-12-08 10:34:24.177063', '2021-12-08 10:34:24.439928', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1013, '高圆寺冰川神社', '〒166-0003 東京都杉並区高円寺南４丁目４４−19', 35.70464242, 139.65120317, '高圆寺冰川神社位于日本东京杉并区，境内拥有全日唯一的气象神社。', 1, 1, 0, '2021-12-08 10:34:25.098361', '2021-12-08 10:34:25.350940', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1014, '百人町一丁目天桥', '日本東京都新宿区百人町一丁目', 35.698036, 139.698768, '位于日本东京新宿区百人町的行人天桥。', 1, 1, 0, '2021-12-08 10:34:27.730146', '2021-12-08 10:34:27.983162', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1015, '新宿大高架桥附近', '日本东京都新宿区新宿3丁目', 35.69381667, 139.69980476, '新宿大高架桥，指新宿和西新宿边境线上的青梅街道架道桥。下方是青梅街道、靖国通与小泷桥通组成的大高架桥交差点，是周边交通的要冲，夜晚人潮汹涌。\n\n新宿大高架桥有东西两个交叉路口，东侧是西新宿高楼林立的建筑群，西侧是新宿歌舞伎町聚集的欢乐街。', 1, 1, 0, '2021-12-08 10:34:32.867146', '2021-12-08 10:34:33.131006', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1016, '竖川河川敷公园', '〒136-0071 東京都江東区亀戸６丁目３３−10', 35.69405477, 139.8297205, '竖川河川敷公园位于日本东京都江东区，是一座利用高架下空间打造的体育公园，全长2.4千米，设有独木舟、室内球场亲水庭院等设施项目。', 1, 1, 0, '2021-12-08 10:34:37.651148', '2021-12-08 10:34:37.904421', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1017, 'LUMINE新宿2店', '〒160-0022 東京都新宿区新宿３丁目３８−2', 35.6894471, 139.7009797, 'LUMINE新宿是位于日本东京新宿区的百货公司，分为1店与2店，2店1987年开业，为一幢高7层的大楼。', 1, 1, 0, '2021-12-08 10:34:45.455545', '2021-12-08 10:34:45.707702', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1018, '芝公园', '日本東京都港区芝公園一・二・三・四丁目', 35.65495544, 139.7479837, '芝公园位于日本东京都港区，是都立芝公园与港区立芝公园的总称，最初的芝公园1873年开园，以增上寺为中心的绿地带（都立公园），与同在东京都内的上野恩赐公园并称的古老公园。现在的公园内有饭店、学校、图书馆等设施，与绿地和步道形成广大的公园设施。东边为港区役所，西边为东京铁塔，能看见东京铁塔正面的东侧路径是知名约会与摄影地点。', 1, 1, 0, '2021-12-08 10:34:48.828093', '2021-12-08 10:34:49.081303', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1019, '东京王子大饭店', '〒105-8560 東京都港区芝公園３丁目３−1', 35.65897072, 139.74811764, '东京王子大饭店位于日本东京都芝公园内，由西武集团的核心公司–西武铁道株式会社经营，1964年开业。', 1, 1, 0, '2021-12-08 10:35:01.407786', '2021-12-08 10:35:01.662109', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1020, '田端站', '〒114-0013 東京都北区東田端１丁目１７−2 １Ｆ_改札外アトレ田端内', 35.73815375, 139.76082345, '田端站是东日本旅客铁道（JR东日本）的铁路车站之一，位于日本东京都北区东田端一丁目，是北区最南端车站以及最东端车站。', 1, 1, 0, '2021-12-08 10:35:07.159474', '2021-12-08 10:35:07.418515', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1021, '品川站', '日本东京都港区港南2丁目高轮３丁目２６－２７', 35.6284713, 139.7387597, '品川站是位于日本东京都的一个铁路车站，为东京主要铁路转运站之一，使用路线包括东日本旅客铁道、东海旅客铁道、京滨急行电铁等。品川站部分月台的发车音乐是‘铁道唱歌’。车站虽名为“品川”，但所在地并不在品川区，而在港区。', 1, 1, 0, '2021-12-08 10:35:10.516281', '2021-12-08 10:35:10.776087', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1022, '东京国际机场', '', 35.5493932, 139.7798386, '东京国际机场是位于日本东京都大田区的机场，因座落于羽田地区而通称为羽田机场，与成田国际机场并列为东京两座联外机场。启用于1931年8月25日，以营运国内航线为主、兼营中短程与深夜长程的国际航线。根据日本《空港整备法》，该机场被分为第一种机场。', 1, 1, 0, '2021-12-08 10:35:12.371070', '2021-12-08 10:35:12.637939', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1023, '池袋北口驿APA酒店', '〒171-0014 東京都豊島区池袋２丁目４８−7', 35.7337178, 139.71133808, '日本连锁酒店之一，地处繁华的池袋区。', 1, 1, 0, '2021-12-08 10:35:13.389001', '2021-12-08 10:35:13.643286', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1024, '第一宾馆池袋店', '〒170-0013 東京都豊島区東池袋１丁目４２−8', 35.73206989, 139.7129168, '第一宾馆池袋店位于日本东京池袋区，由第一酒店集团管理经营，距离池袋站步行仅2分钟。', 1, 1, 0, '2021-12-08 10:35:15.170654', '2021-12-08 10:35:15.423789', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1025, '池袋We Road地下通道', '〒171-0022 東京都豊島区南池袋１丁目', 35.7315749, 139.71181367, 'We Road是位于日本东京池袋站西出口的一条地下通道，原先总是潮湿阴暗，后由艺术家植田志保进驻改造，在墙壁上绘制了彩色壁画，令这里焕然新生。', 1, 1, 0, '2021-12-08 10:35:17.094581', '2021-12-08 10:35:17.346906', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1026, '池袋大桥', '〒170-0014 東京都豊島区上池袋２丁目', 35.73412206, 139.71357027, '池袋大桥位于日本东京都丰岛区，架设于铁路之上，配有一条自行车及行人专用道，1966年开通。', 1, 1, 0, '2021-12-08 10:35:20.940934', '2021-12-08 10:35:21.192616', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1027, '软银池袋阳光大道店', '〒170-0013 東京都豊島区東池袋１丁目１３−6 イケブクロ・ロクマルビル', 35.72962255, 139.7148348, '日本著名电信公司软银的门店之一。', 1, 1, 0, '2021-12-08 10:35:25.289741', '2021-12-08 10:35:25.542722', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1028, '阳光60街', '〒170-0013 東京都豊島区東池袋１丁目', 35.72999135, 139.71577951, '阳光60街是日本东京丰岛区著名的商业街，沿路开设众多商场百货。', 1, 1, 0, '2021-12-08 10:35:28.870981', '2021-12-08 10:35:29.123734', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1029, '千两池', '〒100-0601 東京都神津島村字葱の場', 34.1895482, 139.12120141, '千两池位于日本东京都神津岛，被视作岛上的“绿洲”，风光秀丽，岩山峻峭，是当地知名景点。', 1, 1, 0, '2021-12-08 10:35:36.538484', '2021-12-08 10:35:36.796606', 51, 1, '神津岛村');
INSERT INTO `tb_places` VALUES (1030, '国王酒店', '〒170-0014 東京都豊島区池袋１丁目３−20', 35.73390749, 139.71269592, '位于日本东京丰岛区池袋大桥附近的酒店。', 1, 1, 0, '2021-12-08 10:35:39.583377', '2021-12-08 10:35:39.835190', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1031, '南池袋公园', '〒171-0022 東京都豊島区南池袋２丁目２２−1', 35.72793787, 139.71439736, '南池袋公园是日本东京都丰岛区立的公园，1951年开园，2011年关闭修整，2016年重新开园。', 1, 1, 0, '2021-12-08 10:35:43.341861', '2021-12-08 10:35:43.599292', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1032, '池袋警察署', '〒171-0021 東京都豊島区西池袋１丁目７−5', 35.72854934, 139.70704252, '池袋警察署是日本东京警视厅管辖的警察署之一，主要管辖东京都丰岛区池袋一带及周边的住宅区和商业街。', 1, 1, 0, '2021-12-08 10:35:45.498319', '2021-12-08 10:35:45.757263', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1033, '西池袋2丁目35', '〒171-0021 東京都豊島区西池袋２丁目３５', 35.72778578, 139.70603041, '位于日本东京丰岛区。', 1, 1, 0, '2021-12-08 10:35:48.724397', '2021-12-08 10:35:48.981008', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1034, '目白3丁目12', '〒171-0031 東京都豊島区目白３丁目１２', 35.72374052, 139.70479323, '位于日本东京都丰岛区。', 1, 1, 0, '2021-12-08 10:35:53.271514', '2021-12-08 10:35:53.525501', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1035, '目白站西楼梯', '〒171-0031 東京都豊島区目白３丁目', 35.72164393, 139.70635657, '位于日本东京丰岛区目白站西侧的一段L型楼梯街。', 1, 1, 0, '2021-12-08 10:35:59.083458', '2021-12-08 10:35:59.337955', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1036, '下落合2-14通学路', '〒161-0033 東京都新宿区下落合２丁目１４', 35.71827879, 139.7053807, '位于日本东京新宿区下落合2丁目，靠近山手线铁路的道路。', 1, 1, 0, '2021-12-08 10:36:04.214559', '2021-12-08 10:36:04.466034', 51, 1, '东京都');
INSERT INTO `tb_places` VALUES (1037, '东京都立神津高中', '〒100-0601 東京都神津島村１６２０', 34.2026085, 139.1346105, '东京都立神津高中是日本东京神津岛上唯一的高中，1972年成立，为保证学生数量，该校也录取岛外学生。', 1, 1, 0, '2021-12-08 10:36:10.015663', '2021-12-08 10:36:10.275859', 51, 1, '神津岛村');
INSERT INTO `tb_places` VALUES (1038, '遥远瞭望台', '〒100-0601 東京都神津島村', 34.20377945, 139.13372933, '位于日本东京都神津岛村，是岛上观赏日落的最佳地点。', 1, 1, 0, '2021-12-08 10:36:13.217615', '2021-12-08 10:36:13.469622', 51, 1, '神津岛村');
INSERT INTO `tb_places` VALUES (1039, '多幸湾三浦渔港', '〒100-0601 東京都神津島村字榎木が沢', 34.20078221, 139.15476048, '位于日本东京都神津岛东面，是该岛大渔港码头及避风港之一，非常用客运码头。', 1, 1, 0, '2021-12-08 10:36:16.896551', '2021-12-08 10:36:17.147134', 51, 1, '神津岛村');
INSERT INTO `tb_places` VALUES (1040, '上麻生4丁目24街区住宅', '〒215-0021 神奈川県川崎市麻生区上麻生４丁目24', 35.595137, 139.502629, '位于日本川崎市麻生区上麻生4丁目的住宅区。', 1, 1, 0, '2021-12-08 10:36:26.990026', '2021-12-08 10:36:27.241735', 52, 1, '川崎市');
INSERT INTO `tb_places` VALUES (1041, '寺尾台团地巴士站', '〒214-0005 神奈川県川崎市多摩区寺尾台２丁目', 35.62113482, 139.536146, '位于日本川崎市的一个巴士站。', 1, 1, 0, '2021-12-08 10:36:41.144838', '2021-12-08 10:36:41.396397', 52, 1, '川崎市');
INSERT INTO `tb_places` VALUES (1042, '佐野市立南中学', '〒327-0835 栃木県佐野市植下町1205', 36.29980194, 139.58222355, '日本佐野市的一所公立中学，1947年创办。', 1, 1, 0, '2021-12-08 10:36:44.732177', '2021-12-08 10:36:44.989988', 52, 1, '佐野市');
INSERT INTO `tb_places` VALUES (1043, '区营善福寺三丁目公寓10号', '〒167-0041 東京都杉並区善福寺3丁目', 35.71618621, 139.58623009, '位于日本东京都杉并区的一幢公寓住宅。', 1, 1, 0, '2021-12-08 10:36:55.878489', '2021-12-08 10:36:56.133071', 52, 1, '东京都');
