INSERT INTO `tb_places` VALUES (1045, 'Konko堂古书店', '〒166-0001 東京都杉並区阿佐谷北２丁目３８', 35.70772129, 139.63480863, '位于日本杉并区阿佐谷，是一家有名的古书店，店名来源于日文“玉石混交”，书籍涵盖音乐、文学、漫画、设计等，除古书外还有CD、DVD等影视音制品。', 1, 1, 0, '2021-12-08 10:36:57.648616', '2021-12-08 10:36:57.903845', 52, 1, '东京都');
INSERT INTO `tb_places` VALUES (1046, '观音通商店街', '〒232-0067 神奈川県横浜市南区弘明寺町', 35.42344111, 139.60010165, '位于日本横滨市南区弘明寺车站前，又叫弘明寺观音通商店街，是以开设餐饮、小商铺等为主的商业步行街。', 1, 1, 0, '2021-12-08 10:36:59.908035', '2021-12-08 10:37:00.161068', 52, 1, '横滨市');
INSERT INTO `tb_places` VALUES (1047, '上麻生3丁目15附近小路', '〒215-0021 神奈川県川崎市麻生区上麻生３丁目１５', 35.60103359, 139.50368911, '位于日本神奈川县川崎市麻生区，是上麻生3丁目15号街区与小田急多摩线铁路之间的一条通道。', 1, 1, 0, '2021-12-08 10:37:02.681253', '2021-12-08 10:37:02.934379', 52, 1, '川崎市');
INSERT INTO `tb_places` VALUES (1048, '寺家Hirasawa料理', '〒227-0031 神奈川県横浜市青葉区寺家町602', 35.56825088, 139.50376756, '位于日本横滨市青叶台的一家日料餐厅，与寺家山村相邻，环境优美。', 1, 1, 0, '2021-12-08 10:37:08.601529', '2021-12-08 10:37:08.859028', 52, 1, '横滨市');
INSERT INTO `tb_places` VALUES (1049, '鹤冈八幡宫', '日本神奈川県鎌倉市雪ノ下2-1-31', 35.32608, 139.556425, '鹤冈八幡宫（つるがおか はちまんぐう）设立在日本神奈川县镰仓市祭祀八幡神的神社。前九年战役结束以后的第二年1063年（康平六年），源赖义向山城国（京都府）石清水八幡宫提出劝请，请求在镰仓由比乡鹤冈设立八幡宫。1180年（治承四年）源赖朝入主镰仓，将神社移往现在所在地，称鹤冈若宫，八幡神成为源氏的守护神。1191年（建久二年）八幡宫失火，幕府在若宫后方的山上兴建本宫，又重修了若宫。之后，八幡神作为武门的守护而备受尊崇。', 1, 1, 0, '2021-12-08 10:37:12.287948', '2021-12-08 10:37:12.540965', 52, 1, '镰仓市');
INSERT INTO `tb_places` VALUES (1050, '若宫大路', '〒248-0005 神奈川県鎌倉市若宮大路', 35.32118898, 139.55342687, '位于日本神奈川县镰仓市，通往鹤冈八幡宫的参道，也是镰仓市主干道之一。', 1, 1, 0, '2021-12-08 10:37:14.435803', '2021-12-08 10:37:14.690461', 52, 1, '镰仓市');
