INSERT INTO `tb_places` VALUES (1078, '代代木八幡宫', '日本东京都涉谷区代代木5丁目1-1', 35.672013, 139.688719, '位于涩谷区代代木地区的八幡宫，自古以来就在其供奉的代代木八幡宫举行代代木伴奏和代代木捣年糕歌表演。以祛除厄运、开运的神明而出名的代代木八幡神社，有着“带来幸运的鸠签”。', 1, 1, 0, '2021-12-08 10:40:35.192420', '2021-12-08 10:40:35.448223', 53, 1, '东京都');
