INSERT INTO `tb_places` VALUES (1080, '新宿站', '日本东京都新宿区新宿3丁目38', 35.68940025, 139.70054448, '新宿站是日本东京新宿最主要的铁路车站，整个站区横跨东京都的新宿区与涩谷区，使用之铁路业者包括东日本旅客铁道（JR东日本）、小田急电铁、京王电铁、东京地铁及都营地铁等。其每日使用人次（以出入闸人次计算），JR路线为157万，属日本第1位；各铁路业者总和则达每日364万人次，是世界上使用人次最多的铁路车站。', 1, 1, 0, '2021-12-08 10:40:47.682957', '2021-12-08 10:40:47.935816', 53, 1, '东京都');
INSERT INTO `tb_places` VALUES (1081, '武藏浦和站', '日本埼玉县琦玉市南区别所7丁目12', 35.84534878, 139.64687809, '武藏浦和站是东日本旅客铁道（JR东日本）的一个铁路车站，位于埼玉县埼玉市南区别所七丁目。武藏浦和站是一个高架车站，可分为两个部份。在东边较矮的是武藏野线的月台，采2座侧式月台2线设计。在西边较高的是埼京线的月台，采2座岛式月台4线设计，其西侧是东北新干线的线路。两条路线在靠近大宫的一边交汇，其中埼京线（和东北新干线）的线路居上，而武藏野线的线路则在下方。', 1, 1, 0, '2021-12-08 10:40:57.814429', '2021-12-08 10:40:58.070908', 53, 1, '埼玉市');
INSERT INTO `tb_places` VALUES (1082, '参宫桥立交桥下电话亭', '日本东京都涉谷区代代木4丁目', 35.680004, 139.693748, '位于参宫桥站北面立交桥下的电话亭。', 1, 1, 0, '2021-12-08 10:41:00.987484', '2021-12-08 10:41:01.413946', 53, 1, '东京都');
INSERT INTO `tb_places` VALUES (1083, '大宫站', '日本埼玉县埼玉市大宫区锦町630', 35.90681871, 139.62441813, '大宫站是东日本旅客铁道、东武铁道和埼玉新都市交通的铁路车站，位于日本埼玉县埼玉市大宫区锦町。车站站房包括车站大楼“Lumine（ルミネ）”，内部设有店铺，屋顶也成为停车场，成为一个规模庞大的建筑。此外，车站大堂设有绿色窗口、View Plaza及资讯中心等设施。', 1, 1, 0, '2021-12-08 10:41:05.916982', '2021-12-08 10:41:06.170057', 53, 1, '埼玉市');
INSERT INTO `tb_places` VALUES (1084, '久喜站', '日本埼玉县久喜市久喜东1丁目1', 36.065751, 139.67809, '久喜站是东日本旅客铁道宇都宫线和东武铁道伊势崎线的车站。', 1, 1, 0, '2021-12-08 10:41:13.601957', '2021-12-08 10:41:13.858570', 53, 1, '久喜市');
INSERT INTO `tb_places` VALUES (1085, '野木站', '日本栃木县下都贺郡野木町丸林', 36.229958, 139.734719, '野木站是东日本旅客铁道宇都宫线的铁路车站，位于栃木县下都贺郡野木町丸林。', 1, 1, 0, '2021-12-08 10:41:18.113798', '2021-12-08 10:41:18.368316', 53, 1, '野木町');
INSERT INTO `tb_places` VALUES (1086, '小山站', '日本栃木县小山市城山町3丁目', 36.312827, 139.806489, '小山站位于栃木县小山市城山町三丁目，为东日本旅客铁道、日本货物铁道的铁路车站。', 1, 1, 0, '2021-12-08 10:41:23.026002', '2021-12-08 10:41:23.282856', 53, 1, '小山市');
