INSERT INTO `tb_places` VALUES (1089, '代代木公园', '日本东京都涉谷区代代木神园町2-1', 35.67173091, 139.69494402, '代代木公园的前身为日本陆军的练兵场，后在东京奥运会期间作为运动员村，而后再改建成现在的公园，是目前东京都内占地面积第四大的公园。园内环境优雅，是东京人野餐、运动、享受大自然的主要场所和免费大氧吧，常有年轻人在此练习乐器、排演话剧和舞蹈。也是东京都内赏樱胜地之一，园内种植有近两万株树木。', 1, 1, 0, '2021-12-08 10:42:00.762988', '2021-12-08 10:42:01.020018', 53, 1, '东京都');
INSERT INTO `tb_places` VALUES (1090, '种子岛星原地区农道', '日本鹿儿岛县熊毛郡中种子町纳官', 30.58349906, 130.96845113, '', 1, 1, 0, '2021-12-08 10:42:10.114813', '2021-12-08 10:42:10.369499', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1091, '种子岛中央高等学校', '日本鹿儿岛县熊毛郡中种子町野间4258-1', 30.54046423, 130.96205584, '2010年3月，中种子高中和南种子高中闭校，合并成立鹿儿岛县立种子岛中央高等学校。由于中种子地区和南种子地区距离较远，中种子高中的校舍还继续使用。通学交通除了单车之外，学校还允许使用小机车。', 1, 1, 0, '2021-12-08 10:42:13.644515', '2021-12-08 10:42:13.902778', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1092, '中山海岸', '日本鹿儿岛县熊猫郡中种子町野間891-3604', 30.529389, 130.992361, '中山海岸位于种子岛东部，距离中央高校大概4km的路程。', 1, 1, 0, '2021-12-08 10:42:21.905351', '2021-12-08 10:42:22.160530', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1093, '中种子町中心南部农道', '日本鹿儿岛熊毛郡中种子町野间', 30.512925, 130.960712, '', 1, 1, 0, '2021-12-08 10:42:30.764469', '2021-12-08 10:42:31.015325', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1094, 'i便利店 石堂大平店', '日本鹿儿岛县熊毛郡中种子町野间2172-1', 30.54632984, 130.97107611, '种子岛上的一家便利店，位于县道75号线上。\n电影《秒速五厘米》曾在此取景，店内放有《秒速五厘米》巡礼的留言簿，上面记录着各地影迷来到这里的心情。', 1, 1, 0, '2021-12-08 10:42:33.218924', '2021-12-08 10:42:33.472732', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1095, '中种子町中心附近乡道', '日本鹿儿岛县熊毛郡中种子町纳官', 30.54941, 130.959084, '', 1, 1, 0, '2021-12-08 10:42:47.542258', '2021-12-08 10:42:47.799423', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1096, '绿之旅馆·荣', '日本鹿儿岛县熊毛郡中种子町野间6122-3', 30.53010306, 130.95765261, '位于种子岛中種子町市街的一家旅店，兼营炭烧居酒屋。\n导演新海诚为《秒速五厘米》在鹿儿岛取景时曾在此处入住。', 1, 1, 0, '2021-12-08 10:42:49.330484', '2021-12-08 10:42:49.584036', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1097, '太阳里公园', '日本鹿儿岛中种子町野間5936', 30.53046124, 130.96563847, '太阳里公园位于中种子町东部的中种子中央运动公园内，是一个综合运动娱乐场所。', 1, 1, 0, '2021-12-08 10:42:52.203576', '2021-12-08 10:42:52.453775', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1098, '中种子町国道58号线', '日本鹿儿岛县熊毛郡中种子町国道58号线', 30.536845, 130.959763, '种子岛中种子町国道58号线，是中种子町的商业街。', 1, 1, 0, '2021-12-08 10:43:02.677196', '2021-12-08 10:43:02.942369', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1099, '小田急参宫桥3号铁道口', '日本东京都涉谷区代代木5丁目', 35.67530788, 139.69172893, '', 1, 1, 0, '2021-12-08 10:43:07.702396', '2021-12-08 10:43:07.961005', 53, 1, '东京都');
INSERT INTO `tb_places` VALUES (1100, '新宿住友大厦', '日本东京都新宿区西新宿2丁目6-1', 35.691287, 139.692596, '新宿住友大厦是日本东京都新宿区西新宿超高层建筑群中的一栋摩天大楼，高210.3米，目前是东京第14高楼。', 1, 1, 0, '2021-12-08 10:43:17.649856', '2021-12-08 10:43:17.906474', 53, 1, '东京都');
INSERT INTO `tb_places` VALUES (1101, '旧种子岛机场', '日本鹿儿岛县熊毛郡中种子町野间', 30.54388889, 130.95472222, '已于2006年3月废止使用，新建的种子岛机场在旧机场北部约8公里处。旧机场废弃前有往来大阪国际机场和鹿儿岛机场的航线。\n电影《秒速五厘米》曾在此处取景。', 1, 1, 0, '2021-12-08 10:43:27.326301', '2021-12-08 10:43:27.577943', 53, 1, '中种子町');
INSERT INTO `tb_places` VALUES (1102, '上色见熊野座神社', '日本熊本县阿苏郡高森町上色町', 32.85638982, 131.15845788, '上色见熊野座神社的历史非常久远，创立时间不明，据说是由纪州熊野迁移而来，为祭祀南乡总镇守而建。天正年间战火烧毁了这座神社，现在保留下来的建筑是于1722年重建的。\n上色见熊野座神社位于海拔670米的月形山山路上，100基的石灯笼排列在参拜道两侧，似乎永远持续向远方的台阶，飘荡着的不像世间所能拥有的气氛，被翡翠色渲染成朦胧一片的苔藓和古木……既庄严又神秘，有着被称为“将人引向异世界”的超自然般的景色。', 1, 1, 0, '2021-12-08 10:43:39.907878', '2021-12-08 10:43:40.162287', 54, 1, '阿苏郡');
INSERT INTO `tb_places` VALUES (1103, '青井阿苏神社', '日本熊本县人吉市上青井町118', 32.213415, 130.752897, '青井阿苏神社位于熊本县人吉市，神社内包括本殿内的五幢建筑被认定为日本重要物质文化遗产。\n神社内有大片荷花池，以及成排红色鸟居，景色美丽壮观。', 1, 1, 0, '2021-12-08 10:44:13.556891', '2021-12-08 10:44:13.808551', 54, 1, '人吉市');
INSERT INTO `tb_places` VALUES (1104, '多良木站', '日本熊本县球磨郡多良木町', 32.26281254, 130.93317365, '熊本县南部球磨郡的一个车站。', 1, 1, 0, '2021-12-08 10:44:17.494159', '2021-12-08 10:44:17.747981', 54, 1, '球磨郡');
